(59174, 'frFR', 'Short-Supply Reward', '', '', '', '', '', '', '', '', 33528),
(59173, 'frFR', 'Short-Supply Reward', '', '', '', '', '', '', '', '', 33528),
(59019, 'frFR', 'Appel aux armes : Uldum', 'Tuez des soldats de la Horde en Uldum.', 'Le bon déroulement de notre mission en Uldum est compromis par l\’incursion de la Horde.\n\nInfiltrez les lieux et tuez-en un maximum.', '', '', '', '', '', '', 33528),
(59018, 'frFR', 'Appel aux armes : val de l\’Éternel printemps', 'Tuez des soldats de la Horde dans le Val de l\’Éternel printemps.', 'Le bon déroulement de notre mission dans le val de l\’Éternel printemps est compromis par l\’incursion de la Horde.\n\nInfiltrez les lieux et tuez-en un maximum.', '', '', '', '', '', '', 33528),
(59017, 'frFR', 'Appel aux armes : val de l\’Éternel printemps', 'Tuez des soldats de l\’Alliance dans le Val de l\’Éternel printemps.', 'Ces rats de l\’Alliance ne cessent de perturber nos opérations dans le val de l\’Éternel printemps.\n\nDébarrassez la région de cette vermine et revenez me voir.', '', '', '', '', '', '', 33528),
(59016, 'frFR', 'Appel aux armes : Uldum', 'Tuez des soldats de l\’Alliance en Uldum.', 'Ces rats de l\’Alliance ne cessent de perturber nos opérations en Uldum.\n\nDébarrassez la région de cette vermine et revenez me voir.', '', '', '', '', '', '', 33528),
(59000, 'frFR', 'Éléments de corruption', 'Adressez-vous à D.A.M.E. pour en savoir plus sur les Objets corrompus.', 'La corruption se comporte de façon bien mystérieuse. Elle s\’est insinuée au-delà d\’Azeroth, jusque dans nos pensées les plus intimes et parfois même jusqu\’à certaines reliques, comme vous avez pu le constater.\n\nJe ne suis pas en mesure de vous en dire davantage sur ses effets, mais D.A.M.E. dispose certainement d\’informations à propos de ces fameux « objets corrompus ».', '', '', '', '', '', '', 33528),
(58991, 'frFR', 'Curieuse corruption', 'Renseignez-vous sur l\’Objet corrompu dans la Chambre du Cœur.', '<Cet objet a l\’air très particulier. Peut-être que quelqu\’un pourrait vous en dire plus sur ses origines dans la chambre du Cœur.>', '', '', '', '', '', '', 33528),
(58990, 'frFR', 'Œuf de titanus', '', '', '', '', '', '', '', '', 33528),
(58989, 'frFR', 'La forgerune pour les nuls', 'Utilisez le talent Runeforge de votre grimoire afin de graver une rune sur votre arme.\n\nVous pourrez la remplacer à tout moment, dans la mesure où vous vous trouverez à proximité d\’une forgerune.', 'Les chevaliers de la Lame d\’ébène doivent être prêts à faire face à toutes sortes de situations. Pour vous aider dans votre devoir, vous pouvez désormais faire appel à l\’art ténébreux de la forgerune, qui vous permet de graver de puissantes runes sur vos armes.\n\nLe Cœur d\’Achérus, au-dessus de nous, abrite des forgerunes. Utilisez l\’une d\’elles pour imprégner une arme avec une rune de puissance.', 'Arme blasonnée', '', '', '', '', '', 33528),
(58981, 'frFR', 'Ruche durcie', '', '', '', '', '', '', '', '', 33528),
(58974, 'frFR', 'Les colons attaqués', '', '', '', '', '', '', '', '', 33528),
(58961, 'frFR', 'Les colons attaqués', '', '', '', '', '', '', '', '', 33528),
(58952, 'frFR', 'Flammes purificatrices', '', '', '', '', '', '', '', '', 33528),
(58904, 'frFR', 'Éclats de corruption', 'Récupérez $0oa Éclats de corruption.', '<Vous sentez une force ténébreuse et inhumaine faire pression sur votre esprit. Elle s\’insinue en votre for intérieur et fait vaciller votre santé mentale. Vous ressentez un besoin impérieux de vous procurer davantage d\’éclats… tous les éclats.>', '', '', '', '', '', 'Trouvez l\’idole d\’iniquité.', 33528),
(58903, 'frFR', 'La défense d\’Azeroth', 'Parlez au Généralissime Darion Mograine, puis utilisez sa Porte de la mort pour vous rendre à Orgrimmar. Une fois sur place, consultez le Tableau de commandement du chef de guerre et faites votre choix.', 'Excellent choix.\n\nDes heures sombres nous attendent. Vous aurez bientôt l\’insigne honneur de défendre notre monde aux côtés des autres élus qui partagent avec vous ce qui est à la fois un fardeau et un privilège.\n\nMais sachez également que les ignorants vous mépriseront. Les mortels sont trop souvent incapables de faire abstraction de la peur que leur inspire notre apparence. Faites fi de leur jugement et accomplissez votre devoir.\n\nAllez voir votre commandant, puis utilisez sa porte de la mort pour gagner le monde des vivants et choisir votre destinée.', '', '', '', '', '', '', 33528),
(58902, 'frFR', 'La défense d\’Azeroth', 'Parlez au Généralissime Darion Mograine, puis utilisez sa Porte de la mort pour vous rendre à Hurlevent. Une fois sur place, consultez le Tableau de l\’appel des héros et faites votre choix.', 'Excellent choix.\n\nDes heures sombres nous attendent. Vous aurez bientôt l\’insigne honneur de défendre notre monde aux côtés des autres élus qui partagent avec vous ce qui est à la fois un fardeau et un privilège.\n\nMais sachez également que les ignorants vous mépriseront. Les mortels sont trop souvent incapables de faire abstraction de la peur que leur inspire notre apparence. Faites fi de leur jugement et accomplissez votre devoir.\n\nAllez voir votre commandant, puis utilisez sa porte de la mort pour gagner le monde des vivants et choisir votre destinée.', '', '', '', '', '', '', 33528),
(58887, 'frFR', 'Alpaga gâté', '', '', '', '', '', '', '', '', 33528),
(58881, 'frFR', 'Suivi de quête', '', '', '', '', '', '', '', '', 33528),
(58879, 'frFR', 'Alpaga gavé', '', '', '', '', '', '', '', '', 33528),
(58877, 'frFR', 'Le pouvoir grandissant de la mort', 'Jurez fidélité au Roi-liche.', 'Écoutez-moi attentivement, $n. La tornade destructrice qui se lève à l\’horizon menace les fondements mêmes de notre existence. Plus que jamais, Azeroth a besoin de nous pour assurer sa défense.\n\nVoilà pourquoi j\’ai décidé d\’accueillir ceux de votre race dans les rangs de mes champions. Les sacrifices que vous avez consentis vous distinguent de vos congénères, $r. Soyez-en $gfier:fière;, car vous êtes désormais et pour l\’éternité un chevalier de la mort de la Lame d\’ébène.\n\nÀ présent, jurez-moi fidélité.', '', '', '', '', '', '', 33528),
(58876, 'frFR', 'Le Vol perdu', 'Apportez le Rejeton de Vexiona à Irion, dans la Chambre du Cœur.', '<Un petit dragon surgit de l\’une des chambres latérales de l\’immense carapace de N\’Zoth. Il semble désorienté.\n\nCes pièces devaient être utilisées pour corrompre les dragons en les soumettant directement aux sombres murmures de N\’Zoth. Ces créatures étaient condamnées à perdre l\’esprit dès le plus jeune âge. Un sort pire encore que celui des membres du Vol draconique du Crépuscule que vous aviez croisés.\n\nRien ni personne n\’aurait pu leur faire recouvrer la raison.\n\nMais peut-être n\’est-il pas trop tard pour celui-ci…>', '', '', '', '', '', '', 33528),
(58866, 'frFR', 'Selle qu\’il me fallait', 'Apportez la Selle surnaturelle à H\’Partho Adoros à Ramkahen.', 'La selle est terminée. Je ne peux pas dire que j\’ai apprécié de travailler ce métal corrompu, mais au final, je peux affirmer sans l\’ombre d\’un doute qu\’il s\’agit de la meilleure selle que j\’ai jamais conçue.\n\nJe sais qu\’elle a l\’air… menaçante à première vue, mais je vous assure que votre Aqir la trouvera très confortable.\n\nJ\’espère qu\’elle vous sera utile.', '', '', '', '', '', '', 33528),
(58865, 'frFR', 'Des armes surnaturelles', 'Récupérez $1oa Armes de l\’Empire noir sur des sectateurs de l\’Empire noir en Uldum et au Val de l\’Éternel printemps.', 'Pour concevoir une selle pour votre bête, il va me falloir des matériaux spéciaux. Principalement, du métal plus léger que celui dont nous disposons.\n\nJ\’ai remarqué que les sectateurs de l\’Empire noir transportent des armes faites dans des matériaux surnaturels, qui sont incroyablement légers et solides.\n\nSi vous pouviez récupérer certaines de ces armes pour moi, je devrais pouvoir fondre ce métal et le forger afin d\’en faire une selle pour votre Aqir.', '', '', '', '', '', '', 33528),
(58863, 'frFR', 'Une commande personnalisée', 'Parlez au Forgeron Abasi à Ramkahen.', 'Je pense qu\’on peut dire que notre petit ami n\’est plus un jeune Aqir, mais bien un adulte désormais ! En fait, il a tellement grandi qu\’il pourrait vous servir de monture pour aller au combat.\n\nMais… c\’est une merveilleuse idée !\n\nVous devriez aller parler au forgeron Abasi pour qu\’il vous fasse une selle.', '', '', '', '', '', '', 33528),
(58862, 'frFR', 'Pierre de petite taille', 'Terrassez le Défenseur de pierre baruk lors d\’un Combat de mascottes avec le Jeune barbillombre dans votre groupe.', 'Les Mogu baruk sont connus pour animer d\’antiques statues qui défendent leur territoire. Ce sont des adversaires coriaces et affronter un ennemi avec des défenses aussi rigides peut vous en apprendre beaucoup.\n\nHeureusement pour nous, il semblerait qu\’un de leurs sculpte-pierres ait animé par erreur une petite idole. Le Mogu qui l\’a conçue l\’a jugée inutile et laissée derrière lui, mais elle pourrait servir à l\’entraînement de notre petit.\n\nTrouvez ce défenseur miniature dans le val de l\’Éternel printemps.', '', '', '', '', '', '', 33528),
(58861, 'frFR', 'Le meilleur des mantides', 'Terrassez un Jeune vil\’thik lors d\’un combat de mascottes, avec le Jeune barbillombre dans votre groupe.', 'Observer les techniques de combat des mantides pourrait se révéler utile à l\’entraînement de notre petit, en lui montrant une autre façon d\’utiliser les armes naturelles d\’un insecte.\n\nJ\’ai trouvé un adversaire mantide que notre petit pourrait affronter dans le val de l\’Éternel printemps. Conduisez-le là-bas et voyez comment il se débrouille.', '', '', '', '', '', '', 33528),
(58860, 'frFR', 'Volée des hannetons', 'Terrassez un Rampeur des sables aqir lors d\’un combat de mascottes, avec le Jeune barbillombre dans votre groupe.', 'Ça pourrait faire du bien à notre petit d\’affronter un autre Aqir, pour qu\’il apprenne de quoi les siens sont capables.\n\nJ\’ai trouvé un adversaire qui devrait représenter un défi intéressant.', '', '', '', '', '', '', 33528),
(58859, 'frFR', 'Un adversaire à sa taille', 'Terrassez Rétinus le Traqueur lors d\’un combat de mascottes, avec le Jeune barbillombre dans votre groupe.', 'Même si combattre à vos côtés est sans doute un excellent entraînement pour notre petit, parfois il vaut mieux le laisser lutter seul contre des adversaires à sa taille.\n\nJe connais quelqu\’un qui pourrait faire l\’affaire non loin d\’ici… Un individu qui observe les Amathet près de l\’obélisque des Étoiles. Vous devriez partir à sa recherche.', '', '', '', '', '', '', 33528),
(58858, 'frFR', 'Plus de filets fétides', 'Récupérez $1oa morceaux de chair corrompue sur les créatures dans les zones attaquées par les serviteurs de N\’Zoth.', 'Notre petit ami a de nouveau faim.\n\nPourriez-vous aller lui chercher un morceau à grignoter ?', '', '', '', '', '', '', 33528),
(58831, 'frFR', 'Développer ses instincts', 'Utilisez le Sifflet de H\’partho pour invoquer votre Jeune aqir et vaincre des ennemis avec son aide, en Uldum ou dans le Val de l\’Éternel printemps. Combattre des ennemis plus puissants et rares accélérera la croissance de votre Aqir.', 'On dirait que notre petit ami a hâte de s\’entraîner à nouveau au combat.\n\nVous pouvez vous occuper de lui, lui montrer les ficelles ?', '', '', '', '', '', '', 33528),
(58830, 'frFR', 'Instincts aqir', 'Utilisez le Sifflet de H\’partho pour invoquer votre Jeune aqir et vaincre des ennemis avec son aide, en Uldum ou dans le Val de l\’Éternel printemps. Combattre des ennemis plus puissants et rares accélérera la croissance de votre Aqir.', 'En observant les Aqir affronter les Bat-le-désert, j\’ai noté que les nouveaux-nés se joignaient immédiatement au combat. Il semblerait que le besoin de combattre soit inné chez ces créatures.\n\nNous devrions approfondir ce trait chez notre jeune Aqir, sous votre supervision, bien sûr. Amenez-le avec vous et montrez-lui comment combattre nos ennemis.\n\nIl n\’aura probablement pas beaucoup d\’endurance, alors ne l\’appelez pas tant que vous ne serez pas $gprêt:prête; à l\’entraîner.\n\nAvec un peu de chance, il finira par nous considérer comme faisant partie de son essaim.', '', '', '', '', '', '', 33528),
(58829, 'frFR', 'Ils grandissent si vite', 'Aidez la Larve aqir à sortir de son cocon à Ramkahen.', 'Regardez ! Notre petite larve est passée au stade de chrysalide !\n\nUne minute… On dirait qu\’elle s\’apprête à en sortir.\n\nAllez lui donner un coup de main !', '', '', '', '', '', '', 33528),
(58826, 'frFR', 'Une friandise sanglante', 'Récupérez $1oa Fioles d\’anima purifié sur des Mogu dokani dans le Val de l\’Éternel printemps.', 'J\’ai entendu dire qu\’un clan mogu, les Dokani, était parvenu à exploiter la force vitale dans une substance qu\’ils appellent « anima ».\n\nSi c\’est effectivement la vie concentrée sous forme liquide, alors elle devrait avoir des propriétés spectaculaire si on l\’utilisait sur notre larve aqir.\n\nEssayez de rapporter un peu de cet anima, sous une forme que nous pourrons exploiter. Nous verrons si notre petit ami ici présent aime ça !', '', '', '', '', '', '', 33528),
(58825, 'frFR', 'Super gelée', 'Récupérez $1oa Gelées royales concentrées dans le Val de l\’Éternel printemps.', 'Mes amis du Lotus doré m\’ont appris des choses intéressantes sur le nouvel essaim mantide. Apparemment, ils ont développé une gelée royale concentrée qui accélère la croissance des mantides fraîchement éclos.\n\nSi cette gelée fonctionne sur les mantides, la logique voudrait qu\’il en soit de même pour les Aqir.\n\nVoyez si vous pouvez en récupérer un échantillon suffisant pour accélérer la croissance de notre larve.', '', '', '', '', '', '', 33528),
(58818, 'frFR', 'Les ailes de l\’amitié', 'Attrapez $1oa Jeunes fouisseurs de grès dociles en Uldum.', 'C\’est moi ou notre petit compagnon a l\’air de se sentir seul ? Ça serait logique, puisque les Aqir sont des créatures sociales, formant des essaims. Ça doit être dur pour lui de ne pas avoir d\’ami de sa race.\n\nVous pourriez lui trouver des amis, non ? Rien de trop gros ou effrayant, bien sûr, mais peut-être qu\’un de ces petits scarabées pourrait lui tenir compagnie.\n\nQu\’en pensez-vous ?', '', '', '', '', '', '', 33528),
(58817, 'frFR', 'Figurines', 'Récupérez $1oa Figurines amathet sur des Amathet en Uldum.', 'Je viens de me rendre compte que la vie actuelle de notre larve est plutôt ennuyeuse. Nous devrions essayer de lui trouver quelque chose pour l\’occuper.\n\nAprès tout, une larve heureuse est une larve en bonne santé !\n\nJe pense que les Amathet conservent des figurines pour le culte de leurs dieux. Elles devraient pouvoir servir de jouet à notre petit ami ici présent. Voyez si vous ne pouvez pas en trouver quelques-unes !', '', '', '', '', '', '', 33528),
(58813, 'frFR', 'Filets fétides', 'Récupérez $1oa morceaux de chair corrompue sur les créatures dans les zones attaquées par les serviteurs de N\’Zoth.', 'Vous savez, je viens de me rendre compte que depuis que cette créature a été imprégnée par l\’énergie du Vide, elle préfére peut-être une source de nourriture plus… corrompue.\n\nJe parle, bien sûr, des serviteurs de N\’Zoth.\n\nC\’est peu probable, mais ça vaut le coup d\’essayer.', '', '', '', '', '', '', 33528),
(58812, 'frFR', 'Viandes alternatives', 'Récupérez $1oa morceaux de Viande d\’insectoïde sur les Aqir, les Mantides ou d\’autres insectes en Uldum ou au Val de l\’Éternel printemps.', 'Dans la nature, il est assez courant pour les insectes d\’en manger d\’autres de leur espèce. Je me demande si ça s\’applique pour les Aqir également.\n\nPourriez-vous rapporter de la viande aqir ou mantide ? Nous verrons bien si c\’est du goût de notre ami.', '', '', '', '', '', '', 33528),
(58811, 'frFR', 'Un régime équilibré', 'Récupérez $1oa morceaux de viande sur les animaux d\’Uldum et au Val de l\’Éternel printemps.', 'Maintenant que notre larve a éclos, nous allons devoir identifier son régime alimentaire pour qu\’elle reste en bonne santé. \n\nIl semblerait que les Aqir soient carnivores, mais les seules choses que je les ai vus dévorer, c\’était… eh bien… nous.\n\nBien sûr, nous ne pouvons pas donner des gens à manger à notre petit compagnon, donc il va falloir trouver une alternative. Peut-être de la viande animale ?', '', '', '', '', '', '', 33528),
(58810, 'frFR', 'Sortir de sa coquille', 'Regardez l\’Œuf aqir éclore à Ramkahen.', 'On dirait que notre œuf est sur le point d\’éclore ! Comme c\’est excitant !\n\nVenez, accueillons notre nouveau petit compagnon dans ce monde.', '', '', '', '', '', '', 33528),
(58809, 'frFR', 'Une technique électrisante', 'Récupérez $1oa composants de Bâton de foudre au Val de l\’Éternel printemps.', 'J\’ai entendu dire que les Mogu se servent la foudre pour accélérer la croissance des serpents-nuages. Je me demande si nous pourrions utiliser le même principe pour notre ami aqir ?\n\nIl n\’y a qu\’un moyen de le découvrir ! Rendez-vous dans le Val de l\’Éternel printemps pour récupérer tous les composants entrant dans la fabrication d\’un bâton de foudre.\n\nS\’il fonctionne de la même façon que pour les serpents-nuages, cela devrait accélérer considérablement le processus d\’éclosion.', '', '', '', '', '', '', 33528),
(58808, 'frFR', 'Une chambre d\’ambre', 'Marquez un Incubateur en ambre que H\’partho pourra transporter par les airs au Val de l\’Éternel printemps.', 'Vous savez qui en connaît sûrement un rayon sur l\’incubation des œufs ? Les mantides !\n\nBon, bien sûr, ils sont trop occupés à essayer de nous faire la peau pour partager ce qu\’ils savent, mais il y a peut-être un autre moyen de profiter de leurs connaissances !\n\nÀ mon avis, on doit pouvoir réutiliser l\’un de leurs incubateurs en ambre. Ça accélérera le processus, c\’est certain !\n\nTrouvez-en un et marquez-le, je tâcherai de le transporter par les airs.', '', '', '', '', '', '', 33528),
(58807, 'frFR', 'Toutes toiles dehors', 'Récupérez $1oa morceaux de Toile aqir sur des Lanceurs de sorts aqir en Uldum.', 'Une des curiosités que j\’ai notées à propos de cet œuf est qu\’il ne possède pas les protections de toile que l\’on trouve habituellement dans les ruches aqir.\n\nJe pense que cette toile a des vertus protectrices, et que cela pourrait être utile à notre œuf.\n\nPendant que vous combattrez les insectes, voyez si vous ne pouvez pas rapporter un peu de cette toile pour que nous puissions faire un cocon à notre œuf pendant sa croissance.', '', '', '', '', '', '', 33528),
(58806, 'frFR', 'La chaleur du soleil', 'Récupérez un Collecteur solaire amathet en Uldum.', 'Les nuits dans le désert d\’Uldum peuvent être affreusement froides. Je crains que notre petit œuf ne supporte pas ces températures.\n\nLes Amathet de l\’est semblent avoir maîtrisé l\’exploitation de l\’énergie solaire. Si nous pouvions emprunter certaines de leurs connaissances, nous pourrions les utiliser pour maintenir l\’œuf au chaud.\n\nGardez l\’œil ouvert et essayez de trouver quelque chose qui nous serait utile.', '', '', '', '', '', '', 33528),
(58805, 'frFR', 'Incubation ininterrompue', 'Collectez $1oa morceaux de Vide cristallisé dans les zones attaquées par les troupes de N\’Zoth.', 'L\’œuf se porte bien, mais nous allons avoir besoin de cristaux supplémentaires pour le maintenir en bonne santé.\n\nPourriez-vous en récupérer davantage ?', '', '', '', '', '', '', 33528),
(58804, 'frFR', 'Incubation du Vide', 'Collectez $1oa morceaux de Vide cristallisé dans les zones attaquées par les troupes de N\’Zoth.', 'Eh bien, une chose est certaine avec cet œuf, c\’est qu\’il a besoin de grandes quantités d\’énergie du Vide pour survivre.\n\nHeureusement pour nous, un Dieu très ancien est en train d\’attaquer Azeroth en ce moment même, pas vrai ?\n\nNon ? oh…\n\nEn tout cas, il devrait y avoir de l\’énergie du Vide en abondance partout où les serviteurs de N\’Zoth frappent. Vous devriez aller en chercher un peu.', '', '', '', '', '', '', 33528),
(58803, 'frFR', 'Éclosion comparable', 'Examinez $1oa Œufs touchés par le Vide en Uldum.', 'Ne vous inquiétez pas, je ne pense pas qu\’il puisse sortir quelque chose de mauvais de cet œuf. Après tout, les Aqir ne naissent pas méchants, pas vrai ?\n\nBien sûr, nous ne savons absolument pas comment prendre soin d\’un tel œuf. Donc j\’aurais besoin que vous fassiez des recherches.\n\nRetournez dans les ruches aqir et voyez si vous pouvez trouver des œufs semblables. Si nous parvenons à observer la façon dont ils sont traités, nous pourrions appliquer ces connaissances au nôtre.', '', '', '', '', '', '', 33528),
(58802, 'frFR', 'L\’œuf incroyable', 'Apportez l\’Œuf touché par le Vide à H\’Partho Adoros à Ramkahen.', '<Les Aqir semblent avoir voulu renforcer cet œuf grâce à la magie du Vide.\n\nIl n\’a pas l\’air d\’être sur le point d\’éclore, donc nous devrions pouvoir l\’étudier en toute sécurité pour découvrir ce qu\’ils prévoyaient d\’en faire.\n\nIl intéressera peut-être un membre de la Ligue des explorateurs.>', '', '', '', '', '', '', 33528),
(58801, 'frFR', 'Entrer dans le Vide', 'Sacrifiez 10 Personnages-joueurs à N\’Zoth sans mourir ni quitter la forme d\’Âme en peine du Vide.', '<Alors que vous vous approchez de l\’idole, les sombres éclats se liquéfient dans votre main. Vous êtes aussitôt $gsubmergé:submergée; par une angoisse écrasante, rapidement supplantée par une béatitude sereine mâtinée d\’une irrépressible envie de… tuer.\n\nUne voix sifflante s\’insinue dans votre esprit.>\n\n$gMon fidèle serviteur:Ma fidèle servante;, je vais te gratifier d\’un avant-goût de ma puissance inimaginable. Tout ce que je te demande en retour, c\’est d\’accomplir une simple tâche. Tue tous ceux qui s\’opposent à moi, sans épargner qui que ce soit. Je compte sur toi, ne me déçois pas…', '', '', '', '', '', '', 33528),
(58782, 'frFR', 'Une fuite précipitée', 'Récupérez $1oa Fournitures bat-le-désert dans des Caches infestées en Uldum.', 'Les Aqir nous ont forcés à déserter précipitamment bon nombre de nos campements en Uldum. Autant vous dire que nous n\’avons pas eu le temps d\’emporter grand-chose.\n\nPuisque vous comptez régler leur compte à ces créatures, pourriez-vous en profiter pour nous rapporter les fournitures que nous avons été contraints d\’abandonner ? \n\nVous pourrez bien sûr conserver tout ce qui vous semblera utile.', '', '', '', '', '', '', 33528),
(58781, 'frFR', 'Terreurs enfouies', 'Terrassez 3 ennemis aqir rares en Uldum.', 'Les Aqir menacent chaque jour davantage le gagne-pain des Bat-le-désert et on raconte que des créatures plus effroyables encore les accompagnent.\n\nNos guerriers sont hardis, mais je tremble à l\’idée qu\’une de ces terreurs du temps jadis puisse s\’en prendre à nous.\n\nJe sais cependant que vous avez déjà triomphé de puissants adversaires. J\’aimerais donc vous demander de mettre votre expérience au service de notre cause.\n\nNous pourrons difficilement aider à protéger la forge si un monstre tout juste tiré de son sommeil nous décime jusqu\’au dernier.', '', '', '', '', '', '', 33528),
(58780, 'frFR', 'Hérauts de l\’essaim', 'Tuez $1oa Dominateurs aqir en Uldum.', 'Les Aqir qui ont attaqué notre camp appartenaient pour l\’essentiel à leurs troupes d\’assaut. Mais nos éclaireurs ont repéré derrière leurs lignes des créatures minces et élancées capables de faire appel à la redoutable magie du Vide.\n\nMon instinct me dit qu\’il s\’agit de leurs chefs. Ces cibles prioritaires doivent être abattues à vue.\n\nVous sentez-vous à la hauteur ?', '', '', '', '', '', '', 33528),
(58779, 'frFR', 'Maîtres des cieux', 'Tuez $1oa Aqir volants en Uldum.', 'Si seulement nous pouvions envoyer d\’autres voltigeurs repousser les Aqir… Mais impossible d\’approcher de l\’obélisque du Soleil tant que l\’endroit grouillera d\’insectes volants.\n\nNous devons éclaircir leurs rangs depuis le sol pour espérer imposer notre supériorité aérienne.\n\nJe peux compter sur vous ?', '', '', '', '', '', '', 33528),
(58778, 'frFR', 'La tête la première', 'Récupérez $1oa Trophées de goliath sur des Goliaths aqir en Uldum.', 'Tout le monde a le moral en berne au camp en ce moment. Il faut dire que se faire dévorer par des insectes n\’incite pas franchement à la bonne humeur.\n\nJe crois cependant avoir trouvé un moyen de remonter le moral des troupes. Il nous faut un trophée !\n\nTâchez de me dénicher la tête d\’un des mastodontes qui rôdent dans le coin, histoire qu\’on la plante au bout d\’une pique pour montrer à ces insectes qui commande. Essayez juste de ne pas trop l\’amocher, d\’accord ?', '', '', '', '', '', '', 33528),
(58777, 'frFR', 'Plein les bottes', 'Écrasez $1oa Larves aqir en Uldum.', '<Zahra écrase de son talon une sorte de limace gluante.>\n\nVous avez vu ça ? Croyez-le ou non, mais cette bestiole apparemment inoffensive est la forme juvénile des insectes que nous combattons.\n\nElles pullulent partout où les Aqir ont élu domicile et se nourrissent de nos morts avant de se transformer en ces monstruosités.\n\nN\’hésitez pas à faire votre devoir en écrasant sous vos bottes toutes celles que vous croiserez.', '', '', '', '', '', '', 33528),
(58776, 'frFR', 'Marcher sur des œufs', 'Détruisez $1oa Amas d\’œufs aqir en Uldum.', 'Les Aqir se reproduisent plus vite que nous ne pouvons les tuer. À ce rythme, ils ne tarderont pas à nous submerger.\n\nLa seule façon de les ralentir serait d\’attaquer directement leurs nids et de détruire leurs œufs, mais cette tâche semble au-dessus de nos forces.\n\nJe souhaite donc faire appel à vos services.\n\nAcceptez-vous de nous aider ?', '', '', '', '', '', '', 33528),
(58765, 'frFR', 'Briseur de siège', 'Sabotez $1oa Chariots de guerre vil\’thik dans le Val de l\’Éternel printemps.', 'Je ne doute pas un seul instant que le Lotus doré saura donner du fil à retordre aux guerriers mantides. Mais leurs chariots de guerre sont une autre paire de manches. Une seule de leurs salves peut décimer l\’une de nos brigades.\n\nSi nous voulons conserver notre avantage, nous allons devoir infiltrer leurs positions et saboter leurs machines de guerre.\n\nJ\’aimerais que vous vous portiez volontaire.', '', '', '', '', '', '', 33528),
(58764, 'frFR', 'Étendards de l\’essaim', 'Brûlez $1oa Bannières zara\’thik dans le Val de l\’Éternel printemps.', 'Les mantides croient avoir gagné la partie. Ils ont même hissé des étendards sur l\’échine du Serpent proclamant leur mainmise sur la région.\n\nIls doivent comprendre que la Pandarie appartient aux Pandarens.\n\nBrûlez leurs bannières.', '', '', '', '', '', '', 33528),
(58763, 'frFR', 'Coup d\’arrêt à la production', 'Détruisez $1oa Réceptacles d\’ambre dans le Val de l\’Éternel printemps.', 'Des structures dans lesquelles ils vivent jusqu\’aux armes qu\’ils portent, l\’ambre est au cœur de pratiquement tous les aspects du quotidien des mantides.\n\nSi nous parvenons à les priver de ce matériau, nous les empêcherons du même coup de produire des armes.\n\nTâchez de découvrir où ils conservent leur ambre et faites en sorte qu\’ils ne puissent pas l\’utiliser.', '', '', '', '', '', '', 33528),
(58762, 'frFR', 'Capturés par l\’essaim', 'Libérez $1oa Prisonniers du Lotus doré détenus dans des Cages en ambre solidifié du Val de l\’Éternel printemps.', 'Cet essaim ne ressemble pas aux autres. Au lieu de tuer tout ce qui bouge comme ils le font habituellement, ces mantides se contentent de capturer nos défenseurs.\n\nJe n\’ose imaginer le sort qu\’ils réservent à leurs prisonniers. \n\nPourquoi n\’iriez-vous pas les délivrer afin que nous n\’ayons jamais à découvrir ce que mijotent ces horreurs ?', '', '', '', '', '', '', 33528),
(58761, 'frFR', 'Écrasez-moi cette vermine !', 'Écrasez $1oa Larves vil\’thik dans le Val de l\’Éternel printemps.', 'Les mantides gardaient autrefois leurs petits à l\’abri de chambres d\’incubation jusqu\’à ce qu\’ils soient prêts à être mis à l\’épreuve dans l\’essaim.\n\nMais ces Vil\’thik sont plus négligents que leurs congénères et laissent leurs larves errer à leur guise. \n\nNe serait-il pas dommage que quelqu\’un les écrase par mégarde ?\n\nBien au contraire…', '', '', '', '', '', '', 33528),
(58760, 'frFR', 'Lames d\’ambre', 'Récupérez $1oa Lames d\’ambre dans le Val de l\’Éternel printemps.', 'Les mantides sont aussi chétifs que veules, mais leurs lames d\’ambre sont redoutables.\n\nIl ne faudrait pas grand-chose pour en faire des armes utilisables par les Mogu.\n\nApportez-m\’en quelques-unes et je ferai en sorte que les Rajani puissent les manier.', '', '', '', '', '', '', 33528),
(58759, 'frFR', 'La garde de l\’impératrice', 'Tuez $1oa Mantides zara\’thik dans le Val de l\’Éternel printemps.', 'Les Zara\’thik constituent la garde d\’élite de l\’impératrice. Gorgés d\’azérite pillée, ils ne reculeront devant rien pour conquérir toute la Pandarie.\n\nS\’ils franchissent l\’échine du Serpent, ils balaieront le Lotus doré comme un fétu de paille.\n\nArrêtez-les au pied de cette muraille, $c.', '', '', '', '', '', '', 33528),
(58758, 'frFR', 'Destructeurs en approche', 'Tuez $1oa Destructeurs kunchong dans le Val de l\’Éternel printemps.', 'Le Lotus doré n\’est pas près d\’oublier le passage du dernier essaim mantide. Avant l\’arrivée du gros de leurs troupes, ces créatures ont envoyé leurs énormes kunchong pour affaiblir nos positions.\n\nTout porte à croire que ces saletés n\’ont pas jugé bon de changer de tactique.\n\nNous devons arrêter ces monstruosités pour permettre au Lotus doré d\’organiser sa défense face à l\’essaim. Je compte sur vous pour nous en débarrasser.', '', '', '', '', '', '', 33528),
(58757, 'frFR', 'L\’épreuve de l\’essaim', 'Tuez $1oa Néssaims vil\’thik dans le Val de l\’Éternel printemps.', 'La formation d\’un essaim est pour les mantides l\’occasion d\’envoyer un grand nombre de leurs jeunes se mesurer à leurs ennemis. Ceux qui survivent rejoignent l\’essaim en tant que guerriers.\n\nNous devons faire de notre mieux pour qu\’ils échouent à cette épreuve.', '', '', '', '', '', '', 33528),
(58756, 'frFR', 'Soigneurs de l\’effroi', 'Tuez $1oa Invocateurs d\’ambre mantides dans le Val de l\’Éternel printemps.', 'Les invocateurs d\’ambre forment l\’une des plus hautes castes de la société mantide. La maîtrise de l\’ambre que leur confère leur magie permet de hâter la récupération de leurs congénères après une bataille.\n\nMieux vaut nous débarrasser au plus vite de ces cibles stratégiques.\n\nSouhaitez-vous vous joindre à nous ?', '', '', '', '', '', '', 33528),
(58755, 'frFR', 'Fournitures stockées', 'Récupérez $1oa Fournitures du Lotus doré trouvées dans des Caches ambrées du Val de l\’Éternel printemps.', 'Les mantides cherchent à mettre la main sur les provisions du Lotus doré, sans doute dans le but de nous affamer.\n\nForce est de constater qu\’ils risquent d\’arriver à leurs fins si nous ne parvenons pas à en récupérer une partie.\n\nProfitez de vos accrochages avec l\’essaim pour essayer de découvrir où ils ont caché ce qu\’ils nous ont volé. Vous nous rendriez un fier service en nous rapportant de quoi assurer notre subsistance.', '', '', '', '', '', '', 33528),
(58754, 'frFR', 'Champions de l\’essaim', 'Terrassez 3 ennemis mantides rares dans le Val de l\’Éternel printemps.', 'Il est clair que Shek\’zara a jeté toutes ses forces dans cette invasion. Nos éclaireurs ont d\’ailleurs repéré certains de ses plus puissants champions sur le champ de bataille.\n\nCes mantides risquent de poser les pires difficultés aux soldats du Lotus doré. Nous allons donc devoir les traquer et les éliminer nous-mêmes.\n\nVous en êtes ?', '', '', '', '', '', '', 33528),
(58749, 'frFR', 'Vol des Vil\’thik', 'Gagnez un combat de mascottes contre Grixis Minipop.', '', '', '', '', '', '', '', 33528),
(58748, 'frFR', 'Coriaces, ces statues vivantes', 'Gagnez un combat de mascottes contre Grixis Minipop.', '', '', '', '', '', '', '', 33528),
(58747, 'frFR', 'Titillation cérébrale', 'Gagnez un combat de mascottes contre Grixis Minipop.', '', '', '', '', '', '', '', 33528),
(58746, 'frFR', 'Petite folie', 'Gagnez un combat de mascottes contre Grixis Minipop.', '', '', '', '', '', '', '', 33528),
(58745, 'frFR', 'Regardez où vous mettez les pieds', 'Gagnez un combat de mascottes contre Grixis Minipop.', '', '', '', '', '', '', '', 33528),
(58744, 'frFR', 'Je suis celui qui murmure', 'Gagnez un combat de mascottes contre Grixis Minipop.', '', '', '', '', '', '', '', 33528),
(58743, 'frFR', 'Bolide des dunes', 'Gagnez un combat de mascottes contre Grixis Minipop.', '', '', '', '', '', '', '', 33528),
(58742, 'frFR', 'Rétinus le Traqueur', 'Gagnez un combat de mascottes contre Grixis Minipop.', '', '', '', '', '', '', '', 33528),
(58741, 'frFR', 'Pierre qui émousse', 'Récupérez $1oa Armes mogu dans le Val de l\’Éternel printemps.', 'Le problème quand on affronte d\’autres Mogu, c\’est que nos armes s\’abîment très vite à force de s\’abattre sur des adversaires de pierre et de métal.\n\nEn tant que seul forgeron des Rajani, j\’ai parfois du mal à répondre aux besoins de nos guerriers.\n\nRapportez-moi toute arme que vous trouverez au cours de vos affrontements avec les Mogu. Je saurai en faire bon usage.', '', '', '', '', '', '', 33528),
(58740, 'frFR', 'Serpents soumis', 'Tuez $1oa Serpents de guerre onyx dans le Val de l\’Éternel printemps.', 'Les serpents de guerre suivent les Zan-Tien partout où ils vont.\n\nCes créatures sont extrêmement dangereuses, croyez-moi. Il est triste de les voir ainsi soumis aux Mogu, mais nous ne pouvons pas les laisser sévir plus longtemps.\n\nJe veux que vous les abattiez avant qu\’ils ne sèment le chaos dans nos rangs.', '', '', '', '', '', '', 33528),
(58737, 'frFR', 'Les découvertes de Magni', 'Apprenez ce que Magni a découvert.', 'Comme si ça suffisait pas de récupérer la forge et de la retaper, je crois bien qu\’les archives des caveaux Mogu\’shan nous ont aussi fourni la clé qui nous permettra de régler définitivement son compte à N\’Zoth !\n\nTenez-vous bien, $gchampion:championne;, vous allez pas en croire vos oreilles.', '', '', '', '', '', '', 33528),
(58708, 'frFR', 'Le Gnome de la situation', 'Allez trouver le Maître-bricoleur Suprétincelle à Boralus.', 'Le maître-bricoleur Suprétincelle exige que vous alliez l\’aider sur-le-champ pour une importante expédition de recherche.\n\nTravailler avec notre estimé maître-bricoleur donnera certainement un coup de pouce à votre carrière. Pour la mienne, ça a fait des miracles !', '', '', '', '', '', '', 33528),
(58705, 'frFR', 'Grande impératrice Shek\’zara', '', '', '', '', '', '', '', '', 33528),
(58679, 'frFR', 'Destructeur en sommeil', '', '', '', '', '', '', '', '', 33528),
(58675, 'frFR', 'Le prix de la paix', 'Assistez au discours du roi Wrynn.', 'Le roi va s\’adresser à nous d\’un instant à l\’autre pour nous parler de sa mission diplomatique auprès de la Horde. \n\nLes autres chefs de l\’Alliance sont déjà arrivés. Gageons qu\’ils ont hâte de savoir ce que Sa Majesté a à leur dire.\n\nPrévenez-moi lorsque vous serez $gprêt:prête;, et nous irons saluer le roi ensemble.', '', '', '', '', '', '', 33528),
(58674, 'frFR', 'Un rassemblement de champions', 'Parlez à Maître Mathias Shaw à Hurlevent.', 'Le roi Wrynn a convoqué les chefs de l\’Alliance à Hurlevent.\n\nEt il a demandé à ce que vous assistiez personnellement à leur réunion qui se déroulera à l\’ambassade.\n\nVenez me trouver à votre arrivée à Hurlevent, je vous attendrai avec les autres.\n\nFaites vite, $n. On ne fait pas attendre le roi…', '', '', '', '', '', '', 33528),
(58673, 'frFR', 'Chef de guerre de la Horde', 'Assistez au rassemblement des champions.', 'Les pourparlers visant à nommer le prochain chef de guerre sont sur le point de commencer.\n\nLes dignitaires de la Horde sont déjà arrivés. Ils vous attendent à l\’ambassade.\n\nPrévenez-moi quand vous serez $gprêt:prête;, et nous irons les saluer ensemble.', '', '', '', '', '', '', 33528),
(58672, 'frFR', 'Un rassemblement de champions', 'Parlez à Valeera Sanguinar à Orgrimmar.', 'Les chefs de la Horde se rassemblent actuellement à Orgrimmar afin d\’élire un nouveau chef de guerre.\n\nEn tant que $gchampion:championne; de la Horde, vous vous devez d\’y assister vous aussi. La réunion aura lieu à l\’ambassade d\’Orgrimmar.\n\nJe pars devant. Passez me voir à votre arrivée, je vous attendrai avec les autres.\n\nHâtez-vous, $gchampion:championne;. C\’est l\’avenir de la Horde qui est sur le point de se jouer…', '', '', '', '', '', '', 33528),
(58662, 'frFR', 'Terreurs fouisseuses', '', '', '', '', '', '', '', '', 33528),
(58661, 'frFR', 'Terreurs fouisseuses', '', '', '', '', '', '', '', '', 33528),
(58660, 'frFR', 'Terreurs fouisseuses', '', '', '', '', '', '', '', '', 33528),
(58646, 'frFR', 'Mange ça !', 'Tuez $1oa Charognardes court-les-dunes en Uldum.', 'Ces hyènes galeuses se font les dents sur tout ce qui passe à leur portée et les artéfacts les plus précieux échappent pas à la règle !\n\nOn peut pas laisser ces sales cabots boulotter l\’patrimoine historique d\’Uldum.\n\nJ\’regrette, mais va falloir réduire leur nombre.', '', '', '', '', '', '', 33528),
(58645, 'frFR', 'Un monde digne d\’être sauvé', 'Empêchez les Amathet de s\’emparer des Salles de l\’Origine.', 'On n\’a rien pu faire. Leurs guerriers… auréolés des flammes du soleil…\n\nIls veulent la forge… pour provoquer la fin du monde…\n\nAllez, vite… Je… je m\’en sortirai…', '', '', '', '', '', '', 33528),
(58643, 'frFR', 'Destruction mutuelle assurée', 'Informez les défenseurs des Salles de l\’Origine des plans des Amathet.', 'Les Amathet comptent reprendre la forge des Origines et l\’utiliser pour éradiquer toute forme de vie sur Azeroth, Dieux très anciens ou autres !\n\nIls risquent de frapper à tout moment. Faut qu\’on avertisse les défenseurs de la forge, et fissa !', '', '', '', '', '', '', 33528),
(58642, 'frFR', 'Objectifs communs', 'Défendez la Grande exploratrice Dellorah pendant qu\’elle déchiffre les Tablettes amathet de la Chambre des Étoiles.', 'Le décret qu\’vous avez trouvé évoque un plan pour vaincre les Dieux très anciens.\n\nY a peu de chance que les Amathet acceptent de collaborer avec nous, mais s\’ils ont une stratégie pour éliminer N\’Zoth, ça vaut le coup d\’mener not\’ petite enquête.\n\nLe décret parle du « moteur d\’ascension ». À mon avis, c\’est comme ça qu\’ils appellent le dispositif de renforcement solaire qu\’on a vu la dernière fois. Faut qu\’on creuse la question pour essayer de découvrir ce qu\’ils manigancent !', '', '', '', '', '', '', 33528),
(58641, 'frFR', 'Chercheurs en corruption', 'Récupérez le Décret du roi-soleil sur des Solegrâces amathet en Uldum.', 'Si quelqu\’un peut nous renseigner sur la « corruption » dont parle cette tablette, ce sont bien les Solegrâces qu\’étaient chargés de l\’éradiquer.\n\nBien sûr, faut pas s\’attendre à ce qu\’ils nous livrent leurs secrets spontanément.\n\nMais j\’me fais pas de bile, vu que j\’ai à mes côtés $gun:une; spécialiste des interrogatoires musclés…', '', '', '', '', '', '', 33528),
(58640, 'frFR', 'Une brèche dans l\’armure', 'Défendez la Grande exploratrice Dellorah pendant qu\’elle déchiffre le Monument amathet à l\’extérieur des Salles de l\’Origine.', 'Les artéfacts que vous avez exhumés prouvent que la tribu des Amathet était fière de défendre les ouvrages des Titans.\n\nÇa confirme nos hypothèses : il a dû leur arriver un truc terrible pour qu\’ils s\’mettent à saccager ce qu\’ils avaient juré de protéger.\n\nFaut qu\’on continue à étudier leurs écrits. D\’ailleurs, j\’crois bien avoir vu un monument plus récent près des salles de l\’Origine.', '', '', '', '', '', '', 33528),
(58639, 'frFR', 'Passé enfoui', 'Exhumez et récupérez $1oa Artéfacts amathet en Uldum.', 'Étant donné que les Amathet sont originaires de la région, ce s\’rait logique qu\’on trouve des artéfacts de leur civilisation enfouis dans le sable.\n\nAutrement dit, y a plus qu\’à retrousser nos manches et à creuser !\n\nLes dunes proches d\’vaient représenter une bonne partie de l\’ancien territoire amathet. Voyons un peu quelles surprises elles nous réservent !', '', '', '', '', '', '', 33528),
(58638, 'frFR', 'Exploration approfondie', 'Défendez la Grande exploratrice Dellorah pendant qu\’elle déchiffre le Monument amathet sur la Terrasse Solpierre.', 'Y a un truc qui tourne pas rond, chez ces Amathet. Pourquoi les protecteurs des ouvrages titanesques iraient s\’en prendre à la forge des Origines ?\n\nFaut qu\’on aille voir ça de plus près. Je crois avoir vu un monument sur la terrasse, là-bas. P\’têt que les inscriptions gravées à sa surface nous en diront un peu plus sur les Tol\’vir.', '', '', '', '', '', '', 33528),
(58636, 'frFR', 'Les yeux rivés sur les Amathet', 'Survolez les territoires amathet avec la Grande exploratrice Dellorah en Uldum.', 'Au nom d\’la Ligue des explorateurs, j\’tiens à vous remercier d\’avoir contribué à la fondation de l\’Accord d\’Uldum et obtenu la coopération de Ramkahen.\n\nLes autorités locales nous ont autorisés à explorer les tombes amathet pour en apprendre davantage sur nos ennemis. Malheureusement, leurs troupes sont pas assez nombreuses pour assurer not\’ protection.\n\nDu coup, j\’me suis dit qu\’on pourrait faire appel à vous.\n\nVous auriez un peu d\’temps à nous consacrer, dites ? Je propose de commencer par un p\’tit survol du secteur.', '', '', '', '', '', '', 33528),
(58634, 'frFR', 'Une porte ouverte sur les ténèbres', 'Parlez à D.A.M.E. pour établir la Porte ténébreuse dans la Chambre du Cœur.', 'La trame de la réalité est déchirée, $n. Mais je n\’ai pas besoin de vous le dire, vous l\’avez vu de vos propres yeux.\n\nCe n\’est qu\’une question de temps avant que ces réalités ne se confondent dans les ténèbres éternelles. Plutôt que de nous cacher, il est peut-être temps pour nous d\’embrasser les ombres.\n\nAvec l\’aide de notre ami titan ici présent, il y a peut-être un moyen de tisser le fil de cette réalité-ci dans la trame d\’une autre afin de créer une sorte de pont interdimensionnel.\n\nAprès tout, pour cerner les faiblesses d\’un ennemi, il convient tout d\’abord de comprendre ses intentions.', '', '', '', '', '', '', 33528),
(58632, 'frFR', 'Ny\’alotha, la cité en éveil : la fin du Corrupteur', 'Terrassez N\’Zoth à Ny\’alotha, la cité en éveil.', 'Grâce aux r\’cherches des Mogu, D.A.M.E. et Ra Den ont trouvé un moyen d\’canaliser le protocole Origine de la forge par la chambre du Cœur. Le hic, c\’est qu\’on savait pas où diriger le tir.\n\nMais cette fois, ça y est.\n\nPrenez ces ancrages et franchissez c\’portail. Vous allez d\’voir les placer à des endroits clés, histoire qu\’on puisse viser. Quand ce sera fait, y aura plus qu\’à tirer.\n\nAttention, on aura droit qu\’à une seule chance. Autant dire qu\’il faut pas se planter, ce coup-ci !', '', '', '', '', '', '', 33528),
(58631, 'frFR', 'Dans les rêves', 'Parlez à D.A.M.E. dans la Chambre du Cœur pour trouver Ra Den.', 'J\’arrive pas à croire que Ra Den se soit sacrifié pour nous sauver. On peut pas le laisser tomber, pas après ce qu\’il a fait !\n\nY a forcément un moyen de découvrir où il est.\n\nVoyons si D.A.M.E. peut le retrouver !', '', '', '', '', '', '', 33528),
(58615, 'frFR', 'Murmures dans les ténèbres', 'Trouvez la source des murmures de N\’Zoth dans la Chambre du Cœur.', 'Vous avez entendu ? Elle sent pas bon, c\’te histoire, foi de Magni.\n\nSi N\’Zoth réussit à accéder à cette chambre, on est cuits !\n\nFaut qu\’on sache d\’où viennent les murmures et qu\’on boucle le périmètre avant qu\’il passe aux choses sérieuses !', '', '', '', '', '', '', 33528),
(58606, 'frFR', 'Aqir sinon rien', 'Récupérez $1oa Échantillons d\’Aqir.', '$p, il pourrait bien s\’agir d\’une découverte capitale !\n\nCela reste encore à confirmer, mais je pense que ces insectes sont des Aqir.\n\nDans les maigres archives en bon état de la Ligue, ces créatures ont été évoquées pour la dernière fois lors d\’une guerre entre les C\’Thraxxi, les Aqir et les premières civilisations trolles.\n\nNous les pensions éteints, mais peut-être étaient-ils simplement en train de… se reconstruire…\n\nPourriez-vous vous procurer quelques échantillons que je puisse examiner ?', '', '', '', '', '', '', 33528),
(58595, 'frFR', 'Les piliers de l\’Oubli', 'Détruisez $1oa Obélisques de l\’Empire noir dans le Val de l\’Éternel printemps.', 'Autrefois, l\’apparition des obélisques noirs des Dieux très anciens présageait l\’arrivée prochaine de leurs armées. Les sombres adjurateurs k\’thir et n\’raqi utilisaient ces monuments pour établir des têtes de pont dans notre monde et y faire entrer leurs troupes.\n\nAujourd\’hui, ces obélisques réapparaissent un peu partout sur les champs de bataille. Tant qu\’ils seront là, les hordes de N\’Zoth continueront d\’affluer sans discontinuer.\n\nÀ charge pour vous d\’y remédier.', '', '', '', '', '', '', 33528),
(58583, 'frFR', 'Du cœur à l\’ouvrage', 'Rejoignez Magni Barbe-de-Bronze dans la Chambre du Cœur.', 'L\’orateur m\’a chargée de vous envoyer auprès d\’Irion et lui pour leur apporter votre soutien.\n\nVous avez maintes fois prouvé que vous étiez $gun allié:une alliée; de poids pour Azeroth, et mon petit doigt me dit que vous avez encore un grand rôle à jouer dans les batailles à venir.\n\nReste à espérer que la Horde et l\’Alliance sauront mettre leurs querelles de côté pour affronter leur ennemi commun.', '', '', '', '', '', '', 33528),
(58582, 'frFR', 'Le retour du prince noir', 'Parlez à Valeera Sanguinar au Grand Sceau, à Dazar\’alor.', 'Je reviens à l\’instant de Hurlevent, où je me suis entretenue avec le roi Wrynn.\n\nNous avons beaucoup à nous dire.\n\nRejoignez-moi en toute hâte au Grand Sceau.', '', '', '', '', '', '', 33528),
(58506, 'frFR', 'Diagnostics réseau', 'Activez les Consoles des Titans de la Chambre du Cœur pour consulter l\’état des forges des Titans aux quatre coins d\’Azeroth.', 'Malheureusement, on a pas le moindre indice quant à l\’endroit où N\’Zoth se cache depuis son évasion. Par contre, on a une p\’tite idée de l\’endroit où il pourrait frapper.\n\nQuand les gardiens ont emprisonné les Dieux très anciens, ils ont intégré aux forges des Titans des mécanismes de défense cont\’ leur corruption. Si N\’Zoth cherche à contaminer à Azeroth, faudra d\’abord qu\’il les déjoue.\n\nEt comme on est en prise directe avec le réseau des forges, on va pouvoir veiller au grain sans bouger d\’ici. Allez-y, jetez donc un coup d\’œil.', '', '', '', '', '', '', 33528),
(58502, 'frFR', 'Du cœur à l\’ouvrage', 'Retournez à la Chambre du Cœur.', 'Il est temps d\’mettre les plans d\’Irion à exécution.\n\nIl est reparti pour la Chambre du Cœur, alors va falloir qu\’on le rejoigne sur place.', '', '', '', '', '', '', 33528),
(58498, 'frFR', 'Le retour du roi guerrier', 'Accompagnez Anduin et récupérez Brise-peur dans le Donjon de Hurlevent.', 'Azeroth vous doit d\’jà une fière chandelle, $ghéros:héroïne;, mais malheureusement, on est pas encore tirés d\’affaire. N\’Zoth court toujours et personne sait où et quand il compte frapper.\n\nCette bataille, vous la gagnerez pas à vous $gseul:seule;. Le moment venu, vous pourrez compter sur mon marteau !\n\nMais pour ça, va d\’abord falloir le récupérer.', '', '', '', '', '', '', 33528),
(58496, 'frFR', 'Un conseil malvenu', 'Parlez au Roi Anduin Wrynn dans le Donjon de Hurlevent.', 'Même avec les forces combinées de la Horde et de l\’Alliance, nous n\’avons toujours pas retrouvé la trace des troupes de N\’Zoth. Depuis sa libération, le Dieu très ancien nous échappe systématiquement.\n\nLa Lumière seule sait quel triste sort il réserve à Azeroth.\n\nRejoignez-moi au donjon de Hurlevent. Ensemble, nous devons échafauder un plan pour découvrir les intentions de l\’ennemi avant qu\’il ne soit trop tard !', '', '', '', '', '', '', 33528),
(58487, 'frFR', 'Les pilleurs pillés', 'Pillez $1oa Butins mogu dans le Val de l\’Éternel printemps.', 'Le pillage des trésors de Lei Shen avait largement contribué à la chute du roi-tonnerre. Je pense que nous devrions nous en inspirer et employer la même stratégie ici.\n\nRetrouvez le butin accumulé par les clans mogu et emparez-vous-en.\n\nNous devons tout faire pour les ralentir.', '', '', '', '', '', '', 33528),
(58485, 'frFR', 'Construites pour tomber', 'Détruisez $1oa Statues mogu dans le Val de l\’Éternel printemps.', 'Les Baruk ont recours aux arts interdits de la nécromancie pour emprisonner les âmes des Mogu morts au combat dans des statues qui se battent ensuite pour eux.\n\nCes pratiques déshonorent notre peuple. Nous devons y mettre un terme !\n\nBrisez leurs précieuses statues et les âmes qu\’ils voleront n\’auront plus aucun réceptacle à corrompre.', '', '', '', '', '', '', 33528),
(58481, 'frFR', 'Rituels sanglants', 'Détruisez $1oa Réservoirs de sang dans le Val de l\’Éternel printemps.', 'Anji et moi avons combattu bien assez d\’ennemis pour savoir comment venir à bout de quelques Mogu… Mais il faut avouer que la magie du sang employée par les Dokani est pour le moins déconcertante !\n\nNon contents d\’éliminer tous ceux qui se trouvent sur leur passage, ils utilisent des cadavres pour accomplir leurs rituels impies ! C\’est monstrueux !\n\nFaites-moi plaisir, si vous tombez sur l\’un de ces rituels, faites en sorte qu\’il n\’aboutisse pas ! Personne ne devrait être victime de cette sombre magie, pas même nos adversaires.', '', '', '', '', '', '', 33528),
(58479, 'frFR', 'Coups de foudre', 'Détruisez $1oa Bâtons de foudre dans le Val de l\’Éternel printemps.', 'Les Zan-Tien prétendent maîtriser la puissance des tempêtes, mais ils se servent de machines pour canaliser la foudre venue du ciel.\n\nMontrez à ces imposteurs que la véritable puissance de l\’orage et des éclairs est innée. Détruisez leurs gadgets et nous verrons alors de quoi ils sont réellement capables.', '', '', '', '', '', '', 33528),
(58478, 'frFR', 'Délogement musclé', 'Tuez $1oa Mogu baruk dans le Val de l\’Éternel printemps.', 'Lorsque la guerre des clans a éclaté dans le Val, les Baruk ont revendiqué le site ancestral de Guo-Lai.\n\nIls n\’en sont pas dignes.\n\nRemettez ces voleurs à leur place et vous gagnerez peut-être une once de reconnaissance auprès des Rajani.', '', '', '', '', '', '', 33528),
(58477, 'frFR', 'De sang, de poussière et d\’os', 'Récupérez $1oa Globules d\’anima sur des Mogu dokani et leurs alliés dans le Val de l\’Éternel printemps.', 'Les Dokani s\’estiment capables de manier l\’antique magie de l\’anima, mais leurs golems et leurs manifestations ne représentent qu\’une infime partie de sa véritable puissance.\n\nConfisquez-leur leur chère substance pour la confier aux Rajani qui en feront un bien meilleur usage.', '', '', '', '', '', '', 33528),
(58471, 'frFR', 'Profilage des agresseurs', 'Utilisez le Carnet du chroniqueur pour consigner des notes sur les Sans-visage, les K\’thir et les Bêtes de chair rencontrés dans le Val de l\’Éternel printemps.', 'Bien que les sha aient été enfantés par les Dieux très anciens, nous autres Pandarens en savons encore très peu à leur sujet.\n\nC\’est l\’occasion ou jamais de consigner dans les archives des Chroniqueurs tout ce que nous pourrons apprendre sur ces créatures. Mais comment les étudier quand elles cherchent à nous massacrer ?\n\nPar chance, ce n\’est pas un problème pour vous. Pourriez-vous me rendre service et prendre des notes sur les adversaires que vous affrontez ? Cela nous aidera à comprendre les forces auxquelles nous sommes confrontés.', '', '', '', '', '', '', 33528),
(58470, 'frFR', 'Curiosités corrompues', 'Récupérez $1oa Artéfacts de l\’Empire noir dans les Caches de l\’Empire noir au Val de l\’Éternel printemps.', 'J\’ai bien conscience de la terrible menace que l\’Empire noir fait peser sur la Pandarie, mais c\’est également une opportunité dont il ne tient qu\’à nous de tirer parti !\n\nBien que nous les ayons déjà affrontés plusieurs fois par le passé, nous en savons encore très peu à propos des Dieux très anciens et du royaume mystérieux de N\’Zoth à Ny\’alotha.\n\nLorsque nous étudions les civilisations antiques, ce sont souvent leurs artéfacts qui nous permettent d\’élucider les mystères enfouis dans les limbes de l\’histoire. Je me demande si les armées du Corrupteur détiennent des objets de ce genre…\n\nÇa ne coûte rien de vérifier, n\’est-ce pas ?', '', '', '', '', '', '', 33528),
(58469, 'frFR', 'Des déchirures dans le val', 'Fermez $1oa Déchirures du Vide dans le Val de l\’Éternel printemps.', 'À l\’heure où l\’influence de N\’Zoth se propage dans le val, c\’est notre réalité elle-même qui commence à voler en éclats.\n\nLa puissance du Dieu très ancien a ouvert dans notre monde une série de brèches qui sont autant de portes ouvertes pour les serviteurs venus de son royaume ténébreux.\n\nTant qu\’on ne les aura pas refermées, l\’emprise de N\’Zoth ne se relâchera pas. Condamnez-les et endiguez l\’afflux de corruption !', '', '', '', '', '', '', 33528),
(58468, 'frFR', 'Des ténèbres grandissantes', 'Détruisez $1oa Incubateurs corrompus dans la Mine du Grand Printemps du Val de l\’Éternel printemps.', 'Les éclaireurs pandashan ont découvert les traces d\’une autre couveuse de mantides dans la mine du Grand Printemps. Apparemment, les Sonderuche cherchent à créer une nouvelle couvée corrompue pour servir N\’Zoth.\n\nSi ces œufs arrivent à éclosion, un nouvel essaim investi des pouvoirs du Dieu très ancien ne tardera pas à envahir le ciel du val et à plonger la Pandarie dans les ténèbres.\n\nNous n\’allons pas les laisser faire sans réagir, n\’est-ce pas ?', '', '', '', '', '', '', 33528),
(58467, 'frFR', 'Prisonniers de corps et d\’esprit', 'Secourez $1oa captifs pandarens dans le Val de l\’Éternel printemps.', 'Les troupes de N\’Zoth ont débarqué dans le val sans crier gare. Le temps que j\’arrive avec mes Pandashan, de nombreux membres du Lotus doré s\’étaient déjà fait capturer par les sbires du Dieu très ancien.\n\nNous avons eu beau unir nos forces, nous avons seulement réussi à limiter le nombre de victimes. Les captifs, eux, sont toujours aux mains de l\’ennemi.\n\nJe sais que nous avons eu des différends, vous et moi, $n, mais si vous pouviez nous aider à les délivrer, les Pandashan vous seraient redevables.', '', '', '', '', '', '', 33528),
(58466, 'frFR', 'Les tourments de l\’Au-delà', 'Délivrez $1oa Anciens esprits pandarens dans le Val de l\’Éternel printemps.', 'Mes éclaireurs sont revenus porteurs de fâcheuses nouvelles… Non content de chercher à dominer les habitants du val, N\’Zoth a également jeté son dévolu sur nos morts !\n\nOr, les Pandashan ont déjà fort à faire pour protéger les vivants. Pouvons-nous compter sur vous pour mettre un terme à ces outrages ?', '', '', '', '', '', '', 33528),
(58465, 'frFR', 'Manifestation corrompue', 'Tuez $1oa Ichors putrides dans le Val de l\’Éternel printemps.', 'La corruption des Dieux très anciens est si concentrée que ses manifestations se matérialisent très régulièrement.\n\nJ\’en veux pour preuve l\’exemple des sha. Et voilà que ça recommence !\n\nÉradiquez la corruption partout où elle gagne du terrain. Nous ne devons surtout pas la laisser se développer.', '', '', '', '', '', '', 33528),
(58464, 'frFR', 'Sus aux Sonderuche', 'Tuez $1oa Mantides sonderuche dans la Mine du Grand Printemps du Val de l\’Éternel printemps.', 'Une secte de mantides qui se font appeler les « Sonderuche » a pris possession de la mine du Grand Printemps. Ces fanatiques se sont entièrement abandonnés à la corruption du Dieu très ancien, ce qui les rend extrêmement dangereux.\n\nNous ne pouvons pas les laisser semer le chaos dans le val. Faites le nécessaire.', '', '', '', '', '', '', 33528),
(58463, 'frFR', 'Rejetons de la folie', 'Tuez $1oa Bêtes de chair dans le Val de l\’Éternel printemps.', 'Quand je pense que le val de l\’Éternel printemps venait à peine de se remettre des déprédations des sha lorsque les Dieux très anciens ont recommencé à le corrompre… Mon sang bout dans mes veines !\n\nNous devons éliminer la corruption avant qu\’elle ne s\’installe à nouveau sur ces terres. Ce sont les bêtes de chair qui escortent les troupes de N\’Zoth qui propagent ses miasmes partout où elles passent.\n\nÀ charge pour vous de les neutraliser définitivement.', '', '', '', '', '', '', 33528),
(58462, 'frFR', 'Fenêtres ouvertes sur l\’âme', 'Tuez $1oa Yeux de l\’Empire dans le Val de l\’Éternel printemps.', 'Comme s\’il ne leur suffisait pas de nous massacrer, nos ennemis s\’en prennent au cœur même de nos défenseurs.\n\nJe veux parler des yeux, bien sûr. Ils sondent les âmes de nos guerriers et retournent leurs plus grandes peurs contre eux.\n\nSi nous voulons avoir une chance de l\’emporter, il faut les éliminer.', '', '', '', '', '', '', 33528),
(58461, 'frFR', 'Tomes de folie antique', 'Récupérez $1oa Tomes de folie antique sur les ennemis k\’thir dans le Val de l\’Éternel printemps.', 'Par les temps qui courent, tous les habitants du val doivent mettre la main à la pâte. Pour ma part, je n\’ai jamais su me battre, aussi mon utilité en temps de guerre est-elle limitée.\n\nCependant, je crois savoir comment apporter ma contribution à notre cause. Voyez-vous, nous savons très peu de choses sur les envahisseurs. Or, le savoir peut s\’avérer une arme redoutable.\n\nIl me semble avoir vu certains des K\’thir porter de mystérieux ouvrages. Si vous pouviez m\’en rapporter quelques-uns, j\’y trouverais peut-être des documents instructifs.', '', '', '', '', '', '', 33528),
(58460, 'frFR', 'Maréchaux de la folie', 'Tuez $1oa serviteurs sans-visage de N\’Zoth dans le Val de l\’Éternel printemps.', 'Les N\’raqi supervisent depuis longtemps les armées des Dieux très anciens. Leur présence sur le champ de bataille prouve qu\’il s\’agit d\’une invasion coordonnée, et non d\’une poussée de corruption spontanée.\n\nAvec ces maîtres sans-visage à leur tête, ces hordes désordonnées se muent en une véritable armée organisée.\n\nNous devons donc les éliminer en priorité. Alors seulement, pourrons-nous prendre l\’avantage contre N\’Zoth.', '', '', '', '', '', '', 33528),
(58458, 'frFR', 'Défi de combat de mascottes : profondeurs de Rochenoire', 'Arrêtez les Silhouettes mystérieuses.', 'Ces silhouettes mystérieuses continuent à nous causer des problèmes… Si vous tenez à y retourner, ce n\’est pas moi qui vous arrêterai…', '', '', '', '', '', '', 33528),
(58457, 'frFR', 'Les ombres de Rochenoire', 'Arrêtez les Silhouettes mystérieuses.', 'Nous avons enfin retrouvé la trace de ces silhouettes mystérieuses ; elles devraient toutes être à l\’intérieur. Ce sont des combattants endurcis, je vous conseille donc d\’y emmener vos meilleures équipes.\n\nFaites-moi signe quand vous serez prêts.', '', '', '', '', '', '', 33528),
(58456, 'frFR', 'Mystérieuse confrontation', 'Retrouvez Burt Macklyn devant l\’entrée des Profondeurs de Rochenoire, au Mont Rochenoire.', 'Le moment est venu ! Nous avons découvert où se cachaient ces silhouettes mystérieuses ; hors de question de les laisser mener leurs plans à bien. Elles se sont installées dans les profondeurs de Rochenoire. À vous de jouer.', '', '', '', '', '', '', 33528),
(58455, 'frFR', 'Mystérieuse confrontation', 'Retrouvez Burt Macklyn devant l\’entrée des Profondeurs de Rochenoire, au Mont Rochenoire.', 'Le moment est venu ! Nous avons découvert où se cachaient ces silhouettes mystérieuses ; hors de question de les laisser mener leurs plans à bien. Elles se sont installées dans les profondeurs de Rochenoire. À vous de jouer.', '', '', '', '', '', '', 33528),
