(58439, 'frFR', 'Gueule dévorante', '', '', '', '', '', '', '', '', 33528),
(58438, 'frFR', 'Gueule dévorante', '', '', '', '', '', '', '', '', 33528),
(58436, 'frFR', 'Armure ancestrale des Mécagnomes', 'Retrouvez le Prince Erazmin à Mécagone.', '$n, vos progrès nous enchantent. Grâce à vous, l\’Alliance ne peut avoir qu\’une très bonne image de notre peuple.\n\nRetournez à Mécagone dès que possible, Waren vous a fabriqué un petit quelque chose.', '', '', '', '', '', '', 33528),
(58435, 'frFR', 'Armure ancestrale des Vulpérins', 'Retrouvez Hagashi au Repaire des Vulpérins, en Vol\’dun.', 'Grâce à vous, la Horde a appris à se fier aux Vulpérins.\n\nOn ne fait pas plus $gVulpérin:Vulpérine; que vous !\n\nRetrouvez-moi au repaire des Vulpérins, en Vol\’dun. Kiro m\’a demandé de fabriquer un petit souvenir pour vous remercier.', '', '', '', '', '', '', 33528),
(58423, 'frFR', 'Les plus forts d\’entre eux', 'Terrassez 3 serviteurs rares de N\’Zoth dans le Val de l\’Éternel printemps.', 'Vous avez fait preuve d\’une grande force lors de vos conquêtes, mais de nouveaux ennemis s\’élancent chaque jour à l\’assaut du Val.\n\nCherchez les créatures les plus redoutables envoyées par nos adversaires et éliminez-les. Qu\’elles servent d\’exemple à leurs alliés !', '', '', '', '', '', '', 33528),
(58422, 'frFR', 'La marque des conquérants', 'Brûlez $1oa Bannières de l\’Empire noir dans le Val de l\’Éternel printemps.', 'Les envahisseurs à la solde de N\’Zoth cherchent à s\’emparer de terres qui ne leur appartiennent pas.\n\nTant que les Rajani n\’auront pas été exterminés jusqu\’au dernier, le val ne se laissera pas conquérir.\n\nBrûlez leurs bannières pour les rappeler à l\’ordre.', '', '', '', '', '', '', 33528),
(58420, 'frFR', 'Nuisibles nauséabonds', 'Tuez $1oa Hozen tentacaudaux dans le Val de l\’Éternel printemps.', 'Les Hozen sont des créatures veules et opportunistes. Je ne suis pas surpris que certains d\’entre eux aient lié leur sort aux Dieux très anciens.\n\nNous devons leur régler leur compte avant qu\’ils ne deviennent vraiment gênants.', '', '', '', '', '', '', 33528),
(58375, 'frFR', 'Ny\’alotha : sous la supervision de D.A.M.E.', 'Récupérez 4 Cœurs des Titans sur Ra Den, 4 Cœurs de dragons sur Vexiona et 4 Yeux prophétiques sur Il\’gynoth à Ny\’alotha, la Cité en éveil en mode Mythique.', 'Ny\’alotha échappe aux grands principes qui régissent habituellement l\’espace et le temps, et il s\’agit pour nous d\’en tirer parti.\n\nD\’après les conclusions de D.A.M.E., les élus de N\’Zoth détiennent des objets susceptibles de nous aider à courber l\’espace-temps afin d\’accélérer notre passage dans le futur. Inutile de préciser qu\’ils ne s\’en sépareront sûrement pas de bon gré.', '', '', '', '', '', '', 33528),
(58374, 'frFR', 'Ny\’alotha : sous la supervision de D.A.M.E.', 'Récupérez 4 Cœurs des Titans sur Ra Den, 4 Cœurs de dragons sur Vexiona et 4 Yeux prophétiques sur Il\’gynoth à Ny\’alotha, la Cité en éveil en mode Héroïque.', 'Ny\’alotha échappe aux grands principes qui régissent habituellement l\’espace et le temps, et il s\’agit pour nous d\’en tirer parti.\n\nD\’après les conclusions de D.A.M.E., les élus de N\’Zoth détiennent des objets susceptibles de nous aider à courber l\’espace-temps afin d\’accélérer notre passage dans le futur. Inutile de préciser qu\’ils ne s\’en sépareront sûrement pas de bon gré.', '', '', '', '', '', '', 33528),
(58373, 'frFR', 'Ny\’alotha : sous la supervision de D.A.M.E.', 'Récupérez 4 Cœurs des Titans sur Ra Den, 4 Cœurs de dragons sur Vexiona et 4 Yeux prophétiques sur Il\’gynoth à Ny\’alotha, la Cité en éveil en mode Normal.', 'Ny\’alotha échappe aux grands principes qui régissent habituellement l\’espace et le temps, et il s\’agit pour nous d\’en tirer parti.\n\nD\’après les conclusions de D.A.M.E., les élus de N\’Zoth détiennent des objets susceptibles de nous aider à courber l\’espace-temps afin d\’accélérer notre passage dans le futur. Inutile de préciser qu\’ils ne s\’en sépareront sûrement pas de bon gré.', '', '', '', '', '', '', 33528),
