(58321, 'frFR', 'Un noyau hors du commun', 'Récupérez un Noyau titanesque sur un Guetteur ivoire en Uldum.', 'À en croire nos éclaireurs, les Amathet sont en train de construire de nouveaux guetteurs titanesques.\n\nNous pensions ce savoir à jamais englouti par les sables du désert, mais il faut croire que nous avions tort !\n\nJe n\’ai pas besoin d\’insister sur l\’avantage incroyable que de tels assemblages nous conféreraient au combat, j\’imagine. Nous devons à tout prix percer à jour les secrets de leur fabrication !\n\nLa puissance de ces guetteurs réside dans leur noyau. J\’aimerais que vous m\’en apportiez un, afin que nos artificiers l\’étudient plus avant.', '', '', '', '', '', '', 33528),
(58318, 'frFR', 'Masque sans-visage de la longue nuit', 'Rapportez le Masque sans-visage de la longue nuit sur son autel dans une Vision horrifique.', 'L\’endurance nécessaire pour arriver jusqu\’ici est formidable, et l\’apanage de l\’aventurier aguerri. Pourtant, la longue nuit approche et avec elle, notre ultime consécration. Ceux qui luttent contre l\’avènement du Crépuscule éternel s\’acharnent en vain, car la nuit les confinera pour toujours à la lisière de la déraison.', '', '', '', '', '', '', 33528),
(58317, 'frFR', 'Masque sans-visage du souffrant', 'Rapportez le Masque sans-visage du souffrant sur son autel dans une Vision horrifique.', 'Secrets, mensonges et activités clandestines sont la quintessence du maître-espion. Ses passions et ses amours perdues ont disparu à jamais, sacrifiées sur l\’autel de son devoir et de sa loyauté envers la couronne. Il n\’en reste plus rien qu\’une infinie souffrance. Or, la souffrance est à la fois un mentor éclairé et l\’instrument de prédilection du Vide. Rapportez mon masque si vous osez braver les nombreuses formes qu\’elle peut prendre.', '', '', '', '', '', '', 33528),
(58316, 'frFR', 'Masque sans-visage de sombre imagination', 'Rapportez le Masque sans-visage de sombre imagination sur son autel dans une Vision horrifique.', 'Les mages pervertissent leurs pouvoirs pour manipuler et conquérir le monde. Dans leur éternelle quête de puissance supérieure, ils arpentent les frontières des domaines du Vide. C\’est ainsi qu\’ils ont découvert que les profondeurs de l\’imagination abritent des horreurs indicibles à la noirceur absolue.', '', '', '', '', '', '', 33528),
(58314, 'frFR', 'Masque sans-visage du pont brûlé', 'Rapportez le Masque sans-visage du pont brûlé sur son autel dans une Vision horrifique.', 'La guerrière déracinée évolue en permanence sur le fil du rasoir, surtout quand on l\’arrache à son monde natal. Le Vide fait de cette instabilité une réalité au sein de laquelle le moindre faux pas peut vous précipiter dans les abysses ou vous vider de toute substance.', '', '', '', '', '', '', 33528),
(58297, 'frFR', 'Masque sans-visage du trompe-la-mort', 'Rapportez le Masque sans-visage du trompe-la-mort sur son autel dans une Vision horrifique.', 'S\’il n\’a jamais cherché à imposer son autorité, le chasseur en quête de défis a toujours eu le goût du risque. Il a su guider au mieux ses alliés sans pour autant hésiter à se jeter lui-même dans la mêlée. Les talents qu\’il a manifestés ont fait de lui et de mes autres serviteurs de véritables machines à tuer. Rapportez son masque à l\’autel du Trompe-la-mort afin d\’éprouver votre propre détermination face à des ennemis aux attaques toujours plus redoutables.', '', '', '', '', '', '', 33528),
(58291, 'frFR', 'Braconniers à cogner', 'Récupérez $1oa Peaux de hyène robuste sur les Chasseurs amathet ou en dépeçant des Hyènes en Uldum.', 'Pour confectionner nos armures, les Bat-le-désert utilisent généralement des peaux de hyènes de la région. Malheureusement, avec l\’arrivée des Amathet, nos terrains de chasse sont passés sous le contrôle de leurs chasseurs.\n\nNous avons besoin de ces peaux et nous sommes prêts à les payer au prix fort. Arrachez-les aux mains des chasseurs ennemis ou dépecez-vous même quelques hyènes, si vous maîtrisez cette compétence.', '', '', '', '', '', '', 33528),
(58290, 'frFR', 'Champions des Amathet', 'Tuez $1oa ennemis amathet d\’élite en Uldum.', 'Les soldats de Ramkahen sont robustes et efficaces.\n\nJe n\’hésiterais pas à les déployer contre n\’importe quel fantassin amathet, mais même les meilleurs d\’entre eux n\’auraient aucune chance face à certains des combattants d\’élite ennemis.\n\nVous, en revanche, vous vous en tireriez sans trop de casse, à mon avis. Si vous pouviez régler le compte de ces champions pendant que mes soldats s\’occupent de la piétaille, notre défense s\’en retrouverait facilitée.', '', '', '', '', '', '', 33528),
(58289, 'frFR', 'Des secrets bien gardés', 'Pillez $1oa Caches amathet en Uldum.', 'D\’après ce que nous en savons, les Amathet sont très probablement restés enfermés dans leurs tombeaux pendant des millénaires. Imaginez ce qu\’ils pourraient avoir à nous apprendre !\n\nBien sûr, la tâche serait nettement plus simple s\’ils ne cherchaient pas à nous tuer…\n\nSi vous découvrez des caches de reliques amathet lors de vos pérégrinations, n\’hésitez pas à m\’en faire part. J\’adorerais voir quel genre de mystères elles recèlent !', '', '', '', '', '', '', 33528),
(58288, 'frFR', 'Les élus du roi-soleil', 'Terrassez 3 ennemis amathet rares en Uldum.', 'Tout soldat a ses limites, son point de rupture, même les Amathet, dont la détermination semble pourtant inflexible. Nous devons leur faire comprendre ce qu\’il en coûte de s\’attaquer à nous.\n\nTraquez les plus puissants d\’entre eux et éliminez-les sous les yeux de leurs camarades.\n\nNous leur prouverons l\’étendue de la force d\’Uldum !', '', '', '', '', '', '', 33528),
(58287, 'frFR', 'Un plan fracassant', 'Détruisez $1oa Idoles amathet et $2oa Obélisques solegrâces en Uldum.', 'Mes éclaireurs signalent que les Amathet utilisent différents monuments et idoles pour canaliser leur magie solaire.\n\nJ\’ignore ce qu\’ils manigancent au juste, mais nous ferions bien de les priver de tout ce qui pourrait leur conférer un avantage. J\’aimerais donc que vous vous rendiez sur place et que vous détruisiez tout artéfact ayant trait à la magie de près ou de loin.\n\nPar contre, pas un mot à la Ligue des explorateurs, sans quoi je risque d\’en entendre parler pendant un bout de temps !', '', '', '', '', '', '', 33528),
(58286, 'frFR', 'Loin de chez soi', 'Libérez $1oa Tol\’vir asservis en Uldum.', 'Les Amathet ont déferlé sur l\’est d\’Uldum si soudainement que nous n\’avons pas pu atteindre certains de nos hameaux les plus éloignés à temps.\n\nSi la plupart des Tol\’vir qui vivaient sur ces terres ont heureusement été épargnés, ils souffrent désormais sous le fouet de leurs oppresseurs.\n\nNous devons faire tout notre possible pour les libérer et les aider à rentrer chez eux.', '', '', '', '', '', '', 33528),
(58285, 'frFR', 'Artéfacts exhumés', 'Récupérez $1oa Artéfacts des Titans en Uldum.', 'Depuis qu\’ils ont surgi de leurs tombeaux, les Amathet passent leur temps à exhumer les reliques des Titans enfouies dans les environs.\n\nDifficile de savoir ce qu\’ils comptent en faire. Peut-être cherchent-ils simplement à éviter qu\’elles ne tombent entre nos mains ? Quoi qu\’il en soit, vous imaginez bien que la Ligue des explorateurs adorerait étudier certaines de leurs découvertes !\n\nNaturellement, les Amathet ont une fâcheuse tendance à essayer de nous raccourcir d\’une tête lorsque nous les approchons. Mais vous n\’êtes pas du genre à avoir froid aux yeux, je me trompe ?\n\nAlors, vous nous donnerez bien un petit coup de main ?', '', '', '', '', '', '', 33528),
(58284, 'frFR', 'Les écrits du roi-soleil', 'Récupérez $1oa Écrits du roi-soleil sur des Solegrâces amathet en Uldum.', 'Nous en savons très peu au sujet du roi-soleil à la tête des Amathet, sinon qu\’il s\’est entouré d\’une caste unique de pratiquants de la magie solaire, les « Solegrâces ».\n\nJe donnerais cher pour en apprendre davantage sur ce personnage. Toutefois, à la différence de certains membres de la Ligue des explorateurs, je n\’irais pas jusqu\’à risquer la vie de mes chercheurs.\n\nVous, en revanche, semblez tout à fait de taille à vous en charger. Alors, si vous trouvez des documents liés à ce fameux roi-soleil, je vous saurais gré de me les remettre.', '', '', '', '', '', '', 33528),
(58283, 'frFR', 'Des aveugles à la tête d\’aveugles', 'Tuez $1oa Prêtres amathet en Uldum.', 'Les prêtres du soleil constituent un ordre ancien de Tol\’vir commun à toutes les tribus.\n\nHélas, ceux qui ont prêté allégeance aux Amathet ont perverti nos croyances. Ils en ont même fait des armes afin de justifier leur croisade contre Ramkahen. Et leurs soldats les suivent aveuglément, sans jamais mettre en doute leurs intentions…\n\nIl faut impérativement les arrêter.', '', '', '', '', '', '', 33528),
(58282, 'frFR', 'La mort surgie du ciel', 'Tuez $1oa Archers amathet en Uldum.', 'Aussi compétents les archers de Ramkahen soient-ils, les arcs amathet conservent l\’avantage de la portée. Malheureusement, cela rend très périlleuse toute incursion en territoire ennemi.\n\nVous manifestez un talent certain pour infiltrer et attaquer les lignes ennemies. Si vous éclaircissiez leurs rangs, nous pourrions peut-être les repousser une bonne fois pour toutes.\n\nAcceptez-vous de nous aider ?', '', '', '', '', '', '', 33528),
(58281, 'frFR', 'Armures antiques', 'Récupérez $1oa pièces d\’Armure amathet sur les Tol\’vir amathet cuirassés en Uldum.', 'Mener plusieurs guerres de front n\’est pas sans conséquence sur nos réserves. Nos forgerons sont dépassés et n\’arrivent plus à faire face à la demande. Résultat, nous ne sommes plus équipés pour affronter des ennemis toujours plus nombreux.\n\nAussi anciennes soient-elles, les armures amathet sont de formidables créations des Titans. Notre défense ne s\’en porterait que mieux si nous en récupérions.\n\nPouvez-vous nous aider ?', '', '', '', '', '', '', 33528),
(58279, 'frFR', 'Au service de l\’intendance', '', '', '', '', '', '', '', '', 33528),
(58277, 'frFR', 'Sombres trompeurs', 'Tuez $1oa Serviteurs k\’thir en Uldum.', 'Les Dieux très anciens ont à leur solde des hordes entières de séides sans-visage, mais les K\’thir sont indubitablement les plus retors de tous.\n\nS\’ils sont moins imposants que leurs frères d\’armes, les K\’thir œuvrent à la faveur des ombres, pliant à leurs caprices la volonté de tous et la réalité elle-même.\n\nLeurs manigances doivent cesser au plus vite.', '', '', '', '', '', '', 33528),
(58276, 'frFR', 'Mar\’at en flammes', '', '', '', '', '', '', '', '', 33528),
(58275, 'frFR', 'Une invocation monstrueuse', '', '', '', '', '', '', '', '', 33528),
(58274, 'frFR', 'Au service de N\’Zoth', 'Utilisez N\’lyeth, esquille de N\’zoth pour changer de faction et servir N\’Zoth. Puis tuez 10 membres de l\’Alliance sans mourir.', '$C…\n\nJe vous ai $gobservé:observée;… J\’ai perçu votre soif de sang.\n\nMais vous servez de faux prophètes… L\’Alliance est une illusion… Je suis un dieu !\n\nMontrez-vous digne de recevoir mon don… Anéantissez ceux qui vous trahiront bientôt… \n\nAnéantissez… l\’Alliance !', '', '', '', '', '', '', 33528),
(58273, 'frFR', 'Au service de N\’Zoth', 'Utilisez N\’lyeth, esquille de N\’zoth pour changer de faction et servir N\’Zoth. Puis tuez 10 membres de la Horde sans mourir.', '$C…\n\nJe vous ai $gobservé:observée;… J\’ai perçu votre soif de sang.\n\nMais vous servez de faux prophètes… La Horde est une illusion… Je suis un dieu !\n\nMontrez-vous digne de recevoir mon don… Anéantissez ceux qui vous trahiront bientôt… \n\nAnéantissez… la Horde !', '', '', '', '', '', '', 33528),
(58271, 'frFR', 'Rituel flamme-du-Vide', '', '', '', '', '', '', '', '', 33528),
(58257, 'frFR', 'La gueule dévorante', '', '', '', '', '', '', '', '', 33528),
(58239, 'frFR', 'Leçons de brigandage', 'Pillez $1oa Caches de l\’Empire noir en Uldum.', 'Des générations durant, les Bat-le-désert ont vécu de rapines et autres expédients, que ce soit sur terre ou en mer. Si nous avons décidé de raccrocher notre tablier pour mener une vie paisible, nous n\’avons pas oublié les leçons apprises à l\’époque.\n\nÀ commencer par celle-ci, particulièrement pertinente dans les circonstances actuelles : lorsqu\’on est confronté à un adversaire supérieur, retourner ses armes contre lui s\’avère souvent payant.\n\nTrouvez leurs caches et emparez-vous de tout ce que vous pourrez porter. Vous y dénicherez peut-être une arme susceptible d\’inverser le cours de cette bataille.', '', '', '', '', '', '', 33528),
(58238, 'frFR', 'Perdus et torturés', 'Libérez $1oa Citoyens de Ramkahen retenus captifs dans les Cellules de torture de la Cité perdue des Tol\’vir, en Uldum.', 'Ici, à Ramkahen, nos citoyens ont réussi à échapper au gros des troupes de N\’Zoth.\n\nEn revanche, nos frères de la cité perdue n\’ont pas eu cette chance. Ceux qui n\’ont pas été abattus sur-le-champ ont été faits prisonniers et livrés aux tortionnaires de l\’armée ennemie.\n\nSachant que vous comptez attaquer les positions adverses, je vous saurais gré de bien vouloir en profiter pour libérer nos alliés. Ramkahen vous sera redevable.', '', '', '', '', '', '', 33528),
(58237, 'frFR', 'La purification d\’Uldum', 'Détruisez $1oa Tumeurs de corruption en Uldum.', 'À chaque seconde que les armées de N\’Zoth passent en Uldum, sa corruption s\’infiltre un peu plus dans la terre elle-même.\n\nMême si nous parvenons à chasser ses sbires, les dégâts qu\’a subis notre territoire risquent de s\’avérer irréversibles.\n\nNous devons éradiquer sa corruption à la racine.', '', '', '', '', '', '', 33528),
(58236, 'frFR', 'Destruction symbolique', 'Détruisez $1oa Bannières de l\’Empire noir en Uldum.', 'Les sectateurs qui suivent cette sombre légion souillent nos terres avec les symboles des tyrans auxquels ils obéissent aveuglément.\n\nLeurs disciples se rassemblent sous leurs bannières impies qu\’ils vénèrent comme des idoles blasphématoires.\n\nBrûlez-les et débarrassez nos terres de ces abjections.', '', '', '', '', '', '', 33528),
(58235, 'frFR', 'Ancres de l\’Empire noir', 'Détruisez $1oa Obélisques de l\’Empire noir en Uldum.', 'Cette invasion a commencé sans crier gare : les troupes des Dieux très anciens ont surgi en masse d\’étranges structures rappelant l\’Empire noir qui s\’étaient matérialisées comme par enchantement. Nous ne savons ni d\’où elles viennent ni comment elles sont apparues.\n\nCependant, chaque fois qu\’une nouvelle structure apparaît, elle est systématiquement précédée de ces obélisques maléfiques. Nous pensons que ces derniers fonctionnent un peu comme des ancres permettant d\’introduire sur nos terres des hordes toujours plus nombreuses.\n\nSi nous voulons endiguer ce raz-de-marée, il va falloir détruire les obélisques.', '', '', '', '', '', '', 33528),
(58234, 'frFR', 'Appellation d\’origine controversée', 'Récupérez $1oa échantillons de Corruption amalgamée sur des Gelées en Uldum.', 'Mes facultés de clairvoyance sont un atout stratégique considérable pour le peuple de Ramkahen. Cependant, la puissance de mes visions s\’est avérée particulièrement épuisante dernièrement.\n\nJ\’ai mis au point un tonique conçu pour atténuer les effets secondaires induits par ces visions, mais la formule nécessite une dose de corruption amalgamée des Dieux très anciens.\n\nSi vous pouviez m\’en procurer quelques échantillons, cela nous aiderait énormément dans notre combat.', '', '', '', '', '', '', 33528),
(58233, 'frFR', 'Corrupteurs pervertis', 'Tuez $1oa Bêtes de chair en Uldum.', 'Si les bêtes de chair qui accompagnent les troupes d\’invasion paraissent quantité négligeable, le fait est qu\’elles sont intimement liées aux puissances corruptrices des Dieux très anciens.\n\nTelle une pestilence, elles propagent les miasmes de N\’Zoth où qu\’elles aillent, transformant lentement mais sûrement ces terres à leur image.\n\nEn bref, il faut les éradiquer.', '', '', '', '', '', '', 33528),
(58232, 'frFR', 'L\’ordre au sein du chaos', 'Tuez $1oa Séides sans-visage de N\’Zoth en Uldum.', 'Cela fait si longtemps que les Tol\’vir n\’ont pas affronté les troupes d\’un Dieu très ancien que nous peinons à cerner leurs tactiques.\n\nCela étant dit, il y a un principe qui ne s\’est jamais démenti à la guerre : c\’est en éliminant l\’état-major d\’une armée que l\’on affaiblit l\’ensemble de la soldatesque.\n\nLors de mes observations, j\’ai remarqué que les plus grands séides sans-visage faisaient office de commandants pour les troupes du Dieu très ancien. Réduisez-les au silence et nous parviendrons peut-être à semer à notre tour le chaos dans leurs rangs.', '', '', '', '', '', '', 33528),
(58231, 'frFR', 'Les enseignements de la folie', 'Récupérez $1oa Écrits déments sur les sectateurs de l\’Empire noir en Uldum.', 'Dans mes visions, j\’entends… des voix…\n\nLeurs paroles n\’ont pas de sens, mais des schémas récurrents se dessinent progressivement. J\’ai l\’intuition qu\’il y a là un message important à saisir, mais il me reste encore à le déchiffrer.\n\nPour ce faire, nous allons devoir remonter jusqu\’à la source du phénomène. Emparez-vous des écrits que transportent les sectateurs voyageant avec ces sombres créatures. Leurs divagations recèlent peut-être la clé qui nous permettra de comprendre le message caché derrière toute cette folie.', '', '', '', '', '', '', 33528),
(58230, 'frFR', 'Aveugler les yeux', 'Tuez $1oa Observateurs fétides dans les Champs d\’Akhenet, en Uldum.', 'Des forces occultes se sont mises à saboter mes visions dernièrement. Les yeux auxquels rien n\’échappe percent le voile et font obstacle à mes facultés de clairvoyance.\n\nLe regard de notre ennemi sonde nos âmes et profane nos esprits. Si nous voulons lever la malédiction qui pèse sur ces terres, il va nous falloir le rendre aveugle.', '', '', '', '', '', '', 33528),
(58229, 'frFR', 'Un cri de ralliement', 'Tuez 3 serviteurs de N\’Zoth rares en Uldum.', 'Nos terres sont infestées de serviteurs des Dieux très anciens. Ils attaquent sur tous les fronts, allant jusqu\’à s\’en prendre aux esprits de nos soldats.\n\nÀ ce rythme, nos troupes ne résisteront pas bien longtemps. Il nous faut porter un coup décisif avant qu\’elles ne perdent définitivement espoir.\n\nTrouvez les monstruosités les plus répugnantes et tentaculaires que vous pourrez et abattez-les. Mes hommes ne manqueront pas de s\’inspirer de votre exemple.', '', '', '', '', '', '', 33528),
(58216, 'frFR', 'Gueule dévorante', '', '', '', '', '', '', '', '', 33528),
(58214, 'frFR', 'Une affaire urgente', 'Rejoignez Kelsey Étinçacier au Port de Boralus.', 'Vous ne pouviez pas mieux tomber, $n !\n\nKelsey Etinçacier a lancé un appel à l\’aide aux capitales.\n\nL\’état de Mekkanivelle est des plus préoccupants et le temps presse.\n\nRendez-vous au port de Boralus au plus vite. Kelsey vous y attend.', '', '', '', '', '', 'Trouvez Kelsey Étinçacier au port de Boralus.', 33528),
(58168, 'frFR', 'Une réalité sans fard', 'Terrassez $1oa Guetteurs regard-noir au sein de la vision.', 'Leurs regards sont sur nous, $n. Tapis dans les ombres, ils guettent nos moindres faits et gestes. Rien d\’étonnant à ce que nos efforts paraissent si… vains.\n\nVous n\’y êtes pour rien. Nous aurions dû le comprendre il y a longtemps.\n\nSi nous voulons que notre travail porte ses fruits, nous devons à tout prix échapper à leur surveillance.\n\nNotre vieil ami m\’a confié un élixir pour nous aider à démasquer notre ennemi. Certes, nous nous exposons à certains… effets secondaires inconnus, mais ses propriétés permettent de voir clair dans les ténèbres.', '', '', '', '', '', '', 33528),
(58167, 'frFR', 'Mesures préventives', 'Détruisez $1oa Portails du Vide au sein de la vision.', 'Le raz-de-marée ténébreux continue à assaillir les rivages de notre monde. Je crains que les eaux qui montent à nos pieds ne finissent bientôt par nous engloutir. Peut-être est-il temps de changer d\’approche.\n\nFrayez-vous un chemin dans le royaume corrompu et cherchez les portes des ténèbres. Si nous parvenons à les ralentir, cela nous laissera peut-être le temps de découvrir leur point faible.', '', '', '', '', '', '', 33528),
(58156, 'frFR', 'Vaincre les Ténèbres', 'Repoussez la corruption de N\’Zoth au sein de la vision.', 'Les ténèbres se propagent. Le cycle continue.\n\nFaites tout votre possible pour enrayer la progression de N\’Zoth. Si nous ne luttons pas contre la corruption, les ombres finiront par nous submerger.', '', '', '', '', '', '', 33528),
(58155, 'frFR', 'Une main tendue dans les ténèbres', 'Secourez $1oa âmes au sein de la vision.', 'Imaginez que vous êtes $gprisonnier:prisonnière; d\’un monde dont vous ignoriez jusqu\’à l\’existence, une réalité qui vous est totalement étrangère.\n\nUne dimension où l\’esprit est assailli par une multitude de pensées, de peurs et de sombres désirs portés par une irrésistible tentation.\n\nNombreux sont ceux qui, incapables d\’y résister, se sont abandonnés aux ténèbres. Pourtant, certains continuent à lutter.\n\nFaites ce que vous pouvez pour les préserver. Ceux-là ne doivent surtout pas succomber.', '', '', '', '', '', '', 33528),
(58151, 'frFR', 'Les serviteurs de N\’Zoth', 'Terrassez $1oa serviteurs de N\’Zoth au sein de la vision.', 'Un jour, les vents hurlants qui nous entourent seront peut-être réduits au silence, étouffés par ces murmures à la noirceur croissante et pourtant si familiers.\n\nIl faut faire quelque chose.\n\nAventurez-vous dans les ténèbres, $n, et neutralisez notre ennemi.', '', '', '', '', '', '', 33528),
(58147, 'frFR', 'Terra incognita', 'Trouvez le Tableau de l\’appel des héros à Hurlevent.', 'Bienvenue à Hurlevent, $c. Le roi Anduin Wrynn vous invite à explorer notre belle cité. Dites-moi, vous me semblez du genre à apprécier la vie nocturne, je me trompe ? Nous avons de nombreuses tavernes et une scène musicale incontournable !\n\nAh, mais tout cela peut attendre. Cherchez donc le tableau de l\’appel des héros de la ville, afin de voir où le vent de l\’aventure peut vous porter, puis parlez à votre émissaire.\n\nJe vous souhaite un agréable séjour, $n. Ah, et un petit conseil amical… Mieux vaut ne pas tenter d\’améliorer les gens sans leur consentement. C\’est mal vu dans le coin !', '', '', '', '', '', 'Parlez à Lulana dans le quartier des Nains.', 33528),
(58146, 'frFR', 'Pour l\’Alliance', 'Allez voir l\’ambassadeur Mauregarde à l\’Ambassade, à Hurlevent.', 'En tant que Grand Bricoleur et chef des Gnomes, comme des Mécagnomes, je suis ravi de vous souhaiter la bienvenue dans l\’Alliance !\n\nUn monde d\’aventures vous attend au-delà des murs de Mécagone.\n\nUne fois $gprêt:prête;, avancez-vous sur le téléporteur. L\’ambassadeur Mauregarde vous attend à l\’ambassade de Hurlevent.\n\nLà, de nombreuses opportunités de développement s\’offriront à vous.\n\nChoisissez judicieusement et n\’oubliez pas de partager vos données.', '', '', '', '', '', 'Allez voir l\’ambassadeur Mauregarde à l\’Ambassade, à Hurlevent.', 33528),
(58124, 'frFR', 'Terra incognita', 'Trouvez le Tableau de commandement du chef de guerre à Orgrimmar.', 'Bonjour. Je suis l\’ambassadeur Gardenoire.\n\n\n<Gardenoire regarde la feuille de papier qu\’il tient à la main.>\n\n\nAu nom du chef de guerre, c\’est un honneur de vous accueillir à Orgrimmar, $r.\n\n<Il vous jette un coup d\’œil, sourit d\’un air peu convaincu, puis se penche à nouveau sur son papier.>\n\nDe nombreuses aventures vous attendent, recevez donc l\’assurance de… Rah…\n\nVous savez quoi ? J\’en ai plus qu\’assez de répéter ce maudit discours d\’accueil !\n\nAllez donc consulter le tableau de commandement du chef de guerre et trouvez-vous de quoi vous occuper. Allez, oust !', '', '', '', '', '', 'Parlez à Nilsa dans la vallée de l\’Honneur.', 33528),
(58122, 'frFR', 'Pour la Horde', 'Allez voir l\’ambassadeur Gardenoire à l\’Ambassade à Orgrimmar.', 'Quelle aventure, $c !\n\nIl y a tant à explorer… à découvrir… Quelle époque extraordinaire !\n\nNous allons prouver à nos alliés de la Horde l\’atout que peut représenter une poignée de Vulpérins rusés.\n\nAllez donc vous présenter auprès de l\’ambassadeur, à l\’ambassade d\’Orgrimmar, puis explorez les possibilités qui s\’offrent à vous à travers Azeroth et au-delà.\n\nÀ bientôt, $n !', '', '', '', '', '', 'Allez voir l\’ambassadeur Gardenoire à l\’Ambassade à Orgrimmar.', 33528),
(58097, 'frFR', 'Fournitures de l\’Accord d\’Uldum', 'Parlez à l\’Approvisionneuse Qorra en Uldum pour obtenir votre récompense.', 'Au nom de la résistance, je vous remercie pour votre aide.\n\nVeuillez accepter ces fournitures en gage de notre gratitude. Et si vous continuez à nous soutenir, il y en aura bien d\’autres, je vous en fais la promesse.', '', '', '', '', '', '', 33528),
(58096, 'frFR', 'Fournitures des Rajani', 'Parlez à Zhang Ku dans le Val de l\’Éternel printemps pour obtenir votre récompense.', 'Au nom de la résistance, je vous remercie pour votre aide.\n\nVeuillez accepter ces fournitures en gage de notre gratitude. Et si vous continuez à nous soutenir, il y en aura bien d\’autres, je vous en fais la promesse.', '', '', '', '', '', '', 33528),
(58087, 'frFR', 'Briser les batteries', 'Détruisez $1oa Batteries nazeshi dans la Crique de la Perle-Maudite.', 'Le cerveau de l\’opération, c\’est l\’imploratrice des marées Nézara. Si nous l\’éliminons, le reste des Nagas se dispersera. En revanche, l\’approcher risque de ne pas être une mince affaire. Elle est protégée par une barrière magique qui tire son énergie de batteries à proximité.\n\nDétruisons la source d\’énergie et nous aurons une chance d\’éliminer Nézara.', '', '', '', '', '', '', 33528),
(58010, 'frFR', 'Prélèvements à la source', 'Récupérez $1oa Échantillons d\’Aqir.', 'Il nous faut d\’autres échantillons d\’Aqir, $p. Autant que vous pourrez en obtenir !\n\nNos premières découvertes ont beau être fascinantes, il nous reste encore beaucoup à apprendre sur ces créatures.\n\nNous comptons sur des recherches plus poussées, et sur un coup de pouce de dame Fortune, pour identifier certains de leurs points faibles.', '', '', '', '', '', '', 33528),
(58009, 'frFR', 'Objectif Lune', 'Éliminez la menace aqir de l\’Obélisque de la Lune.', 'Bon, c\’est l\’heure de mettre les voiles !\n\nIl faut retourner au camp illico et prévenir Arik de la situation.\n\nFaites le plein du bombardier.\n\nJe vous laisse prendre les commandes de la mitrailleuse, moi je m\’occupe du pilotage. J\’propose qu\’on se fasse quelques insectes pendant le trajet !', '', '', '', '', '', '', 33528),
(58008, 'frFR', 'Le plein est fait', 'Récupérez $1oa Jerricans.', 'Je me suis rendu compte en inspectant les appareils qu\’ils étaient tous à sec ! C\’est vraiment pas de bol !\n\nMais j\’ai aussi vu des jerricans éparpillés dans le coin et certains doivent sûrement encore contenir un fond de carburant.\n\nJe comptais les récupérer moi-même, mais ces maudits insectes sortis de nulle part ont envahi la zone.\n\nIls sont trop nombreux pour moi, mais vous pouvez peut-être me donner un coup de main ?', '', '', '', '', '', '', 33528),
(57990, 'frFR', 'Obélisque du Soleil', 'Retrouvez Zahra Traque-Sable à l\’Obélisque du Soleil.', 'J\’ai un autre service à vous demander, mon $gami:amie;, et pas des moindres, puisque notre survie dépendra de votre réussite.\n\nNotre camarade Zahra a entrepris d\’escalader seule le plateau à l\’Est d\’ici, afin de s\’emparer de l\’un des bombardiers abandonnés qui s\’y trouvent.\n\nMalgré de nombreuses tentatives, nous n\’avons toujours pas réussi à informer Arik de la situation.\n\nMais cela pourrait changer si Zahra et vous réussissez à remettre en état l\’un de ces coucous.\n\nAvec un peu de chance, les renforts arriveront avant que nous ne soyons submergés…', '', '', '', '', '', '', 33528),
(57974, 'frFR', 'Bataille de Sombrivage : mode héroïque', '', '', '', '', '', '', '', '', 33528),
(57973, 'frFR', 'Bataille de Sombrivage : mode héroïque', '', '', '', '', '', '', '', '', 33528),
(57971, 'frFR', 'Ruines d\’Ammon', 'Rendez-vous dans les Ruines d\’Ammon.', 'Ces choses semblent être partout à la fois !\n\nSoit il s\’agissait d\’une attaque planifiée, soit elles sont bien plus nombreuses que nous ne pouvons même le soupçonner.\n\nDans tous les cas, la nouvelle est terrible… Effroyable même.\n\n$p, vous devez vous rendre dans les ruines d\’Ammon pour y évaluer l\’étendue des dégâts.\n\nS\’il y a besoin d\’aide, je vous en prie, n\’hésitez pas à intervenir !', '', '', '', '', '', '', 33528),
(57970, 'frFR', 'Ruineur Xok\’nixx', 'Tuez le Ruineur Xok\’nixx.', 'Ar\’kali et un groupe de nos guerriers affrontent une créature gigantesque au cœur des ruines.\n\nElle est capable de tenir tête à presque n\’importe quel ennemi, mais cette fois-ci, j\’ai peur que ce monstre ne finisse par épuiser le groupe.\n\nPour l\’instant, l\’atrocité est tenue en respect. Mais si nos guerriers succombent, nous finirons par perdre les ruines.\n\nJe vous en prie, hâtez-vous. Je ne doute pas qu\’avec votre aide, cet ennemi titanesque peut être vaincu.', '', '', '', '', '', '', 33528),
(57969, 'frFR', 'Des blessés à soigner', 'Soignez $1oa Travailleurs bat-le-désert.', 'Mon $gami:amie;, comme vous pouvez le constater, nous sommes assiégés par ces terribles créatures.\n\nNous avons perdu bon nombre de braves aux mains de ces monstres, mais nous sommes encore assez nombreux pour tenir l\’ennemi en respect… Du moins pour l\’instant.\n\nSi vous êtes en mesure de nous aider, soignez nos blessés et dégagez un chemin pour leur permettre de quitter les ruines.', '', '', '', '', '', '', 33528),
(57962, 'frFR', 'Bataille de Sombrivage : mode héroïque', '', '', '', '', '', '', '', '', 33528),
(57961, 'frFR', 'Bataille de Sombrivage : mode héroïque', '', '', '', '', '', '', '', '', 33528),
(57960, 'frFR', 'Front de guerre héroïque : la bataille de Sombrivage', 'Triomphez de la Horde lors de la Bataille de Sombrivage.', 'Cette invasion de nos territoires par la Horde doit cesser.\n\nLes Elfes de la nuit ne combattront pas seuls. Sombrivage leur reviendra.\n\nPour l\’Alliance !', '', '', '', '', '', '', 33528),
(57959, 'frFR', 'Front de guerre héroïque : la bataille de Sombrivage', 'Triomphez de l\’Alliance dans la Bataille de Sombrivage.', 'Sombrivage appartient à la Horde ! Nous devons défendre ces terres pour maintenir notre mainmise en Kalimdor.\n\nPréparez-vous à livrer bataille !', '', '', '', '', '', '', 33528),
(57956, 'frFR', 'Hôtes bat-le-désert', 'Tuez $2oa Hôtes bat-le-désert.', 'Les insectes ont pondu des œufs dans les cadavres de nos soldats. C\’est épouvantable !\n\nCertains sortent ensuite de terre sous forme d\’abominations de chair, putrides et gonflées.\n\nNous devons les arrêter avant qu\’ils ne renforcent leurs rangs avec nos morts !\n\nLa mission est des plus sinistres… mais je dois vous demander de m\’aider à les éliminer et à réduire leurs cadavres en cendres.\n\nPrenez des bombes derrière moi, si vous voulez.', '', '', '', '', '', '', 33528),
(57955, 'frFR', 'En route pour le Port d\’Ankhaten', 'Trouvez la Pisteuse Samara au Port d\’Ankhaten.', 'Je crains de ne pas encore être en mesure d\’arpenter les sables et d\’affronter ces monstres à nouveau.\n\nPrenez la direction du sud et trouvez la pisteuse Samara, dans le camp de fouilles autrefois connu comme l\’Accostage de Schnottz.\n\nDites-lui de bloquer toute caravane qui envisagerait de passer par ici, sous peine de voir d\’autres victimes succomber à des embuscades.\n\nIl faut que la nouvelle se répande à travers tout Uldum avant que nos troupes ne soient encore plus divisées !', '', '', '', '', '', '', 33528),
(57954, 'frFR', 'Brûler les cadavres', 'Brûlez $1oa Cadavres porteurs d\’œufs.', 'Les insectes pondent des œufs sur tous les cadavres des environs.\n\nLes dépouilles servent de nourriture aux futures générations de ces horribles créatures. C\’est ignoble !\n\nNous aurons tout le loisir de pleurer les disparus plus tard, mais pour l\’heure, nous devons empêcher de nouvelles abominations d\’éclore. Sans cela, nous subirons certainement le même sort.\n\nBrûlez les cadavres et détruisez ces œufs !', '', '', '', '', '', '', 33528),
(57915, 'frFR', 'En quête de survivants', 'Trouvez $1oa Bat-le-désert à Orsis.', 'Les insectes ont surgi de toutes parts… sans nous laisser le temps de réagir.\n\nNombre de mes amis sont morts sur place, tandis que d\’autres ont essayé de se défendre avec les piètres outils à leur disposition.\n\nMoi, j\’ai agi en lâche. Au lieu de donner un coup de main, j\’ai profité de la confusion pour m\’enfuir.\n\nMaintenant, me voilà sans eau ni nourriture, et avec une telle peur au ventre que je n\’arrive même pas à chercher des survivants.\n\nJe vous en supplie, aidez tous ceux que vous trouverez encore en vie à Orsis…', '', '', '', '', '', 'Trouvez le voltigeur Lashan, à Orsis.', 33528),
(57873, 'frFR', 'Des nouvelles d\’Orsis', 'Allez mener l\’enquête à Orsis.', 'Comme vous pouvez le constater, $n, ces ignobles cafards accaparent toute notre attention.\n\nLes caravanes en provenance du sud n\’arrivent plus à destination et les rares ayant réussi à parvenir jusqu\’à nous étaient porteuses de nouvelles alarmantes.\n\nJ\’ai dépêché une patrouille en direction d\’Orsis afin de mener l\’enquête. Hélas, elle aurait dû revenir il y a un bon moment déjà.\n\nPuis-je vous demander d\’aller voir ce qu\’il en est ?', '', '', '', '', '', '', 33528),
(57774, 'frFR', 'Neuf vies', 'Éliminez $1oa Habitants de Neferset.', 'Les éclaireurs sont revenus il y a peu. Ils étaient à l\’article de la mort et nous ont rapporté des nouvelles pour le moins… déconcertantes.\n\nDes Neferset ont été vus arpentant les rues de leur ville, au sud.\n\nEn temps normal, il n\’y aurait pas lieu de s\’alarmer… à ceci près que les Neferset ont été entièrement exterminés.\n\nJe compte sur vous pour mener l\’enquête… Et si par quelque magie impie, il s\’avère que ces horreurs existent bel et bien, faites le nécessaire pour contenir la menace !', '', '', '', '', '', '', 33528),
(57773, 'frFR', 'Au bord de la rupture', 'Trouvez et fermez $1oa Déchirures du Vide en Uldum.', 'Nos guerriers nous informent que des manifestations impies s\’introduisent dans la jungle environnante à la faveur de nombreuses déchirures du Vide.\n\nCe ne sont que de vulgaires sous-fifres destinés à éprouver nos défenses avant l\’arrivée du gros de l\’armée.\n\nSi nous ne neutralisons pas cette menace dès maintenant, ce ne sera qu\’une question de temps avant que leurs soudards nous submergent.\n\nTrouvez un moyen de refermer ces portails !', '', '', '', '', '', '', 33528),
