(57737, 'frFR', 'Sauvetage à Ramkahen', 'Secourez $1oa Villageois de Mar\’at.', 'Ces maudits K\’thir ont envahi Mar\’at avant qu\’on ait le temps d\’évacuer les habitants.\n\nJe crains le pire.\n\nDe grâce, s\’il reste des survivants en ville, dites-leur de nous rejoindre à Ramkahen.', '', '', '', '', '', '', 33528),
(57728, 'frFR', 'Assaut : L\’essaim infini', 'Repoussez l\’assaut mantide au Val de l\’Éternel printemps.', 'L\’essaim mantide nous attaque ! Le Lotus doré ne pourra s\’occuper d\’un si grand nombre d\’ennemis !\n\nNous devons faire quelque chose pour les repousser !', 'Retourner voir Taoshi au sanctuaire du Silence', '', '', '', '', 'Retournez voir Taoshi au Sanctuaire du Silence.', 33528),
(57721, 'frFR', 'Butin de guerre', 'Obtenez $1oa pièces d\’Armure de récupération mogu sur des ennemis mogu dans le Val de l\’Éternel printemps.', 'Les clans factieux sont implacables, et nos guerriers usent leurs armures plus vite que je ne peux les réparer.\n\nSi vous affrontez les autres clans, essayez de récupérer un maximum de pièces d\’armure en bon état sur les cadavres ennemis. Nous ne pouvons pas nous permettre de gâcher du matériel qui peut encore servir.', '', '', '', '', '', '', 33528),
(57720, 'frFR', 'Champions des Mogu', 'Venez à bout de 3 ennemis rares pendant que les Mogu envahissent le Val de l\’Éternel printemps.', 'Les clans mineurs qui s\’entretuent dans le val en prennent un peu trop à leur aise.\n\nCherchez leurs champions et éliminez-les. Montrez-leur que ce territoire est la chasse gardée des Rajani !', '', '', '', '', '', '', 33528),
(57718, 'frFR', 'Prisonniers de la pierre', 'Récupérez des Bâtons de sculpte-pierre sur des Sculpte-pierre baruk et servez-vous-en pour libérer $1oa Guerriers pétrifiés dans les Ruines de Guo-Lai.', 'Une partie de nos guerriers se trouvait dans le camp voisin de Guo-Lai quand les Baruk ont envahi le secteur. Certains d\’entre eux ont réussi à s\’échapper… Non sans avoir assisté impuissants à la pétrification de leurs frères et sœurs d\’armes aux mains des sculpte-pierre mogu !\n\nNous n\’abandonnerons pas les nôtres !\n\nLes sculpte-pierre possèdent forcément un moyen d\’inverser le sortilège et de les libérer de leurs carcans de pierre. Ramenez-nous nos soldats !', '', '', '', '', '', '', 33528),
