(57524, 'frFR', 'Accès aux archives', 'Parlez à D.A.M.E. pour activer les Archives titanesques, puis les examiner.', 'Les informations que vous avez collectées nous ont permis de mieux comprendre ces manifestations.\n\nJe pense que D.A.M.E. a des découvertes à partager avec vous.', '', '', '', '', '', '', 33528),
