(57508, 'frFR', 'La bannière de guerre vil\’thik', '', '', '', '', '', '', '', '', 33528),
(57497, 'frFR', 'Répandre la nouvelle', 'Allez à Hurlevent pour informer Aysa Poète des Nuages des derniers développements.', 'Dire que nous ne voulions que sauver une vie ! En réalité, nous avons fait bien plus !\n\nSans vous, rien de tout cela n\’aurait été possible, $n. J\’ai tellement hâte de voir ce que l\’avenir réserve aux Gnomes !\n\nRentrez à Hurlevent et répandez la bonne nouvelle !', '', '', '', '', '', 'Allez à Hurlevent pour informer Aysa Poète des Nuages des derniers développements.', 33528),
(57496, 'frFR', 'Ascension', 'Éliminez les derniers défenseurs de Mécagone.', 'Après tout ce que les Mécagnomes ont fait pour nous aujourd\’hui, il est de notre devoir de leur rendre la pareille.\n\nNous allons éliminer les créations hors de contrôle qui rôdent toujours dans Mécagone.\n\nLe prince Erazmin et les siens sont destinés à un avenir brillant s\’ils récupèrent leur foyer.\n\nLes irréductibles du roi Mécagone n\’ont qu\’à bien se tenir ! Notre équipe va faire des ravages !\n\nFaites-moi signe lorsque vous serez $gprêt:prête; à vous lancer à l\’assaut !', '', '', '', '', '', 'Parlez à Gelbin Mekkanivelle.', 33528),
(57495, 'frFR', 'L\’avenir de Mécagone', 'Rendez-vous au Grand Réparatoire, à Mécagone.', 'À présent que plus rien ne menace Mécagone, Gnomes et Mécagnomes vont à nouveau pouvoir s\’y installer pour vivre dans la paix et la prospérité.\n\nIl est temps pour moi de discuter de l\’avenir de nos peuples avec le prince Erazmin. J\’espère sincèrement que nous parviendrons à forger une alliance à l\’épreuve des siècles !\n\nDès que vous serez $gprêt:prête;, rejoignez-nous au Grand Réparatoire pour une annonce spéciale.', '', '', '', '', '', '', 33528),
(57494, 'frFR', 'Un cœur solide', 'Récupérez le Réacteur à étincelles et terminez la procédure de Mekkanivelle.', 'Une fusée éclairante a été aperçue près du dépôt Tolawatt.\n\nL\’équipe d\’extraction a réussi à s\’emparer de la source d\’énergie. Nous sommes désormais à l\’abri de l\’annihilo-tron du roi Mécagone, son cœur servira un tout autre but.\n\nC\’est une excellente nouvelle !\n\nMalheureusement, cela signifie aussi que notre groupe a maille à partir avec des ennemis. Nous avons besoin de vous pour les évacuer et rapporter le réacteur à étincelles.\n\nFaites vite, nous n\’avons jamais été aussi prêts de notre objectif.', '', '', '', '', '', 'Allez voir le prince Erazmin à Mécarouille.', 33528),
(57493, 'frFR', 'Harmonisation mentale', 'Activez le Synchroscope au signal de Christy.', 'Nous avons maintenant cerné les bases de l\’identité de Mekkanivelle. J\’ai bien l\’impression qu\’il y a une certaine marge de progression.\n\nJe vais avoir besoin de vous pour le stabiliser et le synchroniser avant que nous ne l\’extirpions de sa nacelle.\n\nVeuillez vous placer à côté du synchroscope. J\’ai quelques réglages à effectuer, et je vous demanderai ensuite d\’activer la machine à mon signal.', '', '', '', '', '', '', 33528),
(57492, 'frFR', 'Lui ?', 'Récupérez des informations auprès des Gnomes et des Mécagnomes de Mécagone.', 'Parlez à certains des Gnomes de Mécagone, qu\’ils soient améliorés ou non. Aux miens, demandez ce qu\’ils attendent d\’un chef de notre espèce. À nos nouveaux amis, ce qu\’ils apprécient le plus chez leur chef actuel.\n\nJ\’ai cru comprendre que c\’est par nécessité que le Grand Bricoleur a accepté la couronne. Il n\’a jamais cherché à s\’emparer du pouvoir. Il ne l\’a même jamais désiré. Or, je pense que les Gnomes devraient être à nouveau réunis en un même peuple.\n\nJe cherche une solution qui satisfasse tout le monde. Acceptez-vous d\’aller récupérer les renseignements dont j\’ai besoin ?', '', '', '', '', '', '', 33528),
(57491, 'frFR', 'Plus fort… Plus solide… Moins mort', 'Récupérez un Accélérateur neural, un Amplificateur omni-électromagnétique et des Servos à dynamisme de flux sur des unités erratiques.', 'Certes, le roi Mécagone était complètement fou, mais il faut bien reconnaître que ses séides étaient particulièrement doués en matière de création robotique.\n\nCertaines de leurs œuvres errent aujourd\’hui encore à travers Mécagone, refusant obstinément d\’accepter que leur roi ait été détrôné.\n\nLa réaction logique à la défaite, lorsque l\’on est toujours opérationnel, c\’est de battre en retraite. Il faut donc croire que la logique n\’est pas leur point fort.\n\nCes unités disposent de composants technologiques dernier cri qui pourraient nous être d\’une grande utilité.', '', '', '', '', '', 'Allez voir Christy près de la Nacelle de sauvetage de Mekkanivelle.', 33528),
(57490, 'frFR', 'En route pour la sécurité', 'Terrassez les Troggs charognards et récupérez la Nacelle de sauvetage de Mekkanivelle.', 'L\’un de nos défenseurs a vu des Troggs abattre l\’hélicoptère guidé qui transportait la nacelle de Mekkanivelle.\n\nCes fichues bestioles nous font des misères depuis qu\’on rapporte des marchandises de Tiragarde.\n\nPiston, un jeune inventeur très prometteur, dispose d\’un véhicule qui pourrait nous sauver la mise. Allez à la rencontre de son équipe, dans la casse de Bondo.\n\nSurtout, récupérez la nacelle au plus vite ! Si les Troggs parviennent à l\’ouvrir, je n\’ose penser au sort qu\’ils réserveront à Gelbin.\n\nAh, euh… tant que vous y êtes, personne ne s\’offusquerait vraiment de vous voir procéder à un bon nettoyage de la plage…', '', '', 'Œil-Rouillé l\’Ingénieux', '', '', 'Retournez voir Waren Biellecœur à Mécarouille.', 33528),
(57488, 'frFR', 'Le schéma actuel', 'Récupérez $1oa Limons résistants à la chaleur et $2oa Pièces de machine réquisitionnées.', 'Je pense pouvoir modifier l\’un de nos appareils afin d\’accéder à Gelbin Mekkanivelle sans interférer avec ses systèmes de survie.\n\nVous allez devoir me procurer certains éléments.\n\nLe secteur de la Pile non loin d\’ici grouille de robots-ferrailleurs et de molosse-o-trons. Ils vous fourniront toutes les pièces détachées nécessaires à mon projet.\n\nDe son côté, l\’Évacuation abrite des créatures particulièrement visqueuses. Elles nous fourniront des ingrédients parfaits pour le lubrifiant résistant à la chaleur dont nous avons besoin.', '', '', '', '', '', '', 33528),
(57487, 'frFR', 'Une âme charitable', 'Aidez Kelsey à transporter la Nacelle de sauvetage de Mekkanivelle jusqu\’à Mécagone.', 'À mon avis, il existe un moyen d\’aider Mekkanivelle, mais le plan risque d\’en faire tiquer plus d\’un…\n\nLes Mécagnomes maîtrisent des techniques avancées de réparation et d\’amélioration biomécaniques.\n\nIl est peu probable que cela fonctionne, mais nous nous devons d\’essayer ! Des Mécagnomes font transiter des fournitures depuis un quai de la pointe du Crochet vers l\’île. Personne ne remarquera un colis supplémentaire. Nous allons donc modifier le plan de vol de l\’un de leurs hélicoptères guidés.\n\nVous voulez bien m\’aider à transporter la nacelle de Mekkanivelle jusqu\’à Mécagone ?', '', '', '', '', '', 'Parlez au prince Erazmin, à Mécagone.', 33528),
(57486, 'frFR', 'Énergie déclinante', 'Retrouvez Kelsey Étinçacier au Donjon Portvaillant.', 'La nacelle de Mekkanivelle montre des signes de faiblesse.\n\nToute communication a cessé.\n\nEt son pouls ne cesse de ralentir malgré tous les efforts des meilleurs soigneurs de Kul Tiras.\n\nJ\’ai une idée, mais il va me falloir votre aide.\n\nRetrouvez-moi au donjon Portvaillant. Il n\’y a pas une minute à perdre.', '', '', '', '', '', '', 33528),
(57484, 'frFR', 'Rituel d\’éveil', '', '', '', '', '', '', '', '', 33528),
(57476, 'frFR', 'Nourricerie vil\’thik', '', '', '', '', '', '', '', '', 33528),
(57464, 'frFR', 'Focalisation sur le focalisateur', 'Récupérez $1oa Lambeaux d\’insanité. Vous pouvez en obtenir sur les dépouilles des boss non instanciés et sur ceux de Ny\’alotha, en remportant des champs de bataille et des arènes ou avec des victoires honorables.', 'Le focalisateur du Vide ne renferme qu\’une infime partie de la puissance de N\’Zoth, mais nous pouvons le renforcer afin de confectionner des objets qui seront encore plus efficaces contre le Dieu très ancien.\n\nSi l\’influence de N\’Zoth est omniprésente, elle abonde chez ses lieutenants les plus puissants, $n. Éliminez-les pour obtenir des vestiges de son pouvoir.', '', '', '', '', '', '', 33528),
(57462, 'frFR', 'Kyrielles de cauchemars', 'Récupérez $1oa Lambeaux d\’insanité. Vous pouvez en obtenir sur les dépouilles des boss non instanciés et sur ceux de Ny\’alotha, en remportant des champs de bataille et des arènes ou avec des victoires honorables.', 'Le focalisateur paraît stable et son champ de confinement est intact. Je pense que nous pouvons encore le renforcer.\n\nContinuez à traquer des ennemis particulièrement puissants afin de récupérer d\’autres vestiges de l\’influence de N\’Zoth. Nous devons continuer à en imprégner le focalisateur. Le champ de confinement ne devrait pas en être affecté.', '', '', '', '', '', '', 33528),
(57453, 'frFR', 'Invocateur d\’essaim', '', '', '', '', '', '', '', '', 33528),
(57449, 'frFR', 'Exécuteur de N\’Zoth', '', '', '', '', '', '', '', '', 33528),
(57448, 'frFR', 'De nouveaux alliés parmi nous', 'Soyez témoin de l\’accueil par Baine des Vulpérins au sein de la Horde.', 'Même en temps de paix, la Horde connaît son lot de problèmes.\n\nS\’ils peuvent nous paraître accablants à l\’occasion, ils ne devraient jamais nous faire oublier ce que symbolise la Horde.\n\nNous ne chassons pas les gens lorsque les temps se font durs. Nous les accueillons à bras ouverts et nous surmontons les épreuves ensemble.\n\nJ\’ai failli l\’oublier. Croulant sous le poids des ennuis de nos nouveaux alliés, j\’ai écarté trop vite les Vulpérins.\n\nMon seul espoir désormais, c\’est qu\’ils tiennent la Horde en aussi haute estime que celle que je leur accorde.', '', '', '', '', '', '', 33528),
(57445, 'frFR', 'Stand de nouilles de Chin', '', '', '', '', '', '', '', '', 33528),
(57429, 'frFR', 'Bûcher de l\’Amalgamé', '', '', '', '', '', '', '', '', 33528),
(57404, 'frFR', 'Ruche ravageuse', '', '', '', '', '', '', '', '', 33528),
(57403, 'frFR', 'Restauration de La Peur et la Peau', 'Rassemblez les Pages déchirées de La Peur et la Peau dans une Vision horrifique et rapportez-les à Irion, dans la Chambre du Cœur.', 'Le plus insidieux, dans les murmures des Dieux très anciens, est probablement qu\’ils détiennent une petite part de vérité. On ne peut nier la joie de ressentir la chaleur du soleil sur sa peau et le souffle de vent dans ses cheveux.\n\nMais vous avez bravé les visions de N\’Zoth. Vous savez où nous mènent ses sombres desseins. La malédiction de la chair n\’a pas pour but de nous rendre joyeux.\n\nContinuez de rassembler les pages de ce tome. Nous avons presque fini de le compléter.', '', '', '', '', '', '', 33528),
(57402, 'frFR', 'Restauration de La Malédiction de pierre', 'Rassemblez les Pages déchirées de La Malédiction de pierre dans une Vision horrifique et rapportez-les à Irion, dans la Chambre du Cœur.', 'On ne peut pas dire que N\’Zoth soit dépourvu de subtilité et de fourberie. Je comprends comment un esprit impressionnable pourrait se retourner contre les Titans à la lecture de ces mots. Heureusement, nous ne sommes pas sujets à de telles manipulations, n\’est-ce pas ?\n\nCe livre est presque complet. Continuez de m\’en apporter les pages que vous trouverez dans les visions.', '', '', '', '', '', '', 33528),
(57399, 'frFR', 'Restauration de La Vérité ultime', 'Rassemblez les Pages déchirées de La Vérité ultime dans une zone perdue des Visions horrifiques et rapportez-le à Irion, dans la Chambre du Cœur.', 'J\’ai entendu parler de ce livre. Il s\’agit d\’un ouvrage sacré pour ceux qui vénèrent les Dieux très anciens. Il recense les ténébreux secrets et les mystères les plus incompréhensibles du Vide. Seuls les sectateurs les plus dévoués sont autorisés à le parcourir.\n\nMême s\’il est incomplet, le tenir me fait frémir. Je dois prendre garde à ne pas le lire d\’une traite.\n\nCela étant dit, nous devons retrouver les pages manquantes pour poursuivre nos recherches. Récupérez-les dans les coins les plus sombres des visions de N\’Zoth.', '', '', '', '', '', '', 33528),
(57398, 'frFR', 'Expédition dans les ténèbres', 'Récupérez un exemplaire de La Vérité ultime dans une zone perdue des Visions horrifiques et rapportez-le à Irion, dans la Chambre du Cœur.', 'Nous touchons au but. Les recoins les plus sombres de ces visions nous attendent.\n\nGrâce à notre travail, vous disposez à présent d\’un équipement adapté pour braver leurs plus terribles manifestations et accéder ainsi aux ultimes réponses à nos questions. Nos préparatifs pour Ny\’alotha sont presque terminés.', '', '', '', '', '', '', 33528),
(57397, 'frFR', 'Restauration de La Peur et la Peau', 'Rassemblez les Pages déchirées de La Peur et la Peau dans une Vision horrifique et rapportez-les à Irion, dans la Chambre du Cœur.', 'Le plus insidieux, dans les murmures des Dieux très anciens, est probablement qu\’ils détiennent une petite part de vérité. On ne peut nier la joie de ressentir la chaleur du soleil sur sa peau et le souffle de vent dans ses cheveux.\n\nMais vous avez bravé les visions de N\’Zoth. Vous savez où nous mènent ses sombres desseins. La malédiction de la chair n\’a pas pour but de nous rendre joyeux.\n\nContinuez de rassembler les pages de ce tome. Nous avons presque fini de le compléter.', '', '', '', '', '', '', 33528),
(57396, 'frFR', 'Restauration de La Peur et la Peau', 'Rassemblez les Pages déchirées de La Peur et la Peau dans une Vision horrifique et rapportez-les à Irion, dans la Chambre du Cœur.', 'Les fidèles des Dieux très anciens maintiennent que la chair est un don, et non une malédiction. Ce livre aborde la supposée bienveillance des Dieux très anciens pour avoir fait ce généreux don.\n\nÉvidemment, il ne fait nulle mention de ce qui se passe si la corruption n\’est pas contenue.\n\nRassemblez plus de ces pages. Aussi abjecte que soit cette lecture, étudier ces tomes nous sera utile pour améliorer l\’efficacité de votre cape.', '', '', '', '', '', '', 33528),
(57395, 'frFR', 'Restauration de La Peur et la Peau', 'Rassemblez les Pages déchirées de La Peur et la Peau dans une Vision horrifique et rapportez-les à Irion, dans la Chambre du Cœur.', 'Les fidèles des Dieux très anciens maintiennent que la chair est un don, et non une malédiction. Ce livre aborde la supposée bienveillance des Dieux très anciens pour avoir fait ce généreux don.\n\nÉvidemment, il ne fait nulle mention de ce qui se passe si la corruption n\’est pas contenue.\n\nRassemblez plus de ces pages. Aussi abjecte que soit cette lecture, étudier ces tomes nous sera utile pour améliorer l\’efficacité de votre cape.', '', '', '', '', '', '', 33528),
(57394, 'frFR', 'Restauration de La Peur et la Peau', 'Rassemblez les Pages déchirées de La Peur et la Peau dans une Vision horrifique et rapportez-les à Irion, dans la Chambre du Cœur.', 'Encore un ouvrage écrit par un pauvre hère ayant succombé à la folie de N\’Zoth. Je redoute de lire les atrocités qu\’il contient.\n\nMais si nous voulons renforcer votre cape, alors nous devons en savoir plus sur ce qu\’elle est censée combattre. Essayez de trouver les pages restantes afin de compléter ce livre, pour que nous y puisions le savoir qu\’il renferme.', '', '', '', '', '', '', 33528),
(57393, 'frFR', 'Incursion dans les ténèbres', 'Récupérez un exemplaire de La Peur et la Peau dans une Vision horrifique et rapportez-le à Irion, dans la Chambre du Cœur.', 'À l\’heure qu\’il est, vous avez dû remarquer que les protections de votre cape s\’affaiblissent à mesure que vous vous enfoncez plus profondément dans les visions.\n\nPour augmenter encore votre résistance à l\’influence de N\’Zoth, nous aurons besoin d\’une plus grande compréhension de son pouvoir malfaisant.\n\nCherchez le savoir des manifestations en vous plongeant plus profondément dans les visions et nous ne tarderons pas à obtenir des réponses.', '', '', '', '', '', '', 33528),
(57392, 'frFR', 'Restauration de La Malédiction de pierre', 'Rassemblez les Pages déchirées de La Malédiction de pierre dans une Vision horrifique et rapportez-les à Irion, dans la Chambre du Cœur.', 'Jusqu\’ici, le contenu de cet ouvrage est déstabilisant, c\’est le moins que l\’on puisse dire. Néanmoins, j\’ai réussi à glaner de précieuses informations sur la nature du pouvoir de N\’Zoth et j\’ai apporté des modifications à votre cape en conséquence.\n\nToutefois, il y a encore beaucoup à apprendre. Restez à l\’affût d\’autres pages quand vous plongerez à nouveau au cœur de ces visions.', '', '', '', '', '', '', 33528),
(57391, 'frFR', 'Restauration de La Malédiction de pierre', 'Rassemblez les Pages déchirées de La Malédiction de pierre dans une Vision horrifique et rapportez-les à Irion, dans la Chambre du Cœur.', 'Je suis tombé sur plusieurs références à ce livre lors de mes recherches sur Ny\’alotha. Écrit par un sectateur néophyte, il documente les « mensonges des Titans » et les « injustices », infligées aux habitants d\’Azeroth.\n\nDe sombres délires ayant pour but de saper la foi en la réalité du lecteur.\n\nCela dit, en étudiant cet ouvrage, nous pouvons obtenir une meilleure compréhension du pouvoir du Dieu très ancien, et ainsi façonner une cape qui offrira une plus grande protection contre lui.\n\nRapportez autant de pages de ce livre que vous le pourrez.', '', '', '', '', '', '', 33528),
(57384, 'frFR', 'Soins monstrueux', '', '', '', '', '', '', '', '', 33528),
(57379, 'frFR', 'Statue de jade infestée', '', '', '', '', '', '', '', '', 33528),
(57378, 'frFR', 'Les vestiges d\’un monde brisé', 'Récupérez un exemplaire de La Malédiction de pierre dans une Vision horrifique et rapportez-le à Irion, dans la Chambre du Cœur.', 'Les connaissances acquises au sein de ces visions nous offrent une occasion unique d\’améliorer nos protections mentales contre la corruption. Pour progresser dans nos travaux, il nous faut étudier les mystères enfouis dans leurs confins les plus obscurs.\n\nCherchez les sources de puissance dissimulées au cœur des visions. Si vous découvrez quoi que ce soit d\’intéressant, n\’hésitez pas à nous en faire part.\n\nEn votre absence, D.A.M.E. et moi allons poursuivre nos recherches ici, dans la chambre.\n\nNous attendrons votre retour, $n.', '', '', '', '', '', '', 33528),
(57376, 'frFR', 'La nécessité cachée', 'Allez voir Lilian Voss dans les Clairières de Tirisfal.', 'Par la faute de Sylvanas, certains membres de la Horde se méfient des Réprouvés. Le moment est venu de regagner leur confiance.\n\nEt nous n\’y arriverons pas tant que nous n\’accepterons pas notre condition. Nous sommes tant à nous sentir perdus, seuls… laissés pour compte.\n\nJ\’ai organisé une rencontre. Elle nous permettra de faire un grand pas en avant… si elle ne nous conduit pas tout droit à la catastrophe. Dans un cas comme dans l\’autre, il faut que vous y assistiez.\n\nRetrouvez-moi dans les clairières de Tirisfal, au domaine Calston.', '', '', '', '', '', '', 33528),
(57375, 'frFR', 'Grosseur palpitante', '', '', '', '', '', '', '', '', 33528),
(57374, 'frFR', 'Dans les sombres profondeurs', 'Aventurez-vous dans une Vision horrifique pour découvrir quelles sombres manifestations nous attendent dans un monde dirigé par N\’Zoth.', 'À présent que la connexion est établie, il est temps de franchir le voile pour savoir ce qui se cache au-delà.\n\nLes découvertes que vous y ferez seront la clé de notre réussite.', '', '', '', '', '', '', 33528),
(57373, 'frFR', 'Plongée dans la folie', 'Trouvez une Vision de N\’Zoth dans la corruption qui ronge le Val de l\’Éternel printemps ou Uldum, et pénétrez-y pour découvrir ce que l\’avenir réserve à Azeroth.', 'Aussi néfaste qu\’elle puisse paraître, cette corruption galopante nous offre l\’occasion de nous préparer aux épreuves à venir, j\’en suis convaincu.\n\nTrouvez l\’une de ces manifestations et voyez ce qui se passe lorsque vous plongez le regard derrière le voile des ténèbres.', '', '', '', '', '', '', 33528),
(57372, 'frFR', 'La Herse', '', '', '', '', '', '', '', '', 33528),
(57371, 'frFR', 'Assaut : Aqir exhumés', '', '', '', '', '', '', '', '', 33528),
(57370, 'frFR', 'Assaut : L\’Empire noir', '', '', '', '', '', '', '', '', 33528),
(57362, 'frFR', 'Au fin fond des ténèbres', 'Parlez à D.A.M.E. pour regagner les Salles de l\’Origine, en Uldum, afin de découvrir la source de l\’anomalie.', 'Les récents rebondissements vont nous permettre de poursuivre nos investigations pour identifier les manifestations ténébreuses tapies sous les sables.\n\nCe ne sera pas une partie de plaisir, $n. Nous évoluons sur une corde tendue au-dessus du précipice de l\’inconnu, mais à présent, la donne a changé du tout au tout.\n\n<Irion examine votre nouvel accoutrement.>\n\nMa foi, vous avez la tenue de l\’emploi.\n\nVoyons quelles découvertes votre retour dans les salles de l\’Origine va mettre au jour.', '', '', '', '', '', '', 33528),
(57359, 'frFR', 'Le rituel d\’invocation', '', '', '', '', '', '', '', '', 33528),
(57339, 'frFR', 'Rituel de construction', '', '', '', '', '', '', '', '', 33528),
(57324, 'frFR', 'Au gré de la marée', 'Allez voir Calia Menethil et Derek Portvaillant.', 'Bonjour, $p.\n\nCalia souhaite nous voir à nouveau.\n\nElle peut être d\’une aide précieuse aux âmes perdues, à ceux qui cherchent une voie moins sombre. Une fois que le doute cessera de voiler sa vision, elle saura déterminer la marche à suivre.\n\nM\’accompagnerez-vous ?', '', '', '', '', '', '', 33528),
(57290, 'frFR', 'Entamer la descente', 'Récupérez l\’Écaille de dragon noir corrompue de la Descente de l\’Aile noire au sommet du Mont Rochenoire, dans les Steppes Ardentes.', 'Protéger son esprit contre les Dieux très anciens implique de recourir à un objet de pure corruption. Peu de gens le savent, mais l\’objet en question existe bel et bien : il sommeille dans les abîmes incandescents de la descente de l\’Aile noire.\n\nRécemment encore, l\’un de mes agents surveillait le secteur et documentait méticuleusement toute activité suspecte, mais voilà qu\’il ne donne plus signe de vie. Manifestement, nous ne sommes pas les seuls à suivre cette piste.\n\nIl n\’y a qu\’un seul endroit où nous trouverons les réponses à nos questions.\n\nNotre périple continue, $n. Rochenoire nous attend.', '', '', '', '', '', 'Retournez voir Irion dans la Chambre du Cœur.', 33528),
(57282, 'frFR', 'Quartier des Mages', '', '', '', '', '', '', '', '', 33528),
(57276, 'frFR', 'Focalisation sur le focalisateur', 'Récupérez $1oa Lambeaux d\’insanité. Vous pouvez en obtenir sur les dépouilles des boss non instanciés et sur ceux de Ny\’alotha, en remportant des champs de bataille et des arènes ou avec des victoires honorables.', 'Le focalisateur du Vide ne renferme qu\’une infime partie de la puissance de N\’Zoth, mais nous pouvons le renforcer afin de confectionner des objets qui seront encore plus efficaces contre le Dieu très ancien.\n\nSi l\’influence de N\’Zoth est omniprésente, elle abonde chez ses lieutenants les plus puissants, $n. Éliminez-les pour obtenir des vestiges de son pouvoir.', '', '', '', '', '', '', 33528),
(57275, 'frFR', 'Préoccupation', 'Apportez le Focalisateur du Vide à Irion, dans la Chambre du Cœur.', '<Alors que vous contemplez le cristal, la lueur de la pièce s\’estompe peu à peu sous une dense fumée noire. Une présence colossale vous murmure soudain des propos incompréhensibles à l\’oreille. Il vous est impossible d\’identifier l\’origine de la voix, pourtant, la sensation de ne pas être $gseul:seule; s\’intensifie. Votre tête se met à tourner tandis que les ténèbres s\’épaississent dans une cacophonie assourdissante.\n\nVous mobilisez toute votre volonté et faites appel à votre détermination…\n\nLa lumière est revenue et, avec elle, le silence. Un cristal modeste gît au creux de votre paume.\n\nPeut-être devriez-vous interroger Irion à son sujet ?>', '', '', '', '', '', '', 33528),
(57272, 'frFR', 'Effigie liée par le sang', '', '', '', '', '', '', '', '', 33528),
(57271, 'frFR', 'Quartier commerçant', '', '', '', '', '', '', '', '', 33528),
(57243, 'frFR', 'Camp d\’esclaves amathet', '', '', '', '', '', '', '', '', 33528),
(57235, 'frFR', 'Collecteur solaire', '', '', '', '', '', '', '', '', 33528),
(57234, 'frFR', 'Collecteur solaire', '', '', '', '', '', '', '', '', 33528),
(57223, 'frFR', 'Gardien déterré', '', '', '', '', '', '', '', '', 33528),
(57222, 'frFR', 'Enquête dans les salles', 'Enquêtez sur l\’anomalie dans les Salles de l\’Origine.', 'Quoi qu\’il se passe, ça vient sûrement du fin fond de la chambre intérieure. On trouvera p\’tet des réponses en atteignant la forge.\n\nÀ vot\’ place, je vérifierais mon barda avant d\’y aller, $n. Allez savoir ce qui nous attend là-dedans…', '', '', '', '', '', '', 33528),
(57221, 'frFR', 'Réorigination', 'Rejoignez Magni Barbe-de-Bronze à l\’extérieur des Salles de l\’Origine, en Uldum.', 'Si Ramkahen a pas donné l\’alerte, c\’est que l\’anomalie doit être confinée dans les salles de l\’Origine.\n\nOn ferait mieux d\’y retourner fissa pour voir ça d\’plus près, $n.', '', '', '', '', '', '', 33528),
(57220, 'frFR', 'Activation du protocole d\’alimentation', 'Rétablissez l\’alimentation des systèmes auxiliaires de la Chambre du Cœur, du Moteur de Nalak\’sha et de la Forge des Origines, puis parlez à D.A.M.E. pour activer la Forge des Origines.', 'On progresse, $n.\n\nQuand l\’alimentation des systèmes auxiliaires sera rétablie, D.A.M.E. pourra exécuter les diagnostics.\n\nReste plus qu\’à mettre les dernières pièces en place.', '', '', '', '', '', '', 33528),
(57219, 'frFR', 'Gardien déterré', '', '', '', '', '', '', '', '', 33528),
(57218, 'frFR', 'Gardien déterré', '', '', '', '', '', '', '', '', 33528),
