(57215, 'frFR', 'Moteur d\’ascension', '', '', '', '', '', '', '', '', 33528),
(57157, 'frFR', 'Assaut : L\’Empire noir', 'Repoussez l\’assaut de N\’Zoth en Uldum.', 'C\’est exactement comme les visions l\’avaient montré. Les forces des ténèbres sont venues s\’emparer de la forge des Origines.\n\nElles doivent être arrêtées ou ce sera la fin de toute vie en Azeroth !', 'Retourner voir le grand prêtre Amet à Ramkahen', '', '', '', '', 'Retournez voir le Grand prêtre Amet à Ramkahen.', 33528),
(57155, 'frFR', 'Aveugler l\’Œil', 'Parlez à Frère Pike pour vous purifier de votre « don ».', 'Ah, vous tombez bien, $c. J\’espérais justement vous voir.\n\nJe sens encore son contact sur votre personne. Notre victoire face au dieu des profondeurs ne sera pas complète tant que nous n\’aurons pas effacé jusqu\’à la moindre trace de sa corruption.\n\nJ\’ai découvert au cours de mes recherches un moyen moins douloureux de purger ses miasmes.\n\nPrévenez-moi dès que vous serez $gprêt:prête; à mettre un terme à ce cauchemar.', '', '', '', '', '', '', 33528),
(57153, 'frFR', 'Quartier des Nains', '', '', '', '', '', '', '', '', 33528),
(57146, 'frFR', 'Déchirure de corruption', '', '', '', '', '', '', '', '', 33528),
(57129, 'frFR', 'Vallée de la Sagesse', '', '', '', '', '', '', '', '', 33528),
(57112, 'frFR', 'Test Shared Quest', '', 'Aucune', 'Test', '', '', '', '', '', 33528),
(57089, 'frFR', 'Couveuse vil\’thik', '', '', '', '', '', '', '', '', 33528),
(57087, 'frFR', 'Oblitérateur baruk', '', '', '', '', '', '', '', '', 33528),
(57085, 'frFR', 'Chariot de guerre renforcé', '', '', '', '', '', '', '', '', 33528),
(57079, 'frFR', 'Quel fourbe ! Mais que fait la police ?', 'Terminer le scénario « Fourbipolis ».', 'Ah, vous voilà enfin ! Ce que je suis contente de vous voir ! On a un sacré problème sur les bras…\n\nPendant que vous distribuiez les invitations, Gallywix et ses sbires se sont emparés de Fourbipolis ! Ils retiennent Hobart Martelutte prisonnier et refusent de le libérer tant qu\’il ne leur aura pas remis l\’armure tactique X-52 !\n\nVous devez intervenir avant qu\’il ne soit trop tard !', '', '', '', '', '', 'Parlez à Hobart Martelutte.', 33528),
(57078, 'frFR', 'La liste VIP', 'Distribuez les invitations pour la vente aux enchères privée de Martelutte.', 'Figurez-vous que pendant que vous aidiez Martelutte à bricoler sa dernière invention, j\’ai remué ciel et terre pour trouver des acheteurs potentiels !\n\nCe sera une vente aux enchères privée, on ne va inviter que l\’élite, le dessus du panier, la crème de la crème… Vous voyez ce que je veux dire ?\n\nJ\’ai réduit le nombre d\’acheteurs pour ne garder que le gratin, les plus riches, les plus distingués, les Gobelins les plus influents de ce monde… sauf Gallywix, bien sûr !\n\nAllez donc distribuer ces invitations pendant que je termine les préparatifs pour les enchères !', '', '', '', '', '', '', 33528),
(57077, 'frFR', 'À la recherche d\’acheteurs !', 'Parlez à Chipie Serrelavis dans la Vallée de Strangleronce.', 'L\’armure tactique X-52 est enfin terminée et Gallywix est reparti bredouille, la queue entre les jambes !\n\nMerci, $n ! Je n\’y serais pas arrivé sans vous !\n\nMais nous n\’en avons pas encore tout à fait terminé… Le meilleur reste à venir ! Nous allons organiser une vente aux enchères et confier l\’armure tactique X-52 au plus offrant !\n\nChipie Serrelavis devrait avoir fini de dresser une liste d\’acheteurs potentiels. Rendez-vous à la planque de Serrelavis et dites-lui que nous sommes prêts !', '', '', '', '', '', '', 33528),
(57076, 'frFR', 'Retour à Tombe-Brume', 'Retournez voir le Parlorage Qian au Sanctuaire Silencieux, dans le Val de l\’Éternel printemps.', 'Nous avons fait tout notre possible. Et nous avons parfaitement conscience de la menace que représentent les Mogu.\n\nSi nous perdons le contrôle du val, il y a fort à parier que la forge tombera entre leurs mains.\n\nRegagnons Tombe-Brume et expliquons la situation aux Rajani. Ils doivent être impatients de savoir ce qui nous attend.', '', '', '', '', '', 'Retournez voir le Parlorage Qian au sanctuaire Silencieux, dans le val de l\’Éternel printemps.', 33528),
(57075, 'frFR', 'Élixir de bravoure', 'Montez Mobi et terrassez les armées mogu grâce au pouvoir de la bière.', 'Il faut faire quelque chose pour tous ces Mogu. Au strict minimum, nous devons réduire leur nombre avant qu\’ils envahissent le val !\n\nOncle Chen a beau tenir à sa bière comme à la prunelle de ses yeux, je pense qu\’on peut en faire un meilleur usage. Grimpons sur ce yack et semons la terreur dans les rangs ennemis !', '', '', '', '', '', '', 33528),
(57074, 'frFR', 'Dos à la porte', 'Chevauchez Mobi jusqu\’à la Porte des Astres vénérables avec Chen et Li Li.', 'Quelle chance que vous ayez trouvé cette bière et un yack pour la transporter !\n\nCela dit, nous ne pouvons pas rester ici. Li Li m\’a suffisamment requinqué pour que je reprenne la route. Nous allons chevaucher ce yack jusqu\’à la porte en espérant que les Mogu ne nous remarquent pas.\n\nPrévenez-moi quand vous serez $gprêt:prête; à partir.', '', '', '', '', '', '', 33528),
(57072, 'frFR', 'Yack à tout faire', 'Trouvez un moyen de rapporter la bière à Chen, à Mogujia.', '<Ces nombreux tonneaux de bière sont trop lourds pour une seule personne.\n\nPeut-être pourriez-vous trouver quelque chose, ou quelqu\’un, pour vous aider ?>', '', '', '', '', '', '', 33528),
(57071, 'frFR', 'Objectif bière', 'Trouvez les Tonneaux de bière abandonnés au Sommet de Kun-Lai.', 'Ma pauvre tête… Quand on a la migraine, il n\’y a pas trente-six solutions.\n\nNous avons survolé un convoi de brasseurs abandonné tout à l\’heure. Retournez sur place et récupérez-moi cette bière ! Une bonne rasade devrait m\’aider à reprendre des forces.\n\nEt en plus, ça remontera le moral des combattants du val.', '', '', '', '', '', 'Trouvez les tonneaux de bière abandonnés au sommet de Kun-Lai.', 33528),
(57070, 'frFR', 'Massacre de Mogu', 'Tuez des Mogu au Sommet de Kun-Lai.', 'Nous sommes dans ce que mes amis appelleraient un « environnement riche en cibles ». C\’est un euphémisme pour dire que nous sommes cernés et très probablement condamnés à une mort certaine.\n\nVous savez ce qu\’il vous reste à faire. Nous devons en tuer un maximum ! Peu importe comment, seul compte le résultat !', '', '', '', '', '', '', 33528),
(57069, 'frFR', 'Des têtes à couper', 'Tuez des Commandants mogu.', 'Bon, nous sommes coincés entre trois armées mogu, et oncle Chen est trop mal en point pour se déplacer.\n\nMais ne perdons pas espoir. C\’est l\’occasion ou jamais d\’éliminer les chefs de ces armées. Avec un peu de chance, ça les ralentira, ou du moins, ça les occupera le temps qu\’on regagne la porte !\n\nEssayez d\’abattre leurs commandants, ce sont les plus gros et les plus redoutables d\’entre eux.', '', '', '', '', '', '', 33528),
(57068, 'frFR', 'Cerf-volant de reconnaissance', 'Empruntez le Cerf-volant de Chen pour évaluer les effectifs des Mogu.', 'Nous avions entendu parler de l\’attaque des Mogu, mais je ne m\’attendais pas à ce qu\’ils soient si nombreux !\n\nIl y a forcément un moyen de les arrêter avant qu\’ils n\’envahissent tout le val. Vite, survolons leurs troupes afin d\’évaluer l\’ampleur de cette menace.\n\nIl se trouve justement que nous avons un cerf-volant capable d\’embarquer trois personnes. En général, c\’est plus, mais j\’ai beaucoup mangé ce midi.', '', '', '', '', '', '', 33528),
(57067, 'frFR', 'Des Mogu à nos portes', 'Retrouvez Chen et Li Li Brune d\’Orage à la Porte des Astres vénérables.', 'L\’heure est venue. Les autres clans mogu ont jeté leur dévolu sur le val de l\’Éternel printemps.\n\nIls ne s\’en empareront pas.\n\nCertains des vôtres ont déjà rallié la porte pour évaluer les effectifs ennemis. Si vous vous croyez à la hauteur d\’une telle mission, allez donc les rejoindre.', '', '', '', '', '', 'Retrouvez Chen et Li Li Brune d\’Orage à la porte des Astres vénérables.', 33528),
(57059, 'frFR', 'Ça va chauffer !', 'Débarrassez-vous de $1oa Crapules recrutées.', 'La situation est critique, $n !\n\nGallywix pense pouvoir m\’intimider avec ses sbires, mais s\’il s\’imagine que je vais lui donner l\’armure tactique X-52, il se met le doigt dans l\’œil jusqu\’au coude !\n\nVous devez aller sauver mon atelier et vous débarrasser de ces affreux avant que TOUTES MES INVENTIONS ne partent en fumée !', '', '', '', '', '', '', 33528),
(57058, 'frFR', 'Mines en folie', 'Récupérez la Boisson rafraîchissante à la noix de coco dans le champ de mines.', 'Le prototype de l\’armure tactique X-52 est paré pour le test final !\n\nLe bruit et les explosions soudaines d\’énergie commotionnante ne vous dérangent pas trop, j\’espère, $n ?\n\nPour l\’ultime test, vous allez enfiler l\’armure tactique X-52 et traverser un champ de mines !\n\nJ\’ai placé une boisson rafraîchissante à la noix de coco au centre du site. Ce sera votre récompense pour avoir atteint l\’oasis et survécu à ces inévitables explosions !', '', '', '', '', '', '', 33528),
(57053, 'frFR', 'Test de résistance aux chocs', 'Terminez l\’expérience de Hobart Martelutte.', 'À présent que nous avons les thermocoupleurs, nous allons pouvoir passer au prochain test du prototype de l\’armure tactique X-52 !\n\nHélas, je n\’ai plus un seul assistant sous la main… Tous ont démissionné ou passé l\’arme à gauche… Dommage pour eux ! Mais tant mieux pour vous, $n ! Vous allez avoir l\’immense privilège d\’enfiler l\’armure tactique X-52 !\n\nQuelle chance vous avez !\n\nLe prochain test sera mené par ma nouvelle mécanolaborantine. Rendez-vous à l\’atelier principal et appuyez sur le gros bouton rouge pour commencer.\n\nNe vous inquiétez pas, je vous donnerai les consignes via l\’interphone intégré de la X-52 !', '', '', '', '', '', '', 33528),
(57052, 'frFR', 'J\’ai tout ce qu\’il vous faut', 'Apportez le colis à Hobart Martelutte.', 'À moi de respecter ma part du marché, $n. Voici les thermocoupleurs que vous avez commandés !\n\nDites bien à ce vieux grincheux de Martelutte qu\’il ne faut plus compter sur ma générosité. S\’il a besoin d\’autres thermocoupleurs, il faudra qu\’il mette la main au porte-monnaie.\n\nQuoi qu\’il en soit, c\’était un plaisir de faire affaire avec vous…\n\nEt maintenant, hors de ma vue !', '', '', '', '', '', '', 33528),
(57051, 'frFR', 'Recouvrement de dettes !', 'Récupérez $1oa Dettes impayées.', 'Il vous faut des thermocoupleurs ? Eh bien, vous avez frappé à la bonne porte, $gmon petit:ma petite; !\n\nMais je vous préviens, la maison ne fait pas crédit. J\’ai déjà bien assez d\’ardoises impayées sur les bras. Je croule sous les dettes et je vais devoir mettre la clé sous la porte si je ne renfloue pas mes caisses rapidement.\n\n<Mani Graissemèche réfléchit quelques instants.>\n\nBon, écoutez… Si vous réussissez à forcer ces vauriens à régler leurs ardoises, je vous donnerai les thermocoupleurs en guise de paiement.\n\nJe ne peux pas vous proposer mieux !', '', '', '', '', '', '', 33528),
(57049, 'frFR', 'Caveau des âmes', '', '', '', '', '', '', '', '', 33528),
(57048, 'frFR', 'Pièces au détail', 'Parlez à Mani Graissemèche.', 'Je vais avoir besoin de composants supplémentaires pour terminer la prochaine phase de tests.\n\nCe qu\’il nous faut en priorité, ce sont des thermocoupleurs et leurs adaptateurs ! Je vous expliquerai à quoi ils serviront plus tard…\n\nMani Graissemèche tient une boutique près de l\’entrée de la ville. Allez donc lui demander les pièces nécessaires.\n\nPeu importe le prix, il n\’aura qu\’à m\’envoyer la facture plus tard ! J\’ai autre chose à faire que de marchander en ce moment… Préparer les modifications pour l\’armure, par exemple !', '', '', '', '', '', '', 33528),
(57047, 'frFR', 'Une simple expérience', 'Aidez Hobart Martelutte.', 'Maintenant que j\’ai les pièces nécessaires, je peux commencer à tester mon dernier prototype !\n\nJe l\’ai baptisé « armure tactique X-52 » ! Cette petite merveille est indestructible, ou presque !\n\nGallywix a toujours cherché à s\’approprier mes inventions et maintenant qu\’il a eu vent de l\’existence de l\’armure, il va tout faire pour s\’en emparer. Je dois la finir avant qu\’il ne me fasse encore un sale coup !\n\nJ\’aurais vraiment besoin d\’un coup de main pour les tests.\n\nJe peux compter sur vous, $n ?', '', '', '', '', '', '', 33528),
(57045, 'frFR', 'Une livraison spéciale', 'Apportez le colis à Hobart Martelutte.', 'Ah, vous voilà enfin, $n ! J\’ai une livraison importante à faire et vous êtes $gle Gobelin:la Gobeline; de la situation !\n\nBon, d\’accord, ça ne veut pas dire grand-chose, mais c\’est compliqué de trouver des gens fiables de nos jours, vous savez !\n\nEnfin bref… Le colis est pour Hobart Martelutte. Il faudrait que vous le lui remettiez en main propre à son atelier de Fourbipolis. Il travaille sur un projet hyper important en ce moment !\n\nApportez-lui ce paquet et surtout… NE LE FAITES PAS TOMBER !\n\nVous n\’imaginez pas le temps qu\’il m\’a fallu pour trouver ce machin !', '', '', '', '', '', '', 33528),
(57043, 'frFR', 'Vieux amis, nouvelles opportunités', 'Parlez à Chipie Serrelavis dans la Vallée de Strangleronce.', 'Ça alors ! Si c\’est pas $n ! Vous êtes justement $gle Gobelin:la Gobeline; qu\’il nous fallait !\n\nÇa fait un bail que je ne vous ai plus $grevu:revue; ! Depuis Kezan, c\’est ça ? Qu\’est-ce qu\’on a passé de bons moments à bourlinguer ensemble !\n\nJe ne veux pas vous prendre par les sentiments, mais c\’est Chipie Serrelavis qui m\’envoie… Figurez-vous qu\’elle veut reformer l\’équipe pour monter un GROS coup !\n\nBon, c\’est pas que je veux pas tailler le bout de gras, mais on a pas que ça à faire. Le temps, c\’est de l\’argent, comme on dit !\n\nSi le boulot vous intéresse, allez voir Chipie. Elle vous donnera toutes les infos nécessaires !', '', '', '', '', '', '', 33528),
(57039, 'frFR', 'Vallée des Esprits', '', '', '', '', '', '', '', '', 33528),
(57023, 'frFR', 'Artéfact mogu lesté', '', '', '', '', '', '', '', '', 33528),
(57022, 'frFR', 'Assaut : Avancée amathet', '', '', '', '', '', '', '', '', 33528),
(57008, 'frFR', 'Assaut : La guerre des clans', 'Repoussez l\’assaut des Mogu au Val de l\’Éternel printemps.', 'Les clans mogu vont profiter de l\’opportunité pour tenter de s\’emparer du Val pendant que ses défenseurs se remettent de l\’attaque de N\’Zoth.\n\nC\’est aussi lâche que stupide.\n\nAidez-les à ouvrir les yeux.', 'Retourner voir le parlorage Qian, au sanctuaire du Silence', '', '', '', '', 'Retournez voir le parlorage Qian, au sanctuaire du Silence.', 33528),
(57001, 'frFR', 'Vallée de l\’Honneur', '', '', '', '', '', '', '', '', 33528),
(56906, 'frFR', 'Couronne de bonne fortune', 'Cueillez des fleurs au Berceau-de-l\’Hiver, en Dun Morogh et dans les Contreforts de Hautebrande.', 'Ces fleurs me rappellent Élune elle-même ! J\’en porte d\’ailleurs toute l\’année pour ne jamais oublier sa grâce bienveillante.\n\nPeut-être aimeriez-vous en faire de même ?\n\nVotre couronne est tressée de fleurs ordinaires qui finiront hélas par faner. C\’est un bien triste sort pour d\’aussi délicates créations, mais voyez : celles qui ornent la mienne ont été cueillies l\’an dernier ! Si vous m\’apportez des fleurs qui éclosent uniquement à l\’occasion de la fête lunaire, je les bénirai afin que vous puissiez vous aussi porter votre couronne tout au long de l\’année.', '', '', '', '', '', 'Retournez voir Myraël Lunefleur à Reflet-de-Lune.', 33528),
(56905, 'frFR', 'Couronne de fleurs sombres', 'Cueillez des fleurs dans le Bois de la Pénombre, la Forêt des Pins-Argentés et en Désolace.', 'Ces fleurs sont si lugubres… mais elles ont une beauté qui leur est propre, vous ne trouvez pas ? Si seulement elles n\’étaient pas aussi éphémères.\n\nPermettez-moi de vous offrir mon aide.\n\nDes fleurs similaires éclosent à chaque fête lunaire. Elles ont un lien particulier avec Élune… un lien que je peux amplifier. Si vous m\’en apportez, je ferai en sorte de les préserver afin que vous puissiez en profiter bien plus longtemps qu\’une fleur ordinaire.', '', '', '', '', '', 'Retournez voir Myraël Lunefleur à Reflet-de-Lune.', 33528),
(56904, 'frFR', 'Couronne de prospérité', 'Cueillez des fleurs dans le Cratère d\’Un\’Goro, la Vallée de Strangleronce et les Tarides du Nord.', 'Votre couronne est si colorée ! Quelle charmante association de roses, de jaunes et de bleus… Si seulement elle pouvait perdurer !\n\nCes fleurs finiront hélas par se flétrir, mais j\’en connais d\’autres qui résisteront aux outrages du temps !\n\nDes fleurs similaires éclosent à chaque fête lunaire. Grâce à vous, je peux désormais renforcer le lien qui les unit à Élune. Allez en cueillir et nous vous tresserons une couronne que vous pourrez porter toute l\’année !', '', '', '', '', '', 'Retournez voir Myraël Lunefleur à Reflet-de-Lune.', 33528),
(56903, 'frFR', 'Couronne de courage', 'Cueillez des fleurs dans le Bois des Chants éternels, les Hinterlands et en Mulgore.', 'Je vois que vous avez un penchant marqué pour les fleurs roses. Quel dommage que votre couronne soit condamnée à faner tôt ou tard !\n\nMais peut-être puis-je vous aider ?\n\nBien qu\’il s\’agisse de fleurs ordinaires, j\’en connais de semblables qui n\’éclosent qu\’à l\’occasion de la fête lunaire. Si vous m\’en apportez, je les imprégnerai du pouvoir d\’Élune afin que vous puissiez en profiter toute l\’année.', '', '', '', '', '', 'Retournez voir Myraël Lunefleur à Reflet-de-Lune.', 33528),
(56889, 'frFR', 'Bat-le-désert blessés', 'Soignez $1oa Travailleurs bat-le-désert.', 'Vous revenez nous prêter main-forte, mon $gami:amie; ?\n\nComme vous pouvez le constater, nous livrons toujours un rude combat contre ces créatures dont nous désespérons de réduire le nombre.\n\nHélas, nous manquons de bras pour livrer une guerre d\’usure aussi coûteuse en soldats.\n\nJe compte donc sur vous pour aider les blessés que vous croiserez dans les ruines.', '', '', '', '', '', '', 33528),
(56771, 'frFR', 'Guerriers perdus dans le temps', 'Allez voir les Rajani au Sanctuaire Silencieux.', 'D\’après le rapport de reconnaissance qu\’vous avez trouvé, les Rajani sont retranchés dans le sanctuaire Silencieux qui surplombe Tombe-Brume.\n\nApparemment, ces Mogu sont aussi solitaires qu\’agressifs. Autant dire qu\’il va falloir être prudents en les approchant.\n\nBon, on s\’retrouve sur place.', '', '', '', '', '', '', 33528),
(56751, 'frFR', 'Réquisitions de Mécarouille : os calcifié', 'Apportez $1oa morceaux de Minerai de foudrargent à Gila Filkistouch.', '', '', '', '', '', '', '', 33528),
(56750, 'frFR', 'Réquisitions de Mécarouille : os calcifié', 'Apportez $1oa morceaux de Minerai de foudrargent à Skaggit.', '', '', '', '', '', '', '', 33528),
(56647, 'frFR', 'La menace mantide', 'Retournez voir le Parlorage Qian, au Sanctuaire du Silence.', 'Les mantides corrompent leurs arbres kyparis pour imprégner leur ambre de la puissance de N\’Zoth. À lui seul, l\’essaim représente déjà un danger bien réel, mais N\’Zoth pourrait le métamorphoser en une menace plus sinistre encore…\n\nIl faut en informer les Pandashan. Et je vous conseille de transmettre l\’information à vos autres alliés également.', '', '', '', '', '', 'Retournez voir le parlorage Qian, au sanctuaire du Silence.', 33528),
(56645, 'frFR', 'Cœur de l\’essaim', 'Envolez-vous avec Taoshi sur le Cerf-volant pandashan.', 'Il faut que nous en apprenions davantage sur l\’ennemi. Nous ferions mieux d\’observer l\’essaim avant de repartir pour l\’Échine du Serpent.\n\nJe vais nous emmener survoler le Cœur de la peur. De là-haut, nous pourrons évaluer la taille des armées de l\’impératrice Shek\’zara. Cela nous permettra de déterminer l\’importance des renforts fournis par N\’Zoth.', '', '', '', '', '', '', 33528),
(56617, 'frFR', 'L\’essaim uni', 'Infiltrez Klaxxi\’vess.', 'Il semble que la corruption de l\’ambre par les mantides ne date pas d\’hier. Il serait donc logique qu\’ils en aient accumulé des réserves quelque part.\n\nLes derniers rapports des éclaireurs pandashan semblent indiquer que les rangs des guerriers de l\’essaim se sont récemment étoffés à Klaxxi\’vess. Il y a fort à parier qu\’ils sont là pour protéger l\’ambre corrompu.\n\nRetrouvez-moi sur place. Avant de pouvoir détruire cet ambre, il faut commencer par s\’en emparer.', '', '', '', '', '', '', 33528),
(56616, 'frFR', 'À vieilles connaissances, nouveaux problèmes', 'Tuez le Guetteur Vl\’thax.', 'Un sbire de N\’Zoth semble avoir remarqué notre présence.\n\nPeut-être devrions-nous lui rendre une petite visite ?', '', '', '', '', '', '', 33528),
(56580, 'frFR', 'Secrets d\’ambre', 'Récupérez $1oa Morceaux d\’ambre corrompu.', 'La chambre des Demains abrite un petit groupe de mantides zara\’thik qui répondent aux ordres directs de la nouvelle impératrice. Il est possible que certains d\’entre eux transportent des morceaux d\’ambre similaires à celui que vous avez trouvé.\n\nRécupérez cet ambre, les Pandashan vous en seront reconnaissants.', '', '', '', '', '', '', 33528),
(56578, 'frFR', 'Pourri jusqu\’à la racine', 'Mettez un terme à la source de la corruption dans la Chambre des Demains.', 'Dans les profondeurs de Kypari Kor se trouve une vaste chambre d\’où les mantides veillent sur l\’arbre. C\’est certainement là que nous trouverons la source de la corruption.\n\nNous devons accéder à cette salle et les empêcher de nuire. Nous ne pouvons pas permettre à N\’Zoth de renforcer l\’essaim.', '', '', '', '', '', '', 33528),
(56577, 'frFR', 'Un coup à la ruche', 'Tuez $1oa Mantides kor\’thik à Kor\’vess.', 'Les mantides des environs travaillent d\’arrache-pied pour récolter l\’ambre de l\’arbre.\n\nTuez-en quelques-uns, cela les ralentira peut-être.', '', '', '', '', '', '', 33528),
(56576, 'frFR', 'Extermination d\’Aqir', 'Tuez $1oa Empaleurs aqir.', 'Ces bestioles volantes sont bien trop nombreuses pour qu\’on puisse décoller sans danger.\n\nÀ la seconde où les moteurs tourneront, c\’est tout un essaim qui nous tombera dessus, c\’est sûr !\n\nPuisque ces insectes aiment être six pieds sous terre, je vous propose de les aider à y retourner, si vous voyez ce que je veux dire.', '', '', '', '', '', '', 33528),
(56575, 'frFR', 'Nouvelle corvée à Kor\’vess', 'Inspectez Kor\’vess.', 'C\’est un membre de l\’essaim qui le détenait ? Il transpire la corruption… et exsude une certaine puissance. L\’heure est grave si le reste de l\’ambre des mantides est ainsi corrompu.\n\nÀ l\’ouest des terres de l\’Angoisse se dresse Kor\’vess. Ce grand arbre kypari constitue la plus grande source d\’ambre de l\’essaim. En l\’examinant, nous pourrons déterminer quelle proportion des réserves mantides est imprégnée de l\’énergie des Dieux très anciens.\n\nJe vous retrouverai non loin de l\’arbre.', '', '', '', '', '', '', 33528),
(56574, 'frFR', 'Réflexions d\’ambre', 'Apportez l\’Ambre couvert de vase aux Pandashan, à l\’Échine du Serpent.', '<Ce gros morceau d\’ambre est couvert d\’une vase dégoulinante, sombre et visqueuse. Impossible d\’essuyer la substance qui semble suinter de l\’ambre lui-même.\n\nDes murmures incompréhensibles vous assaillent pendant que vous l\’inspectez.\n\nLes Pandashan souhaiteront sûrement l\’examiner.>', '', '', '', '', '', 'Apportez l\’ambre couvert de vase aux Pandashan, à l\’Échine du Serpent.', 33528),
(56550, 'frFR', 'Nettoyage des corps', 'Brûlez $1oa Cadavres porteurs d\’œufs.', 'Les nôtres sont chaque jour plus nombreux à succomber sous les coups de ces terribles insectes qui attaquent nos campements.\n\nJe m\’en veux de vous demander une chose pareille, mais nous devons nous débarrasser de leurs dépouilles au plus vite.\n\nPas question de laisser nos ennemis nourrir leurs œufs répugnants avec nos morts !', '', '', '', '', '', '', 33528),
(56542, 'frFR', 'Espoir retrouvé', 'Parlez à Ra Den pour regagner la Chambre du Cœur.', 'Votre persévérance me redonne de l\’espoir quant à l\’avenir de ce monde.\n\nRegagnons votre fameuse « chambre du Cœur ». En tant que gardien de la forge des Origines, je pense pouvoir vous aider à la remettre en état.\n\nPrévenez-moi quand vous serez $gprêt:prête;, et je nous y conduirai.', '', '', '', '', '', '', 33528),
(56541, 'frFR', 'Le moteur de Nalak\’sha', 'Empruntez le passage secret du Palais Mogu\’shan et réactivez le Moteur de Nalak\’sha.', 'Ce ne serait pas la première fois qu\’un individu de votre espèce bouscule mes certitudes. Je vais donc vous donner une chance de recommencer.\n\nLe complexe titanesque qui abrite le moteur de Nalak\’sha couvre l\’ensemble de la Pandarie, et les caveaux Mogu\’shan ne sont pas le seul passage permettant d\’y accéder.\n\nIl existe de nombreuses entrées, mais la plus proche se trouve dans l\’enceinte du palais Mogu\’shan, dont les salles souterraines sont reliées aux caveaux.\n\nC\’est là-bas que vous avez rendez-vous avec votre destin, $gchampion:championne;.', '', '', '', '', '', '', 33528),
(56540, 'frFR', 'Preuve de ténacité', 'Obtenez un Trophée du conquérant sur le commandant d\’un Assaut au Val de l\’Éternel printemps.', 'Puisque le grand gardien est convaincu que nous n\’avons aucune chance face à nos ennemis, une petite démonstration de force le fera peut-être changer d\’avis.\n\nNe me demandez pas comment, mais si vous parvenez à lui apporter la preuve de votre victoire face à ceux qui menacent le val, il se laissera peut-être convaincre qu\’il faut agir.', '', '', '', '', '', '', 33528),
(56539, 'frFR', 'À la recherche des Rajani', 'Récupérez un Rapport de reconnaissance mogu sur des Mogu du Val de l\’Éternel printemps.', 'Maintenant que nous avons une meilleure idée de ceux qu\’il nous faut chercher, reste à découvrir où les trouver.\n\nLes Mogu étant en conflit permanent, il y a fort à parier que chaque clan sache précisément où se cachent ses rivaux. C\’est en mettant la main sur ce genre de renseignements que nous débusquerons les Rajani.\n\nCherchez les champions mogu. Ils sont les plus à même de détenir des rapports sur les positions de leurs ennemis.', '', '', '', '', '', '', 33528),
(56538, 'frFR', 'Les clans mogu', 'Aidez le Chroniqueur Cho à découvrir l\’origine du Mystérieux cachet mogu au Siège de la Connaissance.', 'Vous dites qu\’un Mogu a sollicité votre aide ? Voilà qui ne leur ressemble pas.\n\nJe serais ravi de vous aider à retracer les origines de ce cachet. Pour tout vous avouer, l\’éventualité d\’un clan mogu qui ne soit pas ouvertement hostile m\’intéresse au plus haut point. Songez plutôt aux possibilités que cela nous offrirait !\n\nMettons-nous au travail. Nous allons devoir consulter les ouvrages consacrés aux divers clans mogu du val afin de réduire le champ de nos recherches.', '', '', '', '', '', '', 33528),
(56537, 'frFR', 'Le mystérieux cachet', 'Apportez le Mystérieux cachet mogu au Chroniqueur Cho au Siège de la Connaissance, dans le Val de l\’Éternel printemps.', '<Le défunt Mogu tient dans sa main un cachet, symbole du clan mystérieux auquel il appartient.\n\nSi vous parvenez à remonter leur piste, les autres membres du clan vous en diront peut-être davantage sur l\’invasion de mantides dans les caveaux Mogu\’shan et sur le meilleur moyen d\’en venir à bout.\n\nLe chroniqueur Cho est réputé à travers toute la Pandarie pour ses vastes connaissances. Peut-être pourra-t-il vous renseigner quant aux origines du cachet mogu ?>', '', '', '', '', '', '', 33528),
(56536, 'frFR', 'Une mission de longue haleine', 'Retrouvez Magni Barbe-de-Bronze à l\’extérieur des Caveaux Mogu\’shan, au Sommet de Kun-Lai.', 'Aux dernières nouvelles, les caveaux Mogu\’shan étaient toujours abandonnés.\n\nOn devrait pas avoir trop de mal à atteindre le moteur, vu qu\’on a déjà zigouillé les gardiens mogu postés sur place.\n\nAlors, qu\’est-ce que vous attendez ? Allons réactiver cet engin !', '', '', '', '', '', '', 33528),
(56472, 'frFR', 'L\’accord d\’Uldum', 'Renseignez-vous sur les menaces qui pèsent sur Uldum à Ramkahen.', 'Vous avez besoin d\’aide pour défendre la forge des Origines ? Dans ce cas, il semblerait que nos objectifs concordent.\n\nLes salles de l\’Origine ne représentent qu\’une infime partie du territoire couvert par la forge. Toute menace pesant sur Uldum est un danger potentiel pour la forge, et nos ennemis se sont multipliés ces derniers temps.\n\nNous étions sur le point de réunir le haut conseil quand ces Bat-le-désert ont débarqué sans crier gare. Que diriez-vous de vous joindre à nous pour en apprendre davantage sur ces menaces ?', '', '', '', '', '', '', 33528),
(56402, 'frFR', 'Pièces bat-le-désert', 'Récupérez $1oa Pièces bat-le-désert.', 'Le moins que nous puissions faire pour nos frères et sœurs défunts, c\’est d\’offrir un peu de réconfort à leurs familles.\n\nChaque Bat-le-désert porte sur lui une pièce distinctive qui témoigne de son appartenance à notre groupe.\n\nCe serait bien aimable à vous de m\’apporter toutes celles que vous trouverez afin que je puisse les remettre à leurs plus proches parents.', '', '', '', '', '', '', 33528),
(56393, 'frFR', 'Gnomivore', '', '', '', '', '', '', '', '', 33528),
(56391, 'frFR', 'Sabrecroc frénétique', '', '', '', '', '', '', '', '', 33528),
(56377, 'frFR', 'Forger l\’avenir', 'Retournez voir Magni Barbe-de-Bronze dans la Chambre du Cœur et découvrez ce qu\’il est advenu de la Forge des Origines.', 'Merci de m\’avoir aidé à la forge. Dommage que N\’Zoth ait réussi à l\’infiltrer si rapidement, mais au moins, on est arrivés à temps pour l\’empêcher d\’la démolir complètement !\n\nReste plus qu\’à la r\’mettre en état. D.A.M.E. y a longuement réfléchi et j\’crois bien qu\’on a un plan.', '', '', '', '', '', '', 33528),
(56376, 'frFR', 'Menaces émergentes', 'Venez à bout d\’un Assaut en Uldum.', 'Les Tol\’vir considèrent la protection des assemblages des Titans en Uldum comme un devoir sacré. Cependant, nous sommes aux prises avec des menaces grandissantes et nos effectifs ne sont plus ce qu\’ils étaient.\n\nMême avec le soutien de nos nouveaux alliés, nous ne pourrons retenir éternellement ces ennemis. Il suffirait que l\’un d\’entre eux monte en puissance pour que nous soyons submergés et que la sécurité de la forge soit compromise. Voilà pourquoi nous avons besoin de votre aide.\n\nLe haut-commandant Kamses vous expliquera la situation en détail.', '', '', '', '', '', '', 33528),
(56375, 'frFR', 'Vers Ramkahen', 'Allez voir le Roi Phaoris à Ramkahen.', 'Bon, va falloir qu\’on prenne not\’ mal en patience le temps que D.A.M.E. trouve une solution pour la forge. En attendant, faut qu\’on empêche ces sagouins de faire encore plus de dégâts !\n\nVous devriez aller voir les Tol\’vir de Ramkahen. J\’sais que vous leur avez prêté main-forte par le passé, alors ils accepteront p\’t-être de nous aider à éviter que la forge tombe entre de mauvaises mains.', '', '', '', '', '', '', 33528),
(56374, 'frFR', 'Problème titanesque', 'Rejoignez Magni Barbe-de-Bronze dans les Salles de l\’Origine, en Uldum.', 'Y a pas de temps à perdre.\n\nSans la forge des Origines, Azeroth est à la merci de la corruption de N\’Zoth. Sans compter qu\’elle abrite une arme capable d\’anéantir toute vie dans not\’ monde !\n\nFaut qu\’on s\’rende sur place en quatrième vitesse. D.A.M.E. veillera au grain pendant notre absence.\n\nMagnez-vous, je vous rejoins là-bas.', '', '', '', '', '', '', 33528),
(56308, 'frFR', 'Assaut : Aqir exhumés', 'Repoussez l\’assaut des Aqir en Uldum.', 'Notre position est envahie. Les Aqir surgissent en grand nombre, je n\’en avais jamais vu autant !\n\nJe ne sais pas combien de temps nous allons pouvoir tenir. Vous devez les repousser !', 'Retourner voir Arik Dard-de-Scorpide à l\’obélisque de la Lune', '', '', '', '', 'Retournez voir Arik Dard-de-Scorpide à l\’Obélisque de la Lune.', 33528),
(56209, 'frFR', 'Les salles de l\’Origine', 'Terrassez les Amathet et réactivez la forge dans les Salles de l\’Origine.', 'Un groupe de Tol\’vir qui se fait appeler les Amathet a pris le contrôle des salles de l\’Origine. J\’peux pas vous dire grand-chose de plus, à part qu\’ils viennent de débarquer en ville et qu\’ils sont pas très amicaux.\n\nVa falloir qu\’on entre là-dedans et qu\’on réactive la forge. Sinon, Azeroth est cuite !', '', '', '', '', '', '', 33528),
