(56075, 'frFR', 'Puissance dérobée', 'Récupérez $1oa Parchemins des Shirakess.', 'C\’est du Vide que ces Nagas tirent leurs forces.\n\nChaque parchemin, chaque connaissance partagée est source de pouvoir.\n\nDonc, logiquement, si nous les privons de ce savoir, nous les privons aussi de leur pouvoir.\n\nMon raisonnement est peut-être bancal, mais il n\’y a qu\’un seul moyen d\’en avoir le cœur net !', '', '', '', '', '', '', 33528),
(56074, 'frFR', 'Conduit du Vide', '', '', '', '', '', '', '', '', 33528),
(56064, 'frFR', 'Assaut : L\’Empire noir', 'Repoussez l\’assaut de N\’Zoth au Val de l\’Éternel printemps.', 'Je n\’arrive pas à en croire mes yeux. L\’Empire noir est en train de se matérialiser ici, en plein cœur du Val !\n\nNous devons passer à l\’action !', 'Retourner voir le chroniqueur Cho au siège de la Connaissance', '', '', '', '', 'Retournez voir le Chroniqueur Cho au Siège de la Connaissance.', 33528),
