(55523, 'frFR', 'Liste de commissions', 'Trouvez des marchands murlocs et récupérez les objets dont Mrrl a besoin.', '<Mrrl désigne votre sac à dos, puis trace quelques dessins sur le sable. Il extirpe une babiole de derrière un rocher, avant de pointer le doigt énergiquement vers lui, puis à nouveau vers vous et votre sac.\n\nTout laisse à penser qu\’il veut faire du troc.>', '', '', '', '', '', '', 33528),
