(55381, 'frFR', 'Réquisitions de Mécarouille : minerai de foudrargent', 'Apportez $1oa morceaux de Minerai de foudrargent à Skaggit.', '', '', '', '', '', '', '', 33528),
(55380, 'frFR', 'Réquisitions de Mécarouille : minerai de foudrargent', 'Apportez $1oa morceaux de Minerai de foudrargent à Gila Filkistouch.', '', '', '', '', '', '', '', 33528),
