(55350, 'frFR', 'Assaut : Avancée amathet', 'Repoussez l\’assaut des Amathet en Uldum.', 'Les Amathet cherchent à s\’emparer de la forge des Origines. Nous ne pouvons pas la laisser tomber à nouveau entre leurs mains !\n\nNos hommes défendent l\’entrée, mais ils seront submergés si l\’ensemble des troupes amathet avancent dans leur direction.\n\nFaites ce que vous pouvez pour détourner leurs troupes avant qu\’il soit trop tard.', 'Retourner voir le haut-commandant Kamses à Ramkahen', '', '', '', '', 'Retournez voir le Haut-commandant Kamses à Ramkahen.', 33528),
(55036, 'frFR', 'Un endroit terrible', 'Terminez une Vision de N\’Zoth.', 'Vous avez sans doute remarqué les nombreuses perturbations qui se manifestent aux quatre coins d\’Azeroth. Le Dieu très ancien monte en puissance, et c\’est une mauvaise nouvelle pour nous tous.\n\nSur les lieux des anomalies apparaissent régulièrement ce que j\’appelle les piliers de vérité infinie. Joli nom, n\’est-ce pas ? Que voulez-vous, j\’ai toujours eu le sens de la formule.\n\nBref, où en étais-je, déjà ? Ah oui. Ces piliers permettent d\’accéder à l\’esprit du Dieu très ancien. Ils vous donneront un aperçu du sort réservé à notre monde si nous ne parvenons pas à le battre.\n\nÊtes-vous $gprêt:prête; à tenter l\’expérience ?', '', '', '', '', '', '', 33528),
(54990, 'frFR', 'La nouvelle garde', 'Rejoignez Tess Grisetête au Donjon de Hurlevent.', 'Il faut que je m\’entretienne avec mes parents. Mon père et moi avons beaucoup à nous dire, j\’ai l\’impression.\n\nRetrouvez-moi au donjon de Hurlevent. Je voudrais vous remercier de façon plus formelle.', '', '', '', '', '', '', 33528),
(54984, 'frFR', 'On ne réveille pas un loup qui dort', 'Empruntez le Portail onirique et guidez Tess.', 'L\’essence de Tess erre désormais dans une partie du Rêve d\’émeraude que j\’ai projeté dans ses pensées. Je lui ai transmis mon don, mais elle aura tout de même besoin $gd\’un:d\’une; guide.\n\nEntrez dans le Rêve par le portail qui se dresse derrière moi. Il vous mènera près de l\’endroit où elle dort. Voyez si vous pouvez lui montrer à quel point la rage peut aveugler les mortels.', '', '', '', '', '', '', 33528),
(54983, 'frFR', 'Le réveil d\’un rêveur', 'Défendez Vassandra Grifforage pendant qu\’elle invoque Goldrinn.', 'Je pense avoir tout ce qu\’il me faut pour invoquer l\’ancien.\n\nCependant, certains importuns risquent de répondre à l\’appel avant lui, c\’est pourquoi il faudra que vous me protégiez pendant que j\’accomplis le rituel !', '', '', '', '', '', '', 33528),
(54982, 'frFR', 'L\’esprit du chasseur', 'Récupérez les crocs des Loups croc-de-brume.', 'J\’aurai peut-être aussi besoin de crocs de loup pour ce rituel.\n\nUne meute s\’est récemment installée près du manoir Mantebrume. Apportez-moi leurs crocs. Je vous attendrai au bosquet Crépusculaire.', '', '', '', '', '', 'Rejoignez Vassandra Grifforage au bosquet Crépusculaire.', 33528),
(54981, 'frFR', 'Hurler à la lune', 'Cueillez une fleur de la Grâce d\’Élune.', 'Le bois de la Pénombre jouit d\’un lien direct avec le Rêve d\’émeraude, un lien dont je compte me servir pour invoquer Goldrinn, le loup ancien. Il pourra donner à la princesse un avant-goût de la malédiction qu\’elle poursuit de façon si téméraire.\n\nÀ l\’est des bois s\’épanouit une fleur des plus rares. Cueillez-la et retrouvez-moi au bosquet Crépusculaire. Elle me sera très utile lors du rituel.', '', '', '', '', '', 'Rejoignez Vassandra Grifforage au bosquet Crépusculaire.', 33528),
(54980, 'frFR', 'La plaie des Plaies-de-nuit', 'Maîtrisez Pupille-Rouge et ramenez-la à Colline-aux-Corbeaux.', 'La princesse Grisetête m\’a fait part de la situation et je crois savoir comment vous aider.\n\nCela dit, j\’aimerais tout d\’abord que vous me rendiez un service. Une Worgen particulièrement féroce de la meute des Plaies-de-nuit, surnommée « Pupille-Rouge », tourmente actuellement les habitants du bois de la Pénombre. Prenez le sédatif de maître Harris et ramenez-la-moi en vie. Elle fera un cobaye idéal pour nos remèdes.', '', '', '', '', '', '', 33528),
(54977, 'frFR', 'Au cœur du bois de la Pénombre', 'Parlez à Vassandra Grifforage dans le Bois de la Pénombre.', 'J\’ai rencontré à Teldrassil une dénommée Vassandra Grifforage qui pourrait instruire Tess de façon moins brutale. C\’est cette même Elfe de la nuit qui a aidé notre peuple à contenir le mal qui l\’accablait.\n\nVous la trouverez au bois de la Pénombre où elle assiste les habitants de Colline-aux-corbeaux qui tentent de soigner les Worgens farouches de la région. Si quelqu\’un sait quelque chose à propos de la malédiction, c\’est bien elle.\n\nJ\’ai également une requête personnelle à vous adresser : si vous pouviez faire en sorte que ma fille ne commette aucune imprudence… Elle tient de son père, j\’en ai peur.', '', '', '', '', '', '', 33528),
(54976, 'frFR', 'L\’ombre de Gilnéas', 'Rejoignez Tess Grisetête au Donjon de Hurlevent.', '$GChampion:Championne; de Gilnéas !\n\nJ\’ai une lettre à vous remettre de la part de la princesse Tess Grisetête. Elle vous fait mander au donjon de Hurlevent.', '', '', '', '', '', '', 33528),
