(54568, 'frFR', 'Seigneur-branche Aldrus', '', '', '', '', '', '', '', '', 33528),
(54553, 'frFR', 'Kor\’gresh Froiderage', '', '', '', '', '', '', '', '', 33528),
(54549, 'frFR', 'Kovork', '', '', '', '', '', '', '', '', 33528),
(54468, 'frFR', 'Nalaess Chercheplume', '', '', '', '', '', '', '', '', 33528),
(54036, 'frFR', 'Un processus bien particulier', 'Parlez à Nomi.', 'Comme vous avez pu le remarquer, le vigneron Iltheux est très à cheval sur son processus de fabrication. Cependant, son ancienne recette n\’avait été conçue que pour satisfaire les Sacrenuit.\n\nPour ravir les palais plus variés de la Horde, il va nous falloir autre chose !\n\nParlez à Nomi et voyez ce qu\’il peut imaginer pour pimenter tout ça.', '', '', '', '', '', '', 33528),
(54027, 'frFR', 'Menace écartée', 'Retournez auprès de la Gardelame Sonji au Fort Grommash, à Orgrimmar.', 'Voilà qui devrait apprendre à ces Nagas à garder leurs distances !\n\nJe vous laisse l\’honneur d\’informer la gardelame Sonji que la menace qui planait sur la côte de Zuldazar a été écartée.', '', '', '', '', '', '', 33528),
(54026, 'frFR', 'Travail terminé', 'Retournez voir le Commandant Dresh au Fort Grommash, à Orgrimmar.', 'Je vais rester ici encore un peu afin de m\’assurer que les péons reprennent bien le travail.\n\nVous devriez rentrer à Orgrimmar et informer le commandant Dresh qu\’il n\’a plus à se préoccuper de l\’avant-poste.', '', '', '', '', '', '', 33528),
(53908, 'frFR', 'En attente de notre retour', 'Rentrez au Fort Grommash à Orgrimmar.', 'Rentrons à Orgrimmar.\n\nKiro doit nous y attendre.\n\nMieux vaut ne pas trop tarder.', '', '', '', '', '', '', 33528),
(53907, 'frFR', 'Séance de dégustation', 'Apportez un échantillon du Vin de Nomi au Vigneron Iltheux et obtenez son approbation.', 'Nous voilà bel et bien producteurs de vin, $p !\n\nVoyons si le vigneron approuve notre millésime.\n\nApportez un échantillon à Iltheux et demandez-lui son avis.', '', '', '', '', '', '', 33528),
(53906, 'frFR', 'Fermenté pour la Horde', 'Récupérez les ingrédients nécessaires à la production d\’un vin digne de la Horde.', 'Il ne sera pas nécessaire de complètement remanier la recette du vigneron Iltheux.\n\nQuelques ingrédients uniques et de légères modifications du processus de vinification seront amplement suffisants.\n\nÀ mon avis, l\’ajout de fleurs de feu fermentées fera l\’affaire. Ensuite, nous filtrerons le tout dans une étoffe en fibres d\’aile-de-soie.\n\nPar chance, les vignobles grouillent d\’ailes-de-soie. Quant aux fleurs de feu, le boss Mida doit pouvoir en récupérer, moyennant finance.', '', '', '', '', '', '', 33528),
(53905, 'frFR', 'Valorisation des atouts', 'Assignez de nouveaux rôles à Micah Sabot-Trapu, au Boss Mida et à Nomi.', 'Iltheux ne profite pas pleinement de l\’aide qui lui a été offerte.\n\nNous allons régler ce problème.\n\nAssignez de nouveaux rôles aux ouvriers, confiez-leur des tâches plus adaptées à leurs compétences.\n\nJe me tiens à votre disposition si vous avez besoin de conseils.', '', '', '', '', '', '', 33528),
(53904, 'frFR', 'Les assistants du vigneron', 'Parlez à Micah Sabot-Trapu, au Boss Mida et à Nomi.', 'Le vigneron Iltheux supervise toute la production d\’arquevin destiné à la Horde.\n\nIl est compétent, mais la Horde lui a tout de même envoyé de l\’aide pour accélérer la production.\n\nCe qui a eu l\’effet inverse…\n\nNous devons tirer cette affaire au clair.\n\nPourquoi n\’iriez-vous pas faire le tour du domaine, histoire de voir comment il est géré ? Moi, j\’ai encore quelques questions à poser au vigneron.', '', '', '', '', '', '', 33528),
(53903, 'frFR', 'Rencontre avec Meera', 'Trouvez Meera dans les Vignobles du Crépuscule de Suramar.', 'Nous sommes en bonne voie.\n\nVous voulez bien aller voir Meera ?\n\nJ\’aimerais m\’assurer qu\’elle est arrivée chez le vigneron de Suramar.', '', '', '', '', '', '', 33528),
(53902, 'frFR', 'Le meurtre de l\’imploratrice des marées', 'Tuez l\’Imploratrice des marées Nézara.', 'Si Nézara a perdu son bouclier, elle n\’est pas sans défense pour autant.\n\nUne brute se tient à ses côtés, une brute qui pourrait bien nous donner du fil à retordre. Je vais m\’en charger pendant que vous éliminez l\’imploratrice des marées.', '', 'Chef des Nagas nazeshi qui envahissent les côtes de Zuldazar.', 'Imploratrice des marées Nézara', '', '', '', 33528),
(53901, 'frFR', 'Une diversion explosive', 'Placez les Explosifs instables sur des Lance-harpons nagas, puis déclenchez-les pour créer une diversion.', 'Impossible d\’approcher l\’imploratrice des marées Nézara, les environs sont étroitement gardés. J\’ai donc besoin que vous fassiez une petite diversion.\n\nPrenez ces explosifs. Placez-les sur les lance-harpons nagas. La détonation devrait être bien assez forte pour attirer l\’attention des gardes !', '', '', '', '', '', '', 33528),
(53900, 'frFR', 'Avec leurs propres armes', 'Récupérez $1oa Armes nazeshi sur les soldats nagas de la Crique de la Perle-Maudite.', 'Il va nous falloir des armes spéciales pour éliminer l\’imploratrice des marées Nézara. Heureusement, les Nagas en ont visiblement tout un stock.\n\nNous allons retourner ces armes contre leurs propriétaires. Vous et moi ne sommes pas $gdépourvus:dépourvues; de talent en ce domaine.\n\nRécupérez-en tout un assortiment, il nous en faudra plus d\’une.', '', '', '', '', '', '', 33528),
(53899, 'frFR', 'En périphérie', 'Trouvez Nisha sur la côte sud de Zuldazar.', 'Si le problème du commandant est réglé, vous devriez aller voir où en est Nisha.\n\nVotre aide lui sera certainement utile.', '', '', '', '', '', '', 33528),
(53898, 'frFR', 'Force et honneur', 'Affrontez le Contremaître Magrok en faisant étalage de votre force et de votre honneur.', 'Ces péons ont vraiment l\’air heureux, non ? Ils reprendront du service dès demain matin, c\’est certain.\n\nMais tant que leur chef n\’aura pas été maté, le risque d\’une nouvelle révolte ne sera pas tout à fait écarté.\n\nLancez-lui un défi.\n\nFaites-lui une démonstration de la puissance véritable de la Horde, mais aussi de l\’honneur qu\’il y a à se montrer clément.', '', 'Meneur de la révolte des péons de Frakass.', '', '', '', '', 33528),
(53897, 'frFR', 'Une fête en votre honneur', 'Informez le Contremaître Magrok que la Horde organise une fête en l\’honneur des péons.', 'Je pense avoir tout le nécessaire pour faire de cette soirée un triomphe.\n\nIl ne nous reste plus qu\’à nous assurer que les péons viendront.\n\nDites à leur chef que la Horde organise une fête en leur honneur.\n\nIls ne voudront certainement pas passer à côté d\’un festin gratuit.', '', '', '', '', '', '', 33528),
(53895, 'frFR', 'Promotions de péons !', 'Donnez une promotion à certains des Péons de Frakass dans la Planque des péons.', 'Je comprends la détresse des péons. Ils devraient être récompensés à la hauteur des efforts qu\’ils fournissent.\n\nLa Horde n\’acceptera sans doute pas d\’augmenter leur salaire, mais rien ne nous empêche de les promouvoir.\n\nUn autre titre que simple péon, n\’importe lequel, les aiderait sûrement à prendre confiance en eux.', '', '', '', '', '', '', 33528),
(53894, 'frFR', 'Des réparations utiles', 'Récupérez $1oa morceaux de Minerai du Crépuscule afin que Kiro puisse réparer les outils des péons.', 'Les péons ont raison, ces outils sont pathétiques.\n\nComment peut-on attendre d\’eux qu\’ils fassent du bon travail si on ne leur fournit pas un équipement convenable ?\n\nJe dois pouvoir faire les réparations nécessaires, mais il va me falloir du minerai.', '', '', '', '', '', '', 33528),
(53893, 'frFR', 'Un petit geste de bonne volonté', 'Récupérez $1oa Flanchets de sabre, $2oa pièces de Viande de worg et $3oa Morceaux de poularde.', 'On dirait que les péons ne se sentent pas appréciés à leur juste valeur. Ils accomplissent un travail important pour la Horde, mais leur zèle passe souvent inaperçu. Un petit geste de bonne volonté ferait sans doute des miracles.\n\nPréparons un festin en leur honneur. Nous aurons besoin d\’une très grande quantité de viande pour satisfaire leur énorme appétit. Heureusement, j\’ai un totem qui nous sera sûrement d\’une aide précieuse.\n\nRécupérez la viande, et je me charge de préparer un repas qui leur remontera le moral.', '', '', '', '', '', '', 33528),
(53892, 'frFR', 'Où sont passés les ouvriers ?', 'Découvrez où sont partis les Péons de Frakass.', 'Regardez cette hache, $p. Il y a encore des traces de sueur sur le manche. Les ouvriers étaient encore là il y a peu.\n\nVoyons si Sasha peut flairer leur piste.', '', '', '', '', '', '', 33528),
(53891, 'frFR', 'Ce n\’est pas la taille du problème qui compte', 'Rejoignez Kiro dans les Hautes-terres du Crépuscule.', 'Ces troubles peuvent sembler mineurs, mais ils finiront par sérieusement affecter la Horde si rien n\’est fait.\n\nNous devons proposer notre aide.\n\nLes Vulpérins sont doués pour résoudre les problèmes, aussi petits ou grands soient-ils.\n\nJe vais aller jeter un coup d\’œil à l\’avant-poste. Nisha et Meera s\’occuperont des autres.\n\nRetrouvez-moi dans les hautes-terres du Crépuscule lorsque vous serez $gprêt:prête;.', '', '', '', '', '', '', 33528),
(53890, 'frFR', 'À nouveaux alliés, nouveaux problèmes', 'Trouvez ce qui préoccupe le Commandant Dresh, la Gardelame Sonji et la Première arcaniste Thalyssra.', 'Baine est très occupé, cela ne fait aucun doute. Accepter de nouveaux alliés, c\’est aussi s\’attirer de nouveaux ennuis.\n\nNous pourrions identifier ce qui trouble la Horde et tâcher d\’y remédier.\n\nUne fois que Baine sera moins débordé, il verra peut-être notre vraie valeur.', '', '', '', '', '', '', 33528),
(53889, 'frFR', 'Une déclaration d\’intention', 'Soyez témoin de la déclaration de Kiro.', 'Notre caravane est prête à explorer le monde qui s\’étend au-delà des dunes. Pour autant, la lame de Nisha ne peut être notre seule défense face aux périls qui nous guettent.\n\nC\’est la raison de notre venue ici.\n\nNous entendons rejoindre la Horde.', '', '', '', '', '', '', 33528),
(53870, 'frFR', 'Des visiteurs au fort Grommash', 'Allez à la rencontre de vos hôtes au Fort Grommash.', '$p, il paraît qu\’une caravane est arrivée au fort Grommash. Ces Vulpérins souhaitent s\’entretenir avec la Horde et ont demandé à ce que vous soyez $gprésent:présente;.\n\nJ\’ai bien peur que l\’heure ne soit pas aux réceptions, aussi tâchez de les rencontrer au plus vite.', '', '', '', '', '', '', 33528),
(53857, 'frFR', 'Cap\’taine Gorok', '', '', '', '', '', '', '', '', 33528),
(53304, 'frFR', 'Épine de sirène épanouie', '', '', '', '', '', '', '', '', 33528),
(53274, 'frFR', 'Ancoracée luxuriante', '', '', '', '', '', '', '', '', 33528),
(52798, 'frFR', 'Quelques accusations de plus', '', '', '', '', '', '', '', '', 33528),
(52771, 'frFR', 'Siège de Boralus : briser les chaînes', '', '', '', '', '', '', '', '', 33528),
(52410, 'frFR', 'Commande : solstite', '', '', '', '', '', '', '', '', 33528),
(52240, 'frFR', 'Panique dans le bosquet', 'Venez à bout du Déchiqueteur monstrueux.', 'Maudits soient ces gobelins et leurs machines infernales !\n\nIls utilisent un déchiqueteur pour profaner notre bosquet sacré. \n\nNous devons à tout prix détruire cette monstruosité !', '', 'Arrêtez-le avant qu\’il ne détruise le bosquet des Anciens !', 'Déchiqueteur monstrueux', '', '', 'Pénétrez dans les profondeurs du Bosquet des Anciens pour y retrouver Delaryn.', 33528),
(51895, 'frFR', 'Masure l\’Errant', '', '', '', '', '', '', '', '', 33528);
