(49991, 'frFR', 'Plus douce sera la chute', 'Donnez 100 pièces d\’or à Quinsy Pied-Plume pour qu\’il lance Chute lente sur vous chaque fois que vous êtes à proximité.', 'Bienvenue à Zuldazar, $gmon cher:ma chère:r; $pr !\n\nJ\’ai arpenté les moindres recoins de cette merveilleuse cité, et je peux vous dire que j\’ai les pieds en compote !\n\nJ\’ai donc décidé d\’offrir un service à mes puissants amis de la Horde : la Chute en douceur de Pied-Plume !\n\nOui, je sais ce que vous pensez : en règle générale, une chute d\’une grande hauteur est plutôt évocatrice de hurlements, de douleur et de mort prématurée.\n\nMAIS PAS AVEC PIED-PLUME !\n\nEn échange d\’un unique paiement d\’une somme modique, je vous permettrai de toujours descendre de cette ziggourat dans le calme et la volupté.', '', '', '', '', '', '', 33528),
(49055, 'frFR', 'Cherche-oreille', '', '', '', '', '', '', '', '', 33528),
