(48176, 'frFR', 'Gros ennuis à Tortoga', 'Parlez à Toki à Tortoga.', 'J\’ai reçu un message réclamant l\’aide d\’une lame à Tortoga. Les Chercheurs tortollans qui s\’y trouvent font l\’admiration du roi Rastakhan et de ce fait, ils bénéficient de certains privilèges.$b$bAllez voir de quoi ils ont besoin et vous obtiendrez la faveur du roi.$b$bEt surtout, $p, montrez-vous $grespectueux:respectueuse;. Les Tortollans vivent suffisamment longtemps pour demander des comptes à vos petits-enfants.', '', '', '', '', '', '', 33528),
