(45405, 'frFR', 'À l\’assaut du sanctum', 'Parlez à Oculeth pour donner l\’assaut.', 'Il est temps. Valtrois est prête à détruire la barrière qui protège la brèche dans le sanctum. Je vais vous téléporter jusqu\’à la brèche, puis il vous reviendra de sécuriser la zone.$b$bPrenez ces orbes de télémancie. Si vous avez besoin d\’assistance, utilisez-les pour invoquer des Flétris.$b$bNous devons frapper avant que l\’ennemi ait le temps de reconstituer ses défenses. Prévenez-moi quand vous serez $gprêt:prête;, et nous pourrons commencer.', '', '', '', '', '', '', 33528),
(45053, 'frFR', 'Instructions de voleur', 'Apportez les instructions au Conseil des Six, à Dalaran.', 'Sur cette note rédigée à la va-vite, on peut lire :\n\n« L\’iris de focalisation est nécessaire à l\’un de mes sorts. Rapporte-le-moi pour me prouver que tu es le meilleur de mes apprentici.\n\nConserve bien cette note, il ne faudrait pas qu\’elle tombe entre les mains d\’un quelconque aventurier ! »\n\nSi quelqu\’un cherche à voler l\’iris de focalisation, il faut absolument en avertir le Kirin Tor.', '', '', '', '', '', '', 33528),
