(31526, 'frFR', 'Un défi de taille : Durand', 'Terminez le Monastère Écarlate en mode Défi.', '$n, il faut que vous rassembliez un groupe résolu et que vous vous rendiez au monastère Écarlate. Une fois là-bas, activez l\'orbe de défi et trouvez et châtiez Durand d\’une fureur juste.$B$BRevenez me voir quand vous aurez accompli ce défi et je vous récompenserai généreusement.', '', '', '', '', '', '', 33528),
(27925, 'frFR', 'Des fouilles efficaces', 'Apportez le manuel intitulé « Fouilles efficaces » à Belloc Brillelame à l\'Accostage de Schnottz.', 'Ce manuel décrit des théories extravagantes sur la manière de diriger efficacement de larges groupes d\'ouvriers tandis qu\'ils se livrent au travail manuel de divers types de fouilles.$B$BIl vous apparaît clairement que l\'auteur de l\'ouvrage n\'est autre que la personnalité en charge des pilleurs très offensifs qui sévissent ici.$B$BUne présentation s\'impose.', '', 'Vous ne pouvez que supposer que cette image représente cet auteur égocentrique.', '', '', '', '', 33528),
(8852, 'frFR', 'Dix chevalières pour des fournitures militaires', '', '', '', '', '', '', '', '', 33528),
(8847, 'frFR', 'Dix chevalières pour des fournitures militaires', '', '', '', '', '', '', '', '', 33528),
(8572, 'frFR', 'La tenue de combat de vétéran', 'Ramener 7 Badges cénariens de combat, 4 Badges cénariens de logistique et 4 Badges cénariens de tactique à Vargus, au Fort cénarien en Silithus. Vous devrez aussi être $gHonoré:Honorée; par le Cercle cénarien pour terminer cette quête.', 'Les insignes que vous récupérez à la fin de vos missions tactiques, logistiques et de combat pour le compte du Fort cénarien ne sont pas seulement destinés à faire joli, $n.$B$BConservez-les soigneusement. Au fur et à mesure que vous ferez la preuve de votre loyauté envers notre organisation, vous pourrez les échanger contre le matériel que nous réservons à nos alliés les plus proches.', '', '', '', '', '', '', 33528),
(8538, 'frFR', 'Les quatre ducs', 'Trouver un moyen d\’invoquer et de tuer les duc des Cendres, le duc des Profondeurs, le duc des Zéphyrs et le duc des Éclats, puis revenir voir le commandant Mar\'alith au Fort cénarien. Pour terminer cette quête, vous devez aussi apporter le Briefing tactique V.', 'Les liens entre le Marteau du crépuscule et le Conseil abyssal s\’avèrent plus étroits que nous le pensions.$B$BNous soupçonnons des nobles élémentaires connus sous le nom de « ducs abyssaux » d\’être l\’une des forces qui organisent les sectateurs du Marteau du crépuscule. Trouvez un moyen de les attirer sur notre plan d\’existence et détruisez-les.$B$BVotre détermination et vos exploits passés nous ont conduits à vous sélectionner pour cette mission. Nous sommes certains que vous réussirez.', '', '', '', '', '', '', 33528),
(8523, 'frFR', 'L\'Alliance a besoin de plus de bandages en étoffe runique !', 'Ramener 20 bandages en étoffe runique au gardien Lunombrage à l\’aérodrome de Dun Morogh.', 'Nous nous retrouvons une fois de plus pour discuter d\’une affaire urgente, $c. Je vous remercie encore pour vos précédents efforts. Peu de gens se seraient montrés aussi généreux et altruistes. Mais il reste beaucoup à faire.$B$B$n, acceptez-vous de récolter de nouveaux bandages en étoffe runique et de me les ramener ?', '', '', '', '', '', '', 33528),
