(7882, 'frFR', 'Des tuniques pour les forains', '', '', '', '', '', '', '', '', 33528),
(7623, 'frFR', 'Le seigneur Creuseplaie', 'Achetez des Potions des ténèbres à Gorzeeki à l\'Autel des Tempêtes, dans les Steppes Ardentes.$B$BServez-vous-en pour vous rendre à Jaedenar, dans Gangrebois et parlez au seigneur Creuseplaie à l\'intérieur du Fort des Ombres.', 'Mor\’zul me dit que vous voulez ouvrir un portail vers Xoroth. Pour cela, vous aurez besoin de poussière d\’étoile xorothienne. Ce n\’est pas simple à trouver sur Azeroth !$B$BMais une créature pourrait pour aider : le seigneur Creuseplaie, à Jaedenar, le siège du Conseil des ombres. Allez lui parler, et il se séparera peut-être d\’un peu de poussière.$B$BMais si vous allez à Jaedenar, vous aurez sans doute besoin de porter sur vous le parfum maléfique du Conseil des ombres. Pour cela, je vous propose mes potions des ténèbres, mais elles ne sont pas bon marché…', '', '', '', '', '', '', 33528),
(6001, 'frFR', 'Corps et cœur', 'Utiliser la Poussière de lune cénarienne sur la Pierre des séléniens d\’Auberdine pour invoquer Lunegriffe. Affronter Lunegriffe, et gagner la force physique et spirituelle qu\’il possède.$B$BQuand cela est fait, parler à Mathrengyl Pasdelours, à Darnassus.', 'A l\’est d\’Auberdine se trouvent plusieurs grottes de séléniens. Celle qui est la plus proche d\’Auberdine contient une pierre des séléniens. Lunegriffe, le défenseur de la pierre, ne vous affrontera que si la poussière de lune cénarienne est appliquée sur la pierre. Lunegriffe possède une force que vous devez vous approprier, comme doivent le faire tous les druides de la Griffe.$B$BVous avez gagné le droit d\’utiliser cette poussière de lune cénarienne, $n... Maintenant, montrez-moi que vous avez aussi gagné celui d\'acquérir la force physique et spirituelle que tout druide digne de ce nom se doit de posséder !', 'Combattre Lunegriffe et gagner la force du corps et du cœur qu\'il possède', '', '', '', '', 'Retournez voir Mathrengyl Pasdelours à l\'Enclave cénarienne, à Darnassus.', 33528),
(4788, 'frFR', 'Les dernières tablettes', 'Apportez la Cinquième et la Sixième tablette Mosh\'aru au Prospecteur Botte-de-fer, en Tanaris.', 'Pendant que je consulte la troisième et la quatrième tablette Mosh\'aru, il faut que vous trouviez la cinquième et la sixième ! Cela ne sera pas facile, car elles se trouvent entre les mains des trolls brûleronce, au pic Rochenoire.Ce pic est une sombre montagne de feu située entre les steppes Ardentes et la gorge des Vents brûlants.$B$BBonne chance, $n. Le pic Rochenoire est un endroit malfamé...', '', '', '', '', '', '', 33528),
(2440, 'frFR', 'Les disques de platine', 'Apporter le Bon de récompense à Bena Sabot-d\’Hiver aux Pitons-du-Tonnerre.', 'Je vais concentrer mes travaux sur ces disques ; ils me révéleront bientôt leur raison d\’être.$B$B$n, je vais vous récompenser pour la diligence avec laquelle vous m\'avez apporté ceci. Portez ce bon à Bena Sabot-d\'Hiver, le maître des alchimistes des Pitons-du-Tonnerre. Elle vous offrira un objet spécial que vous apprécierez sûrement et elle vous proposera un choix de breuvages magiques de ma réserve personnelle.$B$BRevenez vite me voir, car je sens qu\'il y a du pain sur la planche pour étudier cette trouvaille.', '', '', '', '', '', '', 33528),
(1241, 'frFR', 'Un diplomate a disparu', 'Trouver Jorgen dans la cité de Hurlevent.', 'Récemment, un diplomate a été envoyé à Theramore pour rencontrer Jaina Portvaillant. Ce diplomate n\'est jamais arrivé.$B$BJe pense que les Défias sont impliqués dans ce complot, mais je ne vois pas de quelle manière. La disparition du diplomate n\'a pas encore attiré l\'attention du public, mais cette situation ne durera pas.$B$BDes agents du roi sont déjà en train de fouiller la ville à la recherche d\'indices, mais j\'aimerais consulter mes propres contacts.$B$BDans la vallée des Héros vit un vieil ami à moi qui s\'appelle Jorgen. Trouvez-le, donnez-lui cette note et suivez ses instructions.', '', '', '', '', '', '', 33528),
(1125, 'frFR', 'Les esprits de Sudevent', 'Libérer l\’esprit de 8 Druides torturés et de 8 Sentinelles torturées, dans le village de Sudevent, puis revenir voir Layo Heurtétoile, au cimetière du Repos des Vaillants de Silithus.', 'Au sud-ouest se trouve un endroit terrible : les ruines du village de Sudevent. C\’est là que nous devons commencer à travailler, $n.$B$BD\’après ce que j\’ai appris, ce village fut jadis une base des elfes de la nuit en Silithus. Il est maintenant envahi par des ruches de silithides. Je ne peux penser sans la plus grande horreur comment le village fut jadis emporté et submergé...$B$BLes esprits torturés des druides et des Sentinelles hantent les ruines, sans but. Explorez cet endroit et libérez les âmes de ces malheureux.', '', '', '', '', '', '', 33528),
(730, 'frFR', 'Des problèmes à Sombrivage ?', 'Aller à Auberdine et chercher des indices sur les nains de l\'équipe de fouilles.', 'Il est plaisant de voir qu\'$gun:une:c; $c s\'intéresse à l\'archéologie et aux grandes merveilles de notre monde.$b$bBien souvent, notre métier est considéré comme un simple passe-temps par nos amis de l\'Alliance. Mais ce que la plupart d\'entre eux ne comprennent pas, c\'est que les récentes découvertes dans Khaz Modan ont prouvé que de grandes et mortelles puissances menacent tout Azeroth, de Lordaeron en Kalimdor.$b$bJe suis vraiment inquiet pour le groupe que j\'ai envoyé à Sombrivage. Je suis sans nouvelles de lui depuis des semaines.$b$bAllez à Auberdine et cherchez des indices sur ce qu\'il lui arrive.', '', '', '', '', '', '', 33528),
(336, 'frFR', 'Une bière noble', 'Apportez la Bière brune de la Griffe noire au Seigneur Wishock, dans la Chambre du requérant.', 'Le seigneur Wishock est comme tous les hommes, il a ses faiblesses. Il se trouve que la sienne est un penchant prononcé pour la bouteille. Quelle sidérante hypocrisie. Ce pauvre imbécile passe ses journées à essayer de faire fermer notre petite « taverne », et ses nuits à l\’étage à rallonger une ardoise qu\’il ne payera jamais. Eh bien nous allons voir comment Wishock apprécie la cuvée spéciale que je lui ai préparée : la bière brune de la Griffe noire. C\’est du brutal, $n.$b$bApportez-lui et voyez comment il réagit. Probable que ce vieil idiot soit en train de traîner autour de la chambre du Requérant.', '', '', '', '', '', '', 33528);
